ML8.Note 1.n.  Triethylaluminium (TEA) (CAS 97-93-8), trimethylaluminium (TMA) (CAS 75-24-1), and other pyrophoric metal alkyls and aryls of lithium, sodium, magnesium, zinc or boron;\nML8.Note 1.o.  Nitrocellulose (CAS 9004-70-0);\nML8.Note 1.p.  Nitroglycerin (or glyceroltrinitrate, trinitroglycerine) (NG) (CAS 55-63-0);\nML8.Note 1.q.  2,4,6-trinitrotoluene (TNT) (CAS 118-96-7);\nML8.Note 1.r.  Ethylenediaminedinitrate (EDDN) (CAS 20829-66-7);\nML8.Note 1.s.  Pentaerythritoltetranitrate (PETN) (CAS 78-11-5);\nML8.Note 1.t.  Lead azide (CAS 13424-46-9), normal lead styphnate (CAS 15245-44-0) and basic lead styphnate (CAS 12403-82-6), and primary explosives or priming compositions containing azides or azide complexes;\nML8.Note 1.u.  Triethyleneglycoldinitrate (TEGDN) (CAS 111-22-8);\nML8.Note 1.v.  2,4,6-trinitroresorcinol (styphnic acid) (CAS 82-71-3);\nML8.Note 1.w.  Diethyldiphenylurea; (CAS 85-98-3); dimethyldiphenylurea;\nML8.Note 1.w.  (CAS 611-92-7), methylethyldiphenylurea; [Centralites]\nML8.Note 1.x.  N,N-diphenylurea (unsymmetrical diphenylurea) (CAS 603-54-3);\nML8.Note 1.y.  Methyl-N,N-diphenylurea (methyl unsymmetrical diphenylurea)\nML8.Note 1.y.  (CAS 13114-72-2);\nML8.Note 1.z.  Ethyl-N,N-diphenylurea (ethyl unsymmetrical diphenylurea)\nML8.Note 1.z.  (CAS 64544-71-4);\nML8.Note 1.aa.  2-Nitrodiphenylamine (2-NDPA) (CAS 119-75-5);\nML8.Note 1.bb.  4-Nitrodiphenylamine (4-NDPA) (CAS 836-30-6);\nML8.Note 1.cc.  2,2-dinitropropanol (CAS 918-52-5);\nML8.Note 1.dd.  Nitroguanidine (CAS 556-88-7) (see 1.C.11.d. on the Dual-Use List).\nML8.Note 2.  ML8. does not apply to ammonium perchlorate (ML8.d.2.), NTO (ML8.a.18.) or catocene (ML8.f.4.b.), and meeting all of the following:\nML8.Note 2.a.  Specially shaped and formulated for civil-use gas generation devices;\nML8.Note 2.b.  Compounded or mixed, with non-active thermoset binders or plasticizers, and having a mass of less than 250 g;\nML8.Note 2.c.  Having a maximum of 80% ammonium perchlorate (ML8.d.2.) in mass of active material;\nML8.Note 2.d.  Having less than or equal to 4 g of NTO (ML8.a.18.); and\nML8.Note 2.e.  Having less than or equal to 1 g of catocene (ML8.f.4.b.).\n'),
(39544,'','','','ML14.  \'Specialised equipment for military training\' or for simulating military scenarios, simulators specially designed for training in the use of any firearm or weapon specified by ML1. or ML2., and specially designed components and accessories therefor.\nML14.Technical Note.  The term \'specialised equipment for military training\' includes military types of attack trainers, operational flight trainers, radar target trainers, radar target generators, gunnery training devices, anti-submarine warfare trainers, flight simulators (including human-rated centrifuges for pilot/astronaut training), radar trainers, instrument flight trainers, navigation trainers, missile launch trainers, target equipment, drone \"aircraft\", armament trainers, pilotless \"aircraft\" trainers, mobile training units and training equipment for ground military operations.\nML14.Note 1.   ML14. includes image generating and interactive environment systems for simulators, when specially designed or modified for military use.\nML14.Note 2.  ML14. does not apply to equipment specially designed for training in the use of hunting or sporting weapons.\n'),
(39545,'','','','ML1.  Smooth-bore weapons with a calibre of less than 20 mm, other arms and automatic weapons with a calibre of 12.7 mm (calibre 0.50 inches) or less and accessories, as follows, and specially designed components therefor:\nML1.Note  ML1. does not apply to:\nML1.Note.a.  Firearms specially designed for dummy ammunition and which are incapable of discharging a projectile;\nML1.Note.b.  Firearms specially designed to launch tethered projectiles having no high explosive charge or communications link, to a range of less than or equal to 500 m.;\nML1.Note.c.  Weapons using non-centre fire cased ammunition and which are not of the fully automatic firing type;\nML1.Note.d.  Deactivated firearms.\nML1.b.  Smooth-bore weapons as follows:\nML1.b.Note  ML1.b. does not apply to the following:\nML1.b.Note.a.  Smooth-bore weapons manufactured earlier than 1938;\nML1.b.Note.b.  Reproductions of smooth-bore weapons, the originals of which were manufactured earlier than 1890.\nML1.b.Note.c.  Smooth-bore weapons used for hunting or sporting purposes. These weapons must not be specially designed for military use or of the fully automatic firing type;\nML1.b.Note.d.  Smooth-bore weapons specially designed for any of the following:\nML1.b.Note.d.1.  Slaughtering of domestic animals;\nML1.b.Note.d.2.  Tranquilizing of animals;\nML1.b.Note.d.3.  Seismic testing;\nML1.b.Note.d.4.  Firing of industrial projectiles; or\nML1.b.Note.d.5.  Disrupting Improvised Explosive Devices (IEDs).\nML1.b.Note.d.5.N.B.  For disruptors, see ML4. and 1.A.6. on the Dual-Use List.\n'),
(39546,'','','','ML22.  Technology as follows:\nML22.a.  Technology, other than specified in ML22.b, which is \"required\" for the \"development\", \"production\", operation, installation, maintenance (checking), repair, overhaul or refurbishing of items specified by the Munitions List;\nML22.b.  Technology as follows:\nML22.b.1.  Technology \"required\" for the design of, the assembly of components into, and the operation, maintenance and repair of, complete production installations for items specified by the Munitions List, even if the components of such production installations are not specified;\nML22.b.2.  Technology \"required\" for the \"development\" and \"production\" of small arms, even if used to produce reproductions of antique small arms;\nML22.b.3.  Not used since 2013\nML22.b.3.N.B.  See ML22.a. for \"technology\" previously specified by ML22.b.3.\nML22.b.4.  Not used since 2013\nML22.b.4.N.B.  See ML22.a. for \"technology\" previously specified by ML22.b.4.\nML22.b.5.  Technology \"required\" exclusively for the incorporation of \"biocatalysts\", specified by ML7.i.1., into military carrier substances or military material.\nML22.Note 1.  Technology \"required\" for the \"development\", \"production\", operation, installation, maintenance (checking), repair, overhaul or refurbishing of items specified by the Munitions List remains under control even when applicable to any item not specified by the Munitions List.\nML22.Note 2.  ML22 does not apply to:\nML22.Note 2.a.  Technology that is the minimum necessary for the installation, operation, maintenance (checking) or repair, of those items which are not controlled or whose export has been authorised;\nML22.Note 2.b.  Technology that is \"in the public domain\", \"basic scientific research\" or the minimum necessary information for patent applications;\nML22.Note 2.c.  Technology for magnetic induction for continuous propulsion of civil transport devices.\n'),
(39547,'','','','ML8.  Energetic materials and related substances, as follows:\nML8.Technical Notes.1.  For the purposes of ML8., excluding ML8.c.11. or ML8.c.12., \'mixture\' refers to a composition of two or more substances with at least one substance being listed in the ML8 sub-items.\nML8.Technical Notes.2.  Any substance listed in the ML8 sub-items is subject to this list, even when utilised in an application other than that indicated.  (e.g., TAGN is predominantly used as an explosive but can also be used either as a fuel or an oxidizer.)\nML8.Technical Notes.3.  For the purposes of ML8., particle size is the mean particle diameter on a weight or volume basis.  International or equivalent national standards will be used in sampling and determining particle size.\nML8.b.  Propellants as follows:\nML8.b.7.  Propellants, not specified elsewhere in the Munitions List, specially designed for military use;\nML8.Note 1.  ML8. does not apply to the following substances unless they are compounded or mixed with the \"energetic material\" specified by ML8.a. or powdered metals specified by ML8.c.:\nML8.Note 1.a.  Ammonium picrate (CAS 131-74-8);\nML8.Note 1.b.  Black powder;\nML8.Note 1.c.  Hexanitrodiphenylamine (CAS 131-73-7);\nML8.Note 1.d.  Difluoroamine (CAS 10405-27-3);\nML8.Note 1.e.  Nitrostarch (CAS 9056-38-6);\nML8.Note 1.f.  Potassium nitrate (CAS 7757-79-1);\nML8.Note 1.g.  Tetranitronaphthalene;\nML8.Note 1.h.  Trinitroanisol;\nML8.Note 1.i.  Trinitronaphthalene;\nML8.Note 1.j.  Trinitroxylene;\nML8.Note 1.k.  N-pyrrolidinone; 1-methyl-2-pyrrolidinone (CAS 872-50-4);\nML8.Note 1.l.  Dioctylmaleate (CAS 142-16-5);\nML8.Note 1.m.  Ethylhexylacrylate (CAS 103-11-7);\nML8.Note 1.n.  Triethylaluminium (TEA) (CAS 97-93-8), trimethylaluminium (TMA) (CAS 75-24-1), and other pyrophoric metal alkyls and aryls of lithium, sodium, magnesium, zinc or boron;\nML8.Note 1.o.  Nitrocellulose (CAS 9004-70-0);\nML8.Note 1.p.  Nitroglycerin (or glyceroltrinitrate, trinitroglycerine) (NG) (CAS 55-63-0);\nML8.Note 1.q.  2,4,6-trinitrotoluene (TNT) (CAS 118-96-7);\nML8.Note 1.r.  Ethylenediaminedinitrate (EDDN) (CAS 20829-66-7);\nML8.Note 1.s.  Pentaerythritoltetranitrate (PETN) (CAS 78-11-5);\nML8.Note 1.t.  Lead azide (CAS 13424-46-9), normal lead styphnate (CAS 15245-44-0) and basic lead styphnate (CAS 12403-82-6), and primary explosives or priming compositions containing azides or azide complexes;\nML8.Note 1.u.  Triethyleneglycoldinitrate (TEGDN) (CAS 111-22-8);\nML8.Note 1.v.  2,4,6-trinitroresorcinol (styphnic acid) (CAS 82-71-3);\nML8.Note 1.w.  Diethyldiphenylurea; (CAS 85-98-3); dimethyldiphenylurea;\nML8.Note 1.w.  (CAS 611-92-7), methylethyldiphenylurea; [Centralites]\nML8.Note 1.x.  N,N-diphenylurea (unsymmetrical diphenylurea) (CAS 603-54-3);\nML8.Note 1.y.  Methyl-N,N-diphenylurea (methyl unsymmetrical diphenylurea)\nML8.Note 1.y.  (CAS 13114-72-2);\nML8.Note 1.z.  Ethyl-N,N-diphenylurea (ethyl unsymmetrical diphenylurea)\nML8.Note 1.z.  (CAS 64544-71-4);\nML8.Note 1.aa.  2-Nitrodiphenylamine (2-NDPA) (CAS 119-75-5);\nML8.Note 1.bb.  4-Nitrodiphenylamine (4-NDPA) (CAS 836-30-6);\nML8.Note 1.cc.  2,2-dinitropropanol (CAS 918-52-5);\nML8.Note 1.dd.  Nitroguanidine (CAS 556-88-7) (see 1.C.11.d. on the Dual-Use List).\nML8.Note 2.  ML8. does not apply to ammonium perchlorate (ML8.d.2.), NTO (ML8.a.18.) or catocene (ML8.f.4.b.), and meeting all of the following:\nML8.Note 2.a.  Specially shaped and formulated for civil-use gas generation devices;\nML8.Note 2.b.  Compounded or mixed, with non-active thermoset binders or plasticizers, and having a mass of less than 250 g;\nML8.Note 2.c.  Having a maximum of 80% ammonium perchlorate (ML8.d.2.) in mass of active material;\nML8.Note 2.d.  Having less than or equal to 4 g of NTO (ML8.a.18.); and\nML8.Note 2.e.  Having less than or equal to 1 g of catocene (ML8.f.4.b.).\n'),
(39548,'','','','ML21.  Software as follows:\nML21.a.  Software specially designed or modified for any of the following:\nML21.a.2.  Development or \"production\" of materials specified by the Munitions List; or\n'),
(39549,'','','','ML2.  Smooth-bore weapons with a calibre of 20 mm or more, other weapons or armament with a calibre greater than 12.7 mm (calibre 0.50 inches), projectors and accessories, as follows, and specially designed components therefor:\nML2.a.  Guns, howitzers, cannon, mortars, anti-tank weapons, projectile launchers, military flame throwers, rifles, recoilless rifles, smooth-bore weapons and signature reduction devices therefor;\nML2.a.Note 1  ML2.a. includes injectors, metering devices, storage tanks and other specially designed components for use with liquid propelling charges for any of the equipment specified by ML2.a.\nML2.a.Note 2  ML2.a. does not apply to weapons as follows:\nML2.a.Note 2.a.  Rifles, smooth-bore weapons and combination guns, manufactured earlier than 1938;\nML2.a.Note 2.b.  Reproductions of rifles, smooth-bore weapons and combination guns, the originals of which were manufactured earlier than 1890;\nML2.a.Note 2.c.  Guns, howitzers, cannons, mortars, manufactured earlier than 1890;\nML2.a.Note 2.d.  Smooth-bore weapons used for hunting or sporting purposes.  These weapons must not be specially designed for military use or of the fully automatic firing type;\nML2.a.Note 2.e.  Smooth-bore weapons specially designed for any of the following:\nML2.a.Note 2.e.1.  Slaughtering of domestic animals;\nML2.a.Note 2.e.2.  Tranquilizing of animals;\nML2.a.Note 2.e.3.  Seismic testing;\nML2.a.Note 2.e.4.  Firing of industrial projectiles; or\nML2.a.Note 2.e.5.  Disrupting Improvised Explosive Devices (IEDs);\nML2.a.Note 2.e.5.N.B.  For disruptors, see ML4. and 1.A.6. on the Dual-Use List.\nML2.a.Note 2.f.  Hand-held projectile  launchers specially designed to launch tethered projectiles having no high explosive charge or communications link, to a range of less than or equal to 500 m.\nML2.Note  ML2.b. does not apply to signal pistols.\n'),
(39550,'','','','ML8.  Energetic materials and related substances, as follows:\nML8.Technical Notes.1.  For the purposes of ML8., excluding ML8.c.11. or ML8.c.12., \'mixture\' refers to a composition of two or more substances with at least one substance being listed in the ML8 sub-items.\nML8.Technical Notes.2.  Any substance listed in the ML8 sub-items is subject to this list, even when utilised in an application other than that indicated.  (e.g., TAGN is predominantly used as an explosive but can also be used either as a fuel or an oxidizer.)\nML8.Technical Notes.3.  For the purposes of ML8., particle size is the mean particle diameter on a weight or volume basis.  International or equivalent national standards will be used in sampling and determining particle size.\nML8.c.  Pyrotechnics, fuels and related substances, as follows, and \'mixtures\' thereof:\nML8.c.12.  Fuel mixtures, \"pyrotechnic\" mixtures or \"energetic materials\", not specified elsewhere in ML8, having all of the following:\nML8.c.12.a.  Containing greater than 0.5% of particles of any of the following:\nML8.c.12.a.1.  Aluminium;\nML8.c.12.a.2.  Beryllium;\nML8.c.12.a.3.  Boron;\nML8.c.12.a.4.  Zirconium;\nML8.c.12.a.5.  Magnesium; or\nML8.c.12.a.6.  Titanium;\nML8.c.12.Note.  ML8.c.12. includes thermites.\nML8.Note 1.  ML8. does not apply to the following substances unless they are compounded or mixed with the \"energetic material\" specified by ML8.a. or powdered metals specified by ML8.c.:\nML8.Note 1.a.  Ammonium picrate (CAS 131-74-8);\nML8.Note 1.b.  Black powder;\nML8.Note 1.c.  Hexanitrodiphenylamine (CAS 131-73-7);\nML8.Note 1.d.  Difluoroamine (CAS 10405-27-3);\nML8.Note 1.e.  Nitrostarch (CAS 9056-38-6);\nML8.Note 1.f.  Potassium nitrate (CAS 7757-79-1);\nML8.Note 1.g.  Tetranitronaphthalene;\nML8.Note 1.h.  Trinitroanisol;\nML8.Note 1.i.  Trinitronaphthalene;\nML8.Note 1.j.  Trinitroxylene;\nML8.Note 1.k.  N-pyrrolidinone; 1-methyl-2-pyrrolidinone (CAS 872-50-4);\nML8.Note 1.l.  Dioctylmaleate (CAS 142-16-5);\nML8.Note 1.m.  Ethylhexylacrylate (CAS 103-11-7);\nML8.Note 1.n.  Triethylaluminium (TEA) (CAS 97-93-8), trimethylaluminium (TMA) (CAS 75-24-1), and other pyrophoric metal alkyls and aryls of lithium, sodium, magnesium, zinc or boron;\nML8.Note 1.o.  Nitrocellulose (CAS 9004-70-0);\nML8.Note 1.p.  Nitroglycerin (or glyceroltrinitrate, trinitroglycerine) (NG) (CAS 55-63-0);\nML8.Note 1.q.  2,4,6-trinitrotoluene (TNT) (CAS 118-96-7);\nML8.Note 1.r.  Ethylenediaminedinitrate (EDDN) (CAS 20829-66-7);\nML8.Note 1.s.  Pentaerythritoltetranitrate (PETN) (CAS 78-11-5);\nML8.Note 1.t.  Lead azide (CAS 13424-46-9), normal lead styphnate (CAS 15245-44-0) and basic lead styphnate (CAS 12403-82-6), and primary explosives or priming compositions containing azides or azide complexes;\nML8.Note 1.u.  Triethyleneglycoldinitrate (TEGDN) (CAS 111-22-8);\nML8.Note 1.v.  2,4,6-trinitroresorcinol (styphnic acid) (CAS 82-71-3);\nML8.Note 1.w.  Diethyldiphenylurea; (CAS 85-98-3); dimethyldiphenylurea;\nML8.Note 1.w.  (CAS 611-92-7), methylethyldiphenylurea; [Centralites]\nML8.Note 1.x.  N,N-diphenylurea (unsymmetrical diphenylurea) (CAS 603-54-3);\nML8.Note 1.y.  Methyl-N,N-diphenylurea (methyl unsymmetrical diphenylurea)\nML8.Note 1.y.  (CAS 13114-72-2);\nML8.Note 1.z.  Ethyl-N,N-diphenylurea (ethyl unsymmetrical diphenylurea)\nML8.Note 1.z.  (CAS 64544-71-4);\nML8.Note 1.aa.  2-Nitrodiphenylamine (2-NDPA) (CAS 119-75-5);\nML8.Note 1.bb.  4-Nitrodiphenylamine (4-NDPA) (CAS 836-30-6);\nML8.Note 1.cc.  2,2-dinitropropanol (CAS 918-52-5);\nML8.Note 1.dd.  Nitroguanidine (CAS 556-88-7) (see 1.C.11.d. on the Dual-Use List).\nML8.Note 2.  ML8. does not apply to ammonium perchlorate (ML8.d.2.), NTO (ML8.a.18.) or catocene (ML8.f.4.b.), and meeting all of the following:\nML8.Note 2.a.  Specially shaped and formulated for civil-use gas generation devices;\nML8.Note 2.b.  Compounded or mixed, with non-active thermoset binders or plasticizers, and having a mass of less than 250 g;\nML8.Note 2.c.  Having a maximum of 80% ammonium perchlorate (ML8.d.2.) in mass of active material;\nML8.Note 2.d.  Having less than or equal to 4 g of NTO (ML8.a.18.); and\nML8.Note 2.e.  Having less than or equal to 1 g of catocene (ML8.f.4.b.).\n'),
(39551,'','','','ML12.  High velocity kinetic energy weapon systems and related equipment, as follows, and specially designed components therefor:\nML12.Note 1.  ML12. includes the following when specially designed for kinetic energy weapon systems:\nML12.Note 1.a.  Launch propulsion systems capable of accelerating masses larger than 0.1 g to velocities in excess of 1.6 km/s, in single or rapid fire modes;\nML12.Note 1.b.  Prime power generation, electric armour, energy storage (e.g., high energy storage capacitors), thermal management, conditioning, switching or fuel-handling equipment; and electrical interfaces between power supply, gun and other turret electric drive functions;\nML12.Note 1.b.N.B.  See also 3.A.1.e.2. on the Dual-Use List for high energy storage capacitors.\nML12.Note 1.c.  Target acquisition, tracking, fire control or damage assessment systems;\nML12.Note 1.d.  Homing seeker, guidance or divert propulsion (lateral acceleration) systems for projectiles.\nML12.Note 2.  ML12. applies to weapon systems using any of the following methods of propulsion:\nML12.Note 2.a.  Electromagnetic;\nML12.Note 2.b.  Electrothermal;\nML12.Note 2.c.  Plasma;\nML12.Note 2.d.  Light gas; or\nML12.Note 2.e.  Chemical (when used in combination with any of the above).\n'),
(39552,'','','','ML21.  Software as follows:\nML21.b.  Specific \"software\", other than that specified by ML21.a., as follows:\nML21.b.4.  Software specially designed for military use and specially designed for Command, Communications, Control and Intelligence (C3I) or Command, Communications, Control, Computer and Intelligence (C4I) applications;\n'),
(39553,'','','','ML10.  Aircraft, \"lighter-than-air vehicles\", \"Unmanned Aerial Vehicles\" (\"UAVs\"), aero-engines and \"aircraft\" equipment, related equipment, and components, as follows, specially designed or modified for military use:\nML10.g.  Aircrew life support equipment, aircrew safety equipment and other devices for emergency escape, not specified in ML10.a., designed for \"aircraft\" specified by ML10.a.;\nML10.g.Note.  ML10.g. does not control aircrew helmets that do not incorporate, or have mountings or fittings for, equipment specified in the Munitions List.\nML10.g.N.B.  For helmets see also ML13.c.\nML10.Note 3.  For the purposes of ML10.a. and ML10.d., specially designed components and related equipment for non-military \"aircraft\" or aero-engines modified for military use applies only to those military components and to military related equipment required for the modification to military use.\n'),
(39554,'','','','ML13.  Armoured or protective equipment, constructions and components, as follows:\nML13.a.  Metallic or non-metallic armoured plate, having any of the following:\nML13.a.1.  Manufactured to comply with a military standard or specification; or\nML13.Note 3.  ML13.c. and d. do not apply to helmets, body armour or protective garments, when accompanying their user for the user\'s own personal protection.\n'),
(39555,'','','','ML22.  Technology as follows:\nML22.b.  Technology as follows:\nML22.b.3.  Not used since 2013\nML22.b.3.N.B.  See ML22.a. for \"technology\" previously specified by ML22.b.3.\nML22.Note 1.  Technology \"required\" for the \"development\", \"production\", operation, installation, maintenance (checking), repair, overhaul or refurbishing of items specified by the Munitions List remains under control even when applicable to any item not specified by the Munitions List.\nML22.Note 2.  ML22 does not apply to:\nML22.Note 2.a.  Technology that is the minimum necessary for the installation, operation, maintenance (checking) or repair, of those items which are not controlled or whose export has been authorised;\nML22.Note 2.b.  Technology that is \"in the public domain\", \"basic scientific research\" or the minimum necessary information for patent applications;\nML22.Note 2.c.  Technology for magnetic induction for continuous propulsion of civil transport devices.\n'),
(39556,'','','','ML8.  Energetic materials and related substances, as follows:\nML8.Technical Notes.1.  For the purposes of ML8., excluding ML8.c.11. or ML8.c.12., \'mixture\' refers to a composition of two or more substances with at least one substance being listed in the ML8 sub-items.\nML8.Technical Notes.2.  Any substance listed in the ML8 sub-items is subject to this list, even when utilised in an application other than that indicated.  (e.g., TAGN is predominantly used as an explosive but can also be used either as a fuel or an oxidizer.)\nML8.Technical Notes.3.  For the purposes of ML8., particle size is the mean particle diameter on a weight or volume basis.  International or equivalent national standards will be used in sampling and determining particle size.\nML8.a.  Explosives as follows, and \'mixtures\' thereof:\nML8.a.32.  Triazoles as follows:\nML8.a.32.f.  DNBT (dinitrobistriazole) (CAS 70890-46-9);\nML8.a.Note.  ML8.a. includes \'explosive co-crystals\'.\nML8.a.Note.Technical Note.  An \'explosive co-crystal\' is a solid material consisting of an ordered three dimensional arrangement of two or more explosive molecules, where at least one is specified in ML8.a.\nML8.Note 1.  ML8. does not apply to the following substances unless they are compounded or mixed with the \"energetic material\" specified by ML8.a. or powdered metals specified by ML8.c.:\nML8.Note 1.a.  Ammonium picrate (CAS 131-74-8);\nML8.Note 1.b.  Black powder;\nML8.Note 1.c.  Hexanitrodiphenylamine (CAS 131-73-7);\nML8.Note 1.d.  Difluoroamine (CAS 10405-27-3);\nML8.Note 1.e.  Nitrostarch (CAS 9056-38-6);\nML8.Note 1.f.  Potassium nitrate (CAS 7757-79-1);\nML8.Note 1.g.  Tetranitronaphthalene;\nML8.Note 1.h.  Trinitroanisol;\nML8.Note 1.i.  Trinitronaphthalene;\nML8.Note 1.j.  Trinitroxylene;\nML8.Note 1.k.  N-pyrrolidinone; 1-methyl-2-pyrrolidinone (CAS 872-50-4);\nML8.Note 1.l.  Dioctylmaleate (CAS 142-16-5);\nML8.Note 1.m.  Ethylhexylacrylate (CAS 103-11-7);\nML8.Note 1.n.  Triethylaluminium (TEA) (CAS 97-93-8), trimethylaluminium (TMA) (CAS 75-24-1), and other pyrophoric metal alkyls and aryls of lithium, sodium, magnesium, zinc or boron;\nML8.Note 1.o.  Nitrocellulose (CAS 9004-70-0);\nML8.Note 1.p.  Nitroglycerin (or glyceroltrinitrate, trinitroglycerine) (NG) (CAS 55-63-0);\nML8.Note 1.q.  2,4,6-trinitrotoluene (TNT) (CAS 118-96-7);\nML8.Note 1.r.  Ethylenediaminedinitrate (EDDN) (CAS 20829-66-7);\nML8.Note 1.s.  Pentaerythritoltetranitrate (PETN) (CAS 78-11-5);\nML8.Note 1.t.  Lead azide (CAS 13424-46-9), normal lead styphnate (CAS 15245-44-0) and basic lead styphnate (CAS 12403-82-6), and primary explosives or priming compositions containing azides or azide complexes;\nML8.Note 1.u.  Triethyleneglycoldinitrate (TEGDN) (CAS 111-22-8);\nML8.Note 1.v.  2,4,6-trinitroresorcinol (styphnic acid) (CAS 82-71-3);\nML8.Note 1.w.  Diethyldiphenylurea; (CAS 85-98-3); dimethyldiphenylurea;\nML8.Note 1.w.  (CAS 611-92-7), methylethyldiphenylurea; [Centralites]\nML8.Note 1.x.  N,N-diphenylurea (unsymmetrical diphenylurea) (CAS 603-54-3);\nML8.Note 1.y.  Methyl-N,N-diphenylurea (methyl unsymmetrical diphenylurea)\nML8.Note 1.y.  (CAS 13114-72-2);\nML8.Note 1.z.  Ethyl-N,N-diphenylurea (ethyl unsymmetrical diphenylurea)\nML8.Note 1.z.  (CAS 64544-71-4);\nML8.Note 1.aa.  2-Nitrodiphenylamine (2-NDPA) (CAS 119-75-5);\nML8.Note 1.bb.  4-Nitrodiphenylamine (4-NDPA) (CAS 836-30-6);\nML8.Note 1.cc.  2,2-dinitropropanol (CAS 918-52-5);\nML8.Note 1.dd.  Nitroguanidine (CAS 556-88-7) (see 1.C.11.d. on the Dual-Use List).\nML8.Note 2.  ML8. does not apply to ammonium perchlorate (ML8.d.2.), NTO (ML8.a.18.) or catocene (ML8.f.4.b.), and meeting all of the following:\nML8.Note 2.a.  Specially shaped and formulated for civil-use gas generation devices;\nML8.Note 2.b.  Compounded or mixed, with non-active thermoset binders or plasticizers, and having a mass of less than 250 g;\nML8.Note 2.c.  Having a maximum of 80% ammonium perchlorate (ML8.d.2.) in mass of active material;\nML8.Note 2.d.  Having less than or equal to 4 g of NTO (ML8.a.18.); and\nML8.Note 2.e.  Having less than or equal to 1 g of catocene (ML8.f.4.b.).\n'),
(39557,'','','','ML18.  \'Production\' equipment and components, as follows:\nML18.Technical Note.  For the purposes of ML18., the term \'production\' includes design, examination, manufacture, testing and checking.\nML18.Note.  ML18.a. and ML18.b. include the following equipment:\nML18.Note.a.  Continuous nitrators;\nML18.Note.b.  Centrifugal testing apparatus or equipment, having any of the following:\nML18.Note.b.1.  Driven by a motor or motors having a total rated horsepower of more than 298 kW (400 hp);\nML18.Note.b.2.  Capable of carrying a payload of 113 kg or more; or\nML18.Note.b.3.  Capable of exerting a centrifugal acceleration of 8 g or more on a payload of 91 kg or more;\nML18.Note.c.  Dehydration presses;\nML18.Note.d.  Screw extruders specially designed or modified for military \"explosive\" extrusion;\nML18.Note.e.  Cutting machines for the sizing of extruded \"propellants\";\nML18.Note.f.  Sweetie barrels (tumblers) 1.85 m or more in diameter and having over 227 kg product capacity;\nML18.Note.g.  Continuous mixers for solid \"propellants\";\nML18.Note.h.  Fluid energy mills for grinding or milling the ingredients of military \"explosives\";\nML18.Note.i.  Equipment to achieve both sphericity and uniform particle size in metal powder listed in ML8.c.8.;\nML18.Note.j.  Convection current converters for the conversion of materials listed in ML8.c.3.\n'),
(39558,'','','','ML9.  Vessels of war (surface or underwater), special naval equipment, accessories, components and other surface vessels, as follows:\nML9.f.  Hull penetrators and connectors, specially designed for military use, that enable interaction with equipment external to a vessel, and components therefor specially designed for military use;\nML9.f.Note.  ML9.f. includes connectors for vessels which are of the single-conductor, multi-conductor, coaxial or waveguide type, and hull penetrators for vessels, both of which are capable of remaining impervious to leakage from without and of retaining required characteristics at marine depths exceeding 100 m; and fibre-optic connectors and optical hull penetrators, specially designed for \"laser\" beam transmission, regardless of depth. ML9.f. does not apply to ordinary propulsive shaft and hydrodynamic control-rod hull penetrators.\n'),
(39559,'','','','ML10.  Aircraft, \"lighter-than-air vehicles\", \"Unmanned Aerial Vehicles\" (\"UAVs\"), aero-engines and \"aircraft\" equipment, related equipment, and components, as follows, specially designed or modified for military use:\nML10.a.  Manned \"aircraft\" and \"lighter-than-air vehicles\", and specially designed components therefor;\nML10.a.Note 1.  ML10.a. does not apply to \"aircraft\" and \"lighter-than-air vehicles\" or variants of those \"aircraft\", specially designed for military use and which are all of the following:\nML10.a.Note 1.a.  Not a combat \"aircraft\";\nML10.a.Note 1.b.  Not configured for military use and not fitted with equipment or attachments specially designed or modified for military use; and\nML10.a.Note 1.c.  Certified for civil use by civil aviation authorities of one or more Wassenaar Arrangement Participating States.\nML10.Note 3.  For the purposes of ML10.a. and ML10.d., specially designed components and related equipment for non-military \"aircraft\" or aero-engines modified for military use applies only to those military components and to military related equipment required for the modification to military use.\nML10.a.Note 4.  For the purposes of ML10.a., military use includes: combat, military reconnaissance, assault, military training, logistics support, and transporting and airdropping troops or military equipment.\nML10.a.Note 5.  ML10.a. does not apply to \"aircraft\" or \"lighter-than-air vehicles\" that meet all of the following:\nML10.a.Note 5.a.  Were first manufactured before 1946;\nML10.a.Note 5.b.  Do not incorporate items specified by the Munitions List, unless the items are required to meet safety or airworthiness standards of civil aviation authorities of one or more Wassenaar Arrangement Participating States; and\nML10.a.Note 5.c.  Do not incorporate weapons specified by the Munitions List, unless inoperable and incapable of being returned to operation.\n'),
(39560,'','','','ML11.  Electronic equipment, \"spacecraft\" and components, not specified elsewhere on the Munitions List, as follows:\nML11.a.  Electronic equipment specially designed for military use and specially designed components therefor;\nML11.a.Note.  ML11.a. includes:\nML11.a.Note.a.  Electronic countermeasure and electronic counter-countermeasure equipment (i.e., equipment designed to introduce extraneous or erroneous signals into radar or radio communication receivers or otherwise hinder the reception, operation or effectiveness of adversary electronic receivers including their countermeasure equipment), including jamming and counter-jamming equipment;\nML11.a.Note.b.  Frequency agile tubes;\nML11.a.Note.c.  Electronic systems or equipment, designed either for surveillance and monitoring of the electro-magnetic spectrum for military intelligence or security purposes or for counteracting such surveillance and monitoring;\nML11.a.Note.d.  Underwater countermeasures, including acoustic and magnetic jamming and decoy, equipment designed to introduce extraneous or erroneous signals into sonar receivers;\nML11.a.Note.e.  Data processing security equipment, data security equipment and transmission and signalling line security equipment, using ciphering processes;\nML11.a.Note.f.  Identification, authentification and keyloader equipment and key management, manufacturing and distribution equipment;\nML11.a.Note.g.  Guidance and navigation equipment;\nML11.a.Note.h.  Digital troposcatter-radio communications transmission equipment;\nML11.a.Note.i.  Digital demodulators specially designed for signals intelligence;\nML11.a.Note.j.  Automated Command and Control Systems.\n'),
(39561,'','','','ML8.  Energetic materials and related substances, as follows:\nML8.Technical Notes.1.  For the purposes of ML8., excluding ML8.c.11. or ML8.c.12., \'mixture\' refers to a composition of two or more substances with at least one substance being listed in the ML8 sub-items.\nML8.Technical Notes.2.  Any substance listed in the ML8 sub-items is subject to this list, even when utilised in an application other than that indicated.  (e.g., TAGN is predominantly used as an explosive but can also be used either as a fuel or an oxidizer.)\nML8.Technical Notes.3.  For the purposes of ML8., particle size is the mean particle diameter on a weight or volume basis.  International or equivalent national standards will be used in sampling and determining particle size.\nML8.a.  Explosives as follows, and \'mixtures\' thereof:\nML8.a.38.  Tetrazines as follows:\nML8.a.38.b.  LAX-112 (3,6-diamino-1,2,4,5-tetrazine-1,4-dioxide);\nML8.a.Note.  ML8.a. includes \'explosive co-crystals\'.\nML8.a.Note.Technical Note.  An \'explosive co-crystal\' is a solid material consisting of an ordered three dimensional arrangement of two or more explosive molecules, where at least one is specified in ML8.a.\nML8.Note 1.  ML8. does not apply to the following substances unless they are compounded or mixed with the \"energetic material\" specified by ML8.a. or powdered metals specified by ML8.c.:\nML8.Note 1.a.  Ammonium picrate (CAS 131-74-8);\nML8.Note 1.b.  Black powder;\nML8.Note 1.c.  Hexanitrodiphenylamine (CAS 131-73-7);\nML8.Note 1.d.  Difluoroamine (CAS 10405-27-3);\nML8.Note 1.e.  Nitrostarch (CAS 9056-38-6);\nML8.Note 1.f.  Potassium nitrate (CAS 7757-79-1);\nML8.Note 1.g.  Tetranitronaphthalene;\nML8.Note 1.h.  Trinitroanisol;\nML8.Note 1.i.  Trinitronaphthalene;\nML8.Note 1.j.  Trinitroxylene;\nML8.Note 1.k.  N-pyrrolidinone; 1-methyl-2-pyrrolidinone (CAS 872-50-4);\nML8.Note 1.l.  Dioctylmaleate (CAS 142-16-5);\nML8.Note 1.m.  Ethylhexylacrylate (CAS 103-11-7);\nML8.Note 1.n.  Triethylaluminium (TEA) (CAS 97-93-8), trimethylaluminium (TMA) (CAS 75-24-1), and other pyrophoric metal alkyls and aryls of lithium, sodium, magnesium, zinc or boron;\nML8.Note 1.o.  Nitrocellulose (CAS 9004-70-0);\nML8.Note 1.p.  Nitroglycerin (or glyceroltrinitrate, trinitroglycerine) (NG) (CAS 55-63-0);\nML8.Note 1.q.  2,4,6-trinitrotoluene (TNT) (CAS 118-96-7);\nML8.Note 1.r.  Ethylenediaminedinitrate (EDDN) (CAS 20829-66-7);\nML8.Note 1.s.  Pentaerythritoltetranitrate (PETN) (CAS 78-11-5);\nML8.Note 1.t.  Lead azide (CAS 13424-46-9), normal lead styphnate (CAS 15245-44-0) and basic lead styphnate (CAS 12403-82-6), and primary explosives or priming compositions containing azides or azide complexes;\nML8.Note 1.u.  Triethyleneglycoldinitrate (TEGDN) (CAS 111-22-8);\nML8.Note 1.v.  2,4,6-trinitroresorcinol (styphnic acid) (CAS 82-71-3);\nML8.Note 1.w.  Diethyldiphenylurea; (CAS 85-98-3); dimethyldiphenylurea;\nML8.Note 1.w.  (CAS 611-92-7), methylethyldiphenylurea; [Centralites]\nML8.Note 1.x.  N,N-diphenylurea (unsymmetrical diphenylurea) (CAS 603-54-3);\nML8.Note 1.y.  Methyl-N,N-diphenylurea (methyl unsymmetrical diphenylurea)\nML8.Note 1.y.  (CAS 13114-72-2);\nML8.Note 1.z.  Ethyl-N,N-diphenylurea (ethyl unsymmetrical diphenylurea)\nML8.Note 1.z.  (CAS 64544-71-4);\nML8.Note 1.aa.  2-Nitrodiphenylamine (2-NDPA) (CAS 119-75-5);\nML8.Note 1.bb.  4-Nitrodiphenylamine (4-NDPA) (CAS 836-30-6);\nML8.Note 1.cc.  2,2-dinitropropanol (CAS 918-52-5);\nML8.Note 1.dd.  Nitroguanidine (CAS 556-88-7) (see 1.C.11.d. on the Dual-Use List).\nML8.Note 2.  ML8. does not apply to ammonium perchlorate (ML8.d.2.), NTO (ML8.a.18.) or catocene (ML8.f.4.b.), and meeting all of the following:\nML8.Note 2.a.  Specially shaped and formulated for civil-use gas generation devices;\nML8.Note 2.b.  Compounded or mixed, with non-active thermoset binders or plasticizers, and having a mass of less than 250 g;\nML8.Note 2.c.  Having a maximum of 80% ammonium perchlorate (ML8.d.2.) in mass of active material;\nML8.Note 2.d.  Having less than or equal to 4 g of NTO (ML8.a.18.); and\nML8.Note 2.e.  Having less than or equal to 1 g of catocene (ML8.f.4.b.).\n'),
(39562,'','','','ML7.  Chemical agents, \"biological agents\", \"riot control agents\", radioactive materials, related equipment, components and materials, as follows:\nML7.b.  Chemical warfare (CW) agents, including:\nML7.b.2.  CW vesicant agents:\nML7.b.2.a.  Sulphur mustards, such as:\nML7.b.2.a.2.  Bis(2-chloroethyl) sulphide (CAS 505-60-2);\nML7.Note 1.  ML7.b. and ML7.d. do not apply to the following:\nML7.Note 1.a.  Cyanogen chloride (CAS 506-77-4);\nML7.Note 1.b.  Hydrocyanic acid (CAS 74-90-8);\nML7.Note 1.c.  Chlorine (CAS 7782-50-5);\nML7.Note 1.d.  Carbonyl chloride (phosgene) (CAS 75-44-5);\nML7.Note 1.e.  Diphosgene (trichloromethyl-chloroformate) (CAS 503-38-8);\nML7.Note 1.f.  Not used since 2004\nML7.Note 1.g.  Xylyl bromide, ortho: (CAS 89-92-9), meta: (CAS 620-13-3), para: (CAS 104-81-4);\nML7.Note 1.h.  Benzyl bromide (CAS 100-39-0);\nML7.Note 1.i.  Benzyl iodide (CAS 620-05-3);\nML7.Note 1.j.  Bromo acetone (CAS 598-31-2);\nML7.Note 1.k.  Cyanogen bromide (CAS 506-68-3);\nML7.Note 1.l.  Bromo methylethylketone (CAS 816-40-0);\nML7.Note 1.m.  Chloro acetone (CAS 78-95-5);\nML7.Note 1.n.  Ethyl iodoacetate (CAS 623-48-3);\nML7.Note 1.o.  Iodo acetone (CAS 3019-04-3);\nML7.Note 1.p.  Chloropicrin (CAS 76-06-2).\nML7.Note 2  The cultures of cells and biological systems specified by ML7.h. and ML7.i.2. are exclusive and these sub-items do not apply to cells or biological systems for civil purposes, such as agricultural, pharmaceutical, medical, veterinary, environmental, waste management, or in the food industry.\n'),
(39563,'','','','ML8.  Energetic materials and related substances, as follows:\nML8.Technical Notes.1.  For the purposes of ML8., excluding ML8.c.11. or ML8.c.12., \'mixture\' refers to a composition of two or more substances with at least one substance being listed in the ML8 sub-items.\nML8.Technical Notes.2.  Any substance listed in the ML8 sub-items is subject to this list, even when utilised in an application other than that indicated.  (e.g., TAGN is predominantly used as an explosive but can also be used either as a fuel or an oxidizer.)\nML8.Technical Notes.3.  For the purposes of ML8., particle size is the mean particle diameter on a weight or volume basis.  International or equivalent national standards will be used in sampling and determining particle size.\nML8.a.  Explosives as follows, and \'mixtures\' thereof:\nML8.a.40.  BTNEN (Bis(2,2,2-trinitroethyl)-nitramine) (CAS 19836-28-3);\nML8.a.Note.  ML8.a. includes \'explosive co-crystals\'.\nML8.a.Note.Technical Note.  An \'explosive co-crystal\' is a solid material consisting of an ordered three dimensional arrangement of two or more explosive molecules, where at least one is specified in ML8.a.\nML8.Note 1.  ML8. does not apply to the following substances unless they are compounded or mixed with the \"energetic material\" specified by ML8.a. or powdered metals specified by ML8.c.:\nML8.Note 1.a.  Ammonium picrate (CAS 131-74-8);\nML8.Note 1.b.  Black powder;\nML8.Note 1.c.  Hexanitrodiphenylamine (CAS 131-73-7);\nML8.Note 1.d.  Difluoroamine (CAS 10405-27-3);\nML8.Note 1.e.  Nitrostarch (CAS 9056-38-6);\nML8.Note 1.f.  Potassium nitrate (CAS 7757-79-1);\nML8.Note 1.g.  Tetranitronaphthalene;\nML8.Note 1.h.  Trinitroanisol;\nML8.Note 1.i.  Trinitronaphthalene;\nML8.Note 1.j.  Trinitroxylene;\nML8.Note 1.k.  N-pyrrolidinone; 1-methyl-2-pyrrolidinone (CAS 872-50-4);\nML8.Note 1.l.  Dioctylmaleate (CAS 142-16-5);\nML8.Note 1.m.  Ethylhexylacrylate (CAS 103-11-7);\nML8.Note 1.n.  Triethylaluminium (TEA) (CAS 97-93-8), trimethylaluminium (TMA) (CAS 75-24-1), and other pyrophoric metal alkyls and aryls of lithium, sodium, magnesium, zinc or boron;\nML8.Note 1.o.  Nitrocellulose (CAS 9004-70-0);\nML8.Note 1.p.  Nitroglycerin (or glyceroltrinitrate, trinitroglycerine) (NG) (CAS 55-63-0);\nML8.Note 1.q.  2,4,6-trinitrotoluene (TNT) (CAS 118-96-7);\nML8.Note 1.r.  Ethylenediaminedinitrate (EDDN) (CAS 20829-66-7);\nML8.Note 1.s.  Pentaerythritoltetranitrate (PETN) (CAS 78-11-5);\nML8.Note 1.t.  Lead azide (CAS 13424-46-9), normal lead styphnate (CAS 15245-44-0) and basic lead styphnate (CAS 12403-82-6), and primary explosives or priming compositions containing azides or azide complexes;\nML8.Note 1.u.  Triethyleneglycoldinitrate (TEGDN) (CAS 111-22-8);\nML8.Note 1.v.  2,4,6-trinitroresorcinol (styphnic acid) (CAS 82-71-3);\nML8.Note 1.w.  Diethyldiphenylurea; (CAS 85-98-3); dimethyldiphenylurea;\nML8.Note 1.w.  (CAS 611-92-7), methylethyldiphenylurea; [Centralites]\nML8.Note 1.x.  N,N-diphenylurea (unsymmetrical diphenylurea) (CAS 603-54-3);\nML8.Note 1.y.  Methyl-N,N-diphenylurea (methyl unsymmetrical diphenylurea)\nML8.Note 1.y.  (CAS 13114-72-2);\nML8.Note 1.z.  Ethyl-N,N-diphenylurea (ethyl unsymmetrical diphenylurea)\nML8.Note 1.z.  (CAS 64544-71-4);\nML8.Note 1.aa.  2-Nitrodiphenylamine (2-NDPA) (CAS 119-75-5);\nML8.Note 1.bb.  4-Nitrodiphenylamine (4-NDPA) (CAS 836-30-6);\nML8.Note 1.cc.  2,2-dinitropropanol (CAS 918-52-5);\nML8.Note 1.dd.  Nitroguanidine (CAS 556-88-7) (see 1.C.11.d. on the Dual-Use List).\nML8.Note 2.  ML8. does not apply to ammonium perchlorate (ML8.d.2.), NTO (ML8.a.18.) or catocene (ML8.f.4.b.), and meeting all of the following:\nML8.Note 2.a.  Specially shaped and formulated for civil-use gas generation devices;\nML8.Note 2.b.  Compounded or mixed, with non-active thermoset binders or plasticizers, and having a mass of less than 250 g;\nML8.Note 2.c.  Having a maximum of 80% ammonium perchlorate (ML8.d.2.) in mass of active material;\nML8.Note 2.d.  Having less than or equal to 4 g of NTO (ML8.a.18.); and\nML8.Note 2.e.  Having less than or equal to 1 g of catocene (ML8.f.4.b.).\n'),
(39564,'','','','ML22.  Technology as follows:\nML22.b.  Technology as follows:\nML22.b.4.  Not used since 2013\nML22.b.4.N.B.  See ML22.a. for \"technology\" previously specified by ML22.b.4.\nML22.Note 1.  Technology \"required\" for the \"development\", \"production\", operation, installation, maintenance (checking), repair, overhaul or refurbishing of items specified by the Munitions List remains under control even when applicable to any item not specified by the Munitions List.\nML22.Note 2.  ML22 does not apply to:\nML22.Note 2.a.  Technology that is the minimum necessary for the installation, operation, maintenance (checking) or repair, of those items which are not controlled or whose export has been authorised;\nML22.Note 2.b.  Technology that is \"in the public domain\", \"basic scientific research\" or the minimum necessary information for patent applications;\nML22.Note 2.c.  Technology for magnetic induction for continuous propulsion of civil transport devices.\n'),
(39565,'','','','ML3.  Ammunition and fuze setting devices, as follows, and specially designed components therefor:\nML3.Note 1.  Specially designed components specified by ML3. include:\nML3.Note 1.a.  Metal or plastic fabrications such as primer anvils, bullet cups, cartridge links, rotating bands and munitions metal parts;\nML3.Note 1.b.  Safing and arming devices, fuzes, sensors and initiation devices ;\nML3.Note 1.c.  Power supplies with high one-time operational output;\nML3.Note 1.d.  Combustible cases for charges;\nML3.Note 1.e.  Submunitions including bomblets, minelets and terminally guided projectiles.\n'),
(39566,'','','','ML17.  Miscellaneous equipment, materials and \"libraries\", as follows, and specially designed components therefor:\nML17.Technical Note.1.  Not used since 2014\nML17.Technical Note.2.  For the purpose of ML17, \'modified\' means any structural, electrical, mechanical, or other change that provides a non-military item with military capabilities equivalent to an item which is specially designed for military use.\n'),
(39567,'','','','ML17.  Miscellaneous equipment, materials and \"libraries\", as follows, and specially designed components therefor:\nML17.i.  Simulators specially designed for military \"nuclear reactors\";\nML17.Technical Note.1.  Not used since 2014\nML17.Technical Note.2.  For the purpose of ML17, \'modified\' means any structural, electrical, mechanical, or other change that provides a non-military item with military capabilities equivalent to an item which is specially designed for military use.\n'),
(39568,'','','','ML6.  Ground vehicles and components, as follows:\nML6.b.  Other ground vehicles and components, as follows:\nML6.b.1.  Vehicles having all of the following:\nML6.b.1.b.  A transmission to provide drive to both front and rear wheels simultaneously, including those vehicles having additional wheels for load bearing purposes whether driven or not;\nML6.Note 1.  ML6. does not apply to civil vehicles designed or modified for transporting money or valuables.\nML6.Note 2.  ML6. does not apply to vehicles that meet all of the following;\nML6.Note 2.a.  Were manufactured before 1946;\nML6.Note 2.b.  Do not have items specified by the Munitions List and manufactured after 1945, except for reproductions of original components or accessories for the vehicle; and\nML6.Note 2.c.  Do not incorporate weapons specified in ML1., ML2. or ML4. unless they are inoperable and incapable of discharging a projectile.\n'),
(39569,'','','','ML12.  High velocity kinetic energy weapon systems and related equipment, as follows, and specially designed components therefor:\nML12.a.  Kinetic energy weapon systems specially designed for destruction or effecting mission-abort of a target;\nML12.b.  Specially designed test and evaluation facilities and test models, including diagnostic instrumentation and targets, for dynamic testing of kinetic energy projectiles and systems.\nML12.N.B.  For weapon systems using sub-calibre ammunition or employing solely chemical propulsion, and ammunition therefor, see ML1. to ML4.\nML12.Note 1.  ML12. includes the following when specially designed for kinetic energy weapon systems:\nML12.Note 1.a.  Launch propulsion systems capable of accelerating masses larger than 0.1 g to velocities in excess of 1.6 km/s, in single or rapid fire modes;\nML12.Note 1.b.  Prime power generation, electric armour, energy storage (e.g., high energy storage capacitors), thermal management, conditioning, switching or fuel-handling equipment; and electrical interfaces between power supply, gun and other turret electric drive functions;\nML12.Note 1.b.N.B.  See also 3.A.1.e.2. on the Dual-Use List for high energy storage capacitors.\nML12.Note 1.c.  Target acquisition, tracking, fire control or damage assessment systems;\nML12.Note 1.d.  Homing seeker, guidance or divert propulsion (lateral acceleration) systems for projectiles.\nML12.Note 2.  ML12. applies to weapon systems using any of the following methods of propulsion:\nML12.Note 2.a.  Electromagnetic;\nML12.Note 2.b.  Electrothermal;\nML12.Note 2.c.  Plasma;\nML12.Note 2.d.  Light gas; or\nML12.Note 2.e.  Chemical (when used in combination with any of the above).\n'),
(39570,'','','','ML8.  Energetic materials and related substances, as follows:\nML8.Technical Notes.1.  For the purposes of ML8., excluding ML8.c.11. or ML8.c.12., \'mixture\' refers to a composition of two or more substances with at least one substance being listed in the ML8 sub-items.\nML8.Technical Notes.2.  Any substance listed in the ML8 sub-items is subject to this list, even when utilised in an application other than that indicated.  (e.g., TAGN is predominantly used as an explosive but can also be used either as a fuel or an oxidizer.)\nML8.Technical Notes.3.  For the purposes of ML8., particle size is the mean particle diameter on a weight or volume basis.  International or equivalent national standards will be used in sampling and determining particle size.\nML8.a.  Explosives as follows, and \'mixtures\' thereof:\nML8.a.21.  RDX and derivatives, as follows:\nML8.a.21.a.  RDX (cyclotrimethylenetrinitramine, cyclonite, T4, hexahydro-1,3,5-trinitro-1,3,5-triazine, 1,3,5-trinitro-1,3,5-triaza-cyclohexane, hexogen or hexogene) (CAS 121-82-4);\nML8.a.Note.  ML8.a. includes \'explosive co-crystals\'.\nML8.a.Note.Technical Note.  An \'explosive co-crystal\' is a solid material consisting of an ordered three dimensional arrangement of two or more explosive molecules, where at least one is specified in ML8.a.\nML8.Note 1.  ML8. does not apply to the following substances unless they are compounded or mixed with the \"energetic material\" specified by ML8.a. or powdered metals specified by ML8.c.:\nML8.Note 1.a.  Ammonium picrate (CAS 131-74-8);\nML8.Note 1.b.  Black powder;\nML8.Note 1.c.  Hexanitrodiphenylamine (CAS 131-73-7);\nML8.Note 1.d.  Difluoroamine (CAS 10405-27-3);\nML8.Note 1.e.  Nitrostarch (CAS 9056-38-6);\nML8.Note 1.f.  Potassium nitrate (CAS 7757-79-1);\nML8.Note 1.g.  Tetranitronaphthalene;\nML8.Note 1.h.  Trinitroanisol;\nML8.Note 1.i.  Trinitronaphthalene;\nML8.Note 1.j.  Trinitroxylene;\nML8.Note 1.k.  N-pyrrolidinone; 1-methyl-2-pyrrolidinone (CAS 872-50-4);\nML8.Note 1.l.  Dioctylmaleate (CAS 142-16-5);\nML8.Note 1.m.  Ethylhexylacrylate (CAS 103-11-7);\nML8.Note 1.n.  Triethylaluminium (TEA) (CAS 97-93-8), trimethylaluminium (TMA) (CAS 75-24-1), and other pyrophoric metal alkyls and aryls of lithium, sodium, magnesium, zinc or boron;\nML8.Note 1.o.  Nitrocellulose (CAS 9004-70-0);\nML8.Note 1.p.  Nitroglycerin (or glyceroltrinitrate, trinitroglycerine) (NG) (CAS 55-63-0);\nML8.Note 1.q.  2,4,6-trinitrotoluene (TNT) (CAS 118-96-7);\nML8.Note 1.r.  Ethylenediaminedinitrate (EDDN) (CAS 20829-66-7);\nML8.Note 1.s.  Pentaerythritoltetranitrate (PETN) (CAS 78-11-5);\nML8.Note 1.t.  Lead azide (CAS 13424-46-9), normal lead styphnate (CAS 15245-44-0) and basic lead styphnate (CAS 12403-82-6), and primary explosives or priming compositions containing azides or azide complexes;\nML8.Note 1.u.  Triethyleneglycoldinitrate (TEGDN) (CAS 111-22-8);\nML8.Note 1.v.  2,4,6-trinitroresorcinol (styphnic acid) (CAS 82-71-3);\nML8.Note 1.w.  Diethyldiphenylurea; (CAS 85-98-3); dimethyldiphenylurea;\nML8.Note 1.w.  (CAS 611-92-7), methylethyldiphenylurea; [Centralites]\nML8.Note 1.x.  N,N-diphenylurea (unsymmetrical diphenylurea) (CAS 603-54-3);\nML8.Note 1.y.  Methyl-N,N-diphenylurea (methyl unsymmetrical diphenylurea)\nML8.Note 1.y.  (CAS 13114-72-2);\nML8.Note 1.z.  Ethyl-N,N-diphenylurea (ethyl unsymmetrical diphenylurea)\nML8.Note 1.z.  (CAS 64544-71-4);\nML8.Note 1.aa.  2-Nitrodiphenylamine (2-NDPA) (CAS 119-75-5);\nML8.Note 1.bb.  4-Nitrodiphenylamine (4-NDPA) (CAS 836-30-6);\nML8.Note 1.cc.  2,2-dinitropropanol (CAS 918-52-5);\nML8.Note 1.dd.  Nitroguanidine (CAS 556-88-7) (see 1.C.11.d. on the Dual-Use List).\nML8.Note 2.  ML8. does not apply to ammonium perchlorate (ML8.d.2.), NTO (ML8.a.18.) or catocene (ML8.f.4.b.), and meeting all of the following:\nML8.Note 2.a.  Specially shaped and formulated for civil-use gas generation devices;\nML8.Note 2.b.  Compounded or mixed, with non-active thermoset binders or plasticizers, and having a mass of less than 250 g;\nML8.Note 2.c.  Having a maximum of 80% ammonium perchlorate (ML8.d.2.) in mass of active material;\nML8.Note 2.d.  Having less than or equal to 4 g of NTO (ML8.a.18.); and\nML8.Note 2.e.  Having less than or equal to 1 g of catocene (ML8.f.4.b.).\n'),
(39571,'','','','ML16.  Forgings, castings and other unfinished products, specially designed for items specified by ML1.to ML4., ML6., ML9., ML10., ML12. or ML19.\nML16.Note.  ML16. applies to unfinished products when they are identifiable by material composition, geometry or function.\n'),
(39572,'','','','ML10.  Aircraft, \"lighter-than-air vehicles\", \"Unmanned Aerial Vehicles\" (\"UAVs\"), aero-engines and \"aircraft\" equipment, related equipment, and components, as follows, specially designed or modified for military use:\nML10.a.  Manned \"aircraft\" and \"lighter-than-air vehicles\", and specially designed components therefor;\nML10.a.Note 1.  ML10.a. does not apply to \"aircraft\" and \"lighter-than-air vehicles\" or variants of those \"aircraft\", specially designed for military use and which are all of the following:\nML10.a.Note 1.a.  Not a combat \"aircraft\";\nML10.a.Note 1.b.  Not configured for military use and not fitted with equipment or attachments specially designed or modified for military use; and\nML10.a.Note 1.c.  Certified for civil use by civil aviation authorities of one or more Wassenaar Arrangement Participating States.\nML10.Note 3.  For the purposes of ML10.a. and ML10.d., specially designed components and related equipment for non-military \"aircraft\" or aero-engines modified for military use applies only to those military components and to military related equipment required for the modification to military use.\nML10.a.Note 4.  For the purposes of ML10.a., military use includes: combat, military reconnaissance, assault, military training, logistics support, and transporting and airdropping troops or military equipment.\nML10.a.Note 5.  ML10.a. does not apply to \"aircraft\" or \"lighter-than-air vehicles\" that meet all of the following:\nML10.a.Note 5.a.  Were first manufactured before 1946;\nML10.a.Note 5.b.  Do not incorporate items specified by the Munitions List, unless the items are required to meet safety or airworthiness standards of civil aviation authorities of one or more Wassenaar Arrangement Participating States; and\nML10.a.Note 5.c.  Do not incorporate weapons specified by the Munitions List, unless inoperable and incapable of being returned to operation.\n'),
(39573,'','','','ML8.  Energetic materials and related substances, as follows:\nML8.Technical Notes.1.  For the purposes of ML8., excluding ML8.c.11. or ML8.c.12., \'mixture\' refers to a composition of two or more substances with at least one substance being listed in the ML8 sub-items.\nML8.Technical Notes.2.  Any substance listed in the ML8 sub-items is subject to this list, even when utilised in an application other than that indicated.  (e.g., TAGN is predominantly used as an explosive but can also be used either as a fuel or an oxidizer.)\nML8.Technical Notes.3.  For the purposes of ML8., particle size is the mean particle diameter on a weight or volume basis.  International or equivalent national standards will be used in sampling and determining particle size.\nML8.e.  Binders, plasticizers, monomers and polymers, as follows:\nML8.e.6.  Energetic monomers, plasticizers or polymers, specially formulated for military use and containing any of the following:\nML8.e.6.a.  Nitro groups;\nML8.Note 1.  ML8. does not apply to the following substances unless they are compounded or mixed with the \"energetic material\" specified by ML8.a. or powdered metals specified by ML8.c.:\nML8.Note 1.a.  Ammonium picrate (CAS 131-74-8);\nML8.Note 1.b.  Black powder;\nML8.Note 1.c.  Hexanitrodiphenylamine (CAS 131-73-7);\nML8.Note 1.d.  Difluoroamine (CAS 10405-27-3);\nML8.Note 1.e.  Nitrostarch (CAS 9056-38-6);\nML8.Note 1.f.  Potassium nitrate (CAS 7757-79-1);\nML8.Note 1.g.  Tetranitronaphthalene;\nML8.Note 1.h.  Trinitroanisol;\nML8.Note 1.i.  Trinitronaphthalene;\nML8.Note 1.j.  Trinitroxylene;\nML8.Note 1.k.  N-pyrrolidinone; 1-methyl-2-pyrrolidinone (CAS 872-50-4);\nML8.Note 1.l.  Dioctylmaleate (CAS 142-16-5);\nML8.Note 1.m.  Ethylhexylacrylate (CAS 103-11-7);\nML8.Note 1.n.  Triethylaluminium (TEA) (CAS 97-93-8), trimethylaluminium (TMA) (CAS 75-24-1), and other pyrophoric metal alkyls and aryls of lithium, sodium, magnesium, zinc or boron;\nML8.Note 1.o.  Nitrocellulose (CAS 9004-70-0);\nML8.Note 1.p.  Nitroglycerin (or glyceroltrinitrate, trinitroglycerine) (NG) (CAS 55-63-0);\nML8.Note 1.q.  2,4,6-trinitrotoluene (TNT) (CAS 118-96-7);\nML8.Note 1.r.  Ethylenediaminedinitrate (EDDN) (CAS 20829-66-7);\nML8.Note 1.s.  Pentaerythritoltetranitrate (PETN) (CAS 78-11-5);\nML8.Note 1.t.  Lead azide (CAS 13424-46-9), normal lead styphnate (CAS 15245-44-0) and basic lead styphnate (CAS 12403-82-6), and primary explosives or priming compositions containing azides or azide complexes;\nML8.Note 1.u.  Triethyleneglycoldinitrate (TEGDN) (CAS 111-22-8);\nML8.Note 1.v.  2,4,6-trinitroresorcinol (styphnic acid) (CAS 82-71-3);\nML8.Note 1.w.  Diethyldiphenylurea; (CAS 85-98-3); dimethyldiphenylurea;\nML8.Note 1.w.  (CAS 611-92-7), methylethyldiphenylurea; [Centralites]\nML8.Note 1.x.  N,N-diphenylurea (unsymmetrical diphenylurea) (CAS 603-54-3);\nML8.Note 1.y.  Methyl-N,N-diphenylurea (methyl unsymmetrical diphenylurea)\nML8.Note 1.y.  (CAS 13114-72-2);\nML8.Note 1.z.  Ethyl-N,N-diphenylurea (ethyl unsymmetrical diphenylurea)\nML8.Note 1.z.  (CAS 64544-71-4);\nML8.Note 1.aa.  2-Nitrodiphenylamine (2-NDPA) (CAS 119-75-5);\nML8.Note 1.bb.  4-Nitrodiphenylamine (4-NDPA) (CAS 836-30-6);\nML8.Note 1.cc.  2,2-dinitropropanol (CAS 918-52-5);\nML8.Note 1.dd.  Nitroguanidine (CAS 556-88-7) (see 1.C.11.d. on the Dual-Use List).\nML8.Note 2.  ML8. does not apply to ammonium perchlorate (ML8.d.2.), NTO (ML8.a.18.) or catocene (ML8.f.4.b.), and meeting all of the following:\nML8.Note 2.a.  Specially shaped and formulated for civil-use gas generation devices;\nML8.Note 2.b.  Compounded or mixed, with non-active thermoset binders or plasticizers, and having a mass of less than 250 g;\nML8.Note 2.c.  Having a maximum of 80% ammonium perchlorate (ML8.d.2.) in mass of active material;\nML8.Note 2.d.  Having less than or equal to 4 g of NTO (ML8.a.18.); and\nML8.Note 2.e.  Having less than or equal to 1 g of catocene (ML8.f.4.b.).\n'),
(39574,'','','','ML15.  Imaging or countermeasure equipment, as follows, specially designed for military use, and specially designed components and accessories therefor:\nML15.a.  Recorders and image processing equipment;\nML15.b.  Cameras, photographic equipment and film processing equipment;\nML15.c.  Image intensifier equipment;\nML15.d.  Infrared or thermal imaging equipment;\nML15.e.  Imaging radar sensor equipment;\nML15.f.  Countermeasure or counter-countermeasure equipment, for the equipment specified by ML15.a. to ML15.e.\nML15.f.Note.  ML15.f. includes equipment designed to degrade the operation or effectiveness of military imaging systems or to minimise such degrading effects.\nML15.c.Note.  ML15. does not apply to \"first generation image intensifier tubes\" or equipment specially designed to incorporate \"first generation image intensifier tubes\".\nML15.c.N.B.  For the classification of weapons sights incorporating \"first generation image intensifier tubes\" see ML1., ML2. and ML5.a.\nML15.N.B.  See also 6.A.2.a.2. and 6.A.2.b. on the Dual-Use List.\n'),
(39575,'','','','ML9.  Vessels of war (surface or underwater), special naval equipment, accessories, components and other surface vessels, as follows:\nML9.b.  Engines and propulsion systems, as follows, specially designed for military use and components therefor specially designed for military use:\nML9.b.2.  Electric motors specially designed for submarines and having all of the following:\nML9.b.2.b.  Quick reversing;\n'),
(39576,'','','','ML8.  Energetic materials and related substances, as follows:\nML8.Technical Notes.1.  For the purposes of ML8., excluding ML8.c.11. or ML8.c.12., \'mixture\' refers to a composition of two or more substances with at least one substance being listed in the ML8 sub-items.\nML8.Technical Notes.2.  Any substance listed in the ML8 sub-items is subject to this list, even when utilised in an application other than that indicated.  (e.g., TAGN is predominantly used as an explosive but can also be used either as a fuel or an oxidizer.)\nML8.Technical Notes.3.  For the purposes of ML8., particle size is the mean particle diameter on a weight or volume basis.  International or equivalent national standards will be used in sampling and determining particle size.\nML8.a.  Explosives as follows, and \'mixtures\' thereof:\nML8.a.30.  TNP (1,4,5,8-tetranitro-pyridazino[4,5-d]pyridazine) (CAS 229176-04-9);\nML8.a.Note.  ML8.a. includes \'explosive co-crystals\'.\nML8.a.Note.Technical Note.  An \'explosive co-crystal\' is a solid material consisting of an ordered three dimensional arrangement of two or more explosive molecules, where at least one is specified in ML8.a.\nML8.Note 1.  ML8. does not apply to the following substances unless they are compounded or mixed with the \"energetic material\" specified by ML8.a. or powdered metals specified by ML8.c.:\nML8.Note 1.a.  Ammonium picrate (CAS 131-74-8);\nML8.Note 1.b.  Black powder;\nML8.Note 1.c.  Hexanitrodiphenylamine (CAS 131-73-7);\nML8.Note 1.d.  Difluoroamine (CAS 10405-27-3);\nML8.Note 1.e.  Nitrostarch (CAS 9056-38-6);\nML8.Note 1.f.  Potassium nitrate (CAS 7757-79-1);\nML8.Note 1.g.  Tetranitronaphthalene;\nML8.Note 1.h.  Trinitroanisol;\nML8.Note 1.i.  Trinitronaphthalene;\nML8.Note 1.j.  Trinitroxylene;\nML8.Note 1.k.  N-pyrrolidinone; 1-methyl-2-pyrrolidinone (CAS 872-50-4);\nML8.Note 1.l.  Dioctylmaleate (CAS 142-16-5);\nML8.Note 1.m.  Ethylhexylacrylate (CAS 103-11-7);\nML8.Note 1.n.  Triethylaluminium (TEA) (CAS 97-93-8), trimethylaluminium (TMA) (CAS 75-24-1), and other pyrophoric metal alkyls and aryls of lithium, sodium, magnesium, zinc or boron;\nML8.Note 1.o.  Nitrocellulose (CAS 9004-70-0);\nML8.Note 1.p.  Nitroglycerin (or glyceroltrinitrate, trinitroglycerine) (NG) (CAS 55-63-0);\nML8.Note 1.q.  2,4,6-trinitrotoluene (TNT) (CAS 118-96-7);\nML8.Note 1.r.  Ethylenediaminedinitrate (EDDN) (CAS 20829-66-7);\nML8.Note 1.s.  Pentaerythritoltetranitrate (PETN) (CAS 78-11-5);\nML8.Note 1.t.  Lead azide (CAS 13424-46-9), normal lead styphnate (CAS 15245-44-0) and basic lead styphnate (CAS 12403-82-6), and primary explosives or priming compositions containing azides or azide complexes;\nML8.Note 1.u.  Triethyleneglycoldinitrate (TEGDN) (CAS 111-22-8);\nML8.Note 1.v.  2,4,6-trinitroresorcinol (styphnic acid) (CAS 82-71-3);\nML8.Note 1.w.  Diethyldiphenylurea; (CAS 85-98-3); dimethyldiphenylurea;\nML8.Note 1.w.  (CAS 611-92-7), methylethyldiphenylurea; [Centralites]\nML8.Note 1.x.  N,N-diphenylurea (unsymmetrical diphenylurea) (CAS 603-54-3);\nML8.Note 1.y.  Methyl-N,N-diphenylurea (methyl unsymmetrical diphenylurea)\nML8.Note 1.y.  (CAS 13114-72-2);\nML8.Note 1.z.  Ethyl-N,N-diphenylurea (ethyl unsymmetrical diphenylurea)\nML8.Note 1.z.  (CAS 64544-71-4);\nML8.Note 1.aa.  2-Nitrodiphenylamine (2-NDPA) (CAS 119-75-5);\nML8.Note 1.bb.  4-Nitrodiphenylamine (4-NDPA) (CAS 836-30-6);\nML8.Note 1.cc.  2,2-dinitropropanol (CAS 918-52-5);\nML8.Note 1.dd.  Nitroguanidine (CAS 556-88-7) (see 1.C.11.d. on the Dual-Use List).\nML8.Note 2.  ML8. does not apply to ammonium perchlorate (ML8.d.2.), NTO (ML8.a.18.) or catocene (ML8.f.4.b.), and meeting all of the following:\nML8.Note 2.a.  Specially shaped and formulated for civil-use gas generation devices;\nML8.Note 2.b.  Compounded or mixed, with non-active thermoset binders or plasticizers, and having a mass of less than 250 g;\nML8.Note 2.c.  Having a maximum of 80% ammonium perchlorate (ML8.d.2.) in mass of active material;\nML8.Note 2.d.  Having less than or equal to 4 g of NTO (ML8.a.18.); and\nML8.Note 2.e.  Having less than or equal to 1 g of catocene (ML8.f.4.b.).\n'),
(39577,'','','','ML2.  Smooth-bore weapons with a calibre of 20 mm or more, other weapons or armament with a calibre greater than 12.7 mm (calibre 0.50 inches), projectors and accessories, as follows, and specially designed components therefor:\nML2.Note  ML2.b. does not apply to signal pistols.\nML2.c.  Weapons sights and weapon sight mounts, having all of the following:\nML2.c.2.  Specially designed for weapons specified in ML2.a.;\n'),
(39578,'','','','ML2.  Smooth-bore weapons with a calibre of 20 mm or more, other weapons or armament with a calibre greater than 12.7 mm (calibre 0.50 inches), projectors and accessories, as follows, and specially designed components therefor:\nML2.a.  Guns, howitzers, cannon, mortars, anti-tank weapons, projectile launchers, military flame throwers, rifles, recoilless rifles, smooth-bore weapons and signature reduction devices therefor;\nML2.a.Note 1  ML2.a. includes injectors, metering devices, storage tanks and other specially designed components for use with liquid propelling charges for any of the equipment specified by ML2.a.\nML2.a.Note 2  ML2.a. does not apply to weapons as follows:\nML2.a.Note 2.a.  Rifles, smooth-bore weapons and combination guns, manufactured earlier than 1938;\nML2.a.Note 2.b.  Reproductions of rifles, smooth-bore weapons and combination guns, the originals of which were manufactured earlier than 1890;\nML2.a.Note 2.c.  Guns, howitzers, cannons, mortars, manufactured earlier than 1890;\nML2.a.Note 2.d.  Smooth-bore weapons used for hunting or sporting purposes.  These weapons must not be specially designed for military use or of the fully automatic firing type;\nML2.a.Note 2.e.  Smooth-bore weapons specially designed for any of the following:\nML2.a.Note 2.e.1.  Slaughtering of domestic animals;\nML2.a.Note 2.e.2.  Tranquilizing of animals;\nML2.a.Note 2.e.3.  Seismic testing;\nML2.a.Note 2.e.4.  Firing of industrial projectiles; or\nML2.a.Note 2.e.5.  Disrupting Improvised Explosive Devices (IEDs);\nML2.a.Note 2.e.5.N.B.  For disruptors, see ML4. and 1.A.6. on the Dual-Use List.\nML2.a.Note 2.f.  Hand-held projectile  launchers specially designed to launch tethered projectiles having no high explosive charge or communications link, to a range of less than or equal to 500 m.\nML2.Note  ML2.b. does not apply to signal pistols.\n'),
(39579,'','','','ML17.  Miscellaneous equipment, materials and \"libraries\", as follows, and specially designed components therefor:\nML17.n.  Test models specially designed for the \"development\" of items specified by ML4., ML6., ML9. or ML10.;\nML17.Technical Note.1.  Not used since 2014\nML17.Technical Note.2.  For the purpose of ML17, \'modified\' means any structural, electrical, mechanical, or other change that provides a non-military item with military capabilities equivalent to an item which is specially designed for military use.\n'),
(39580,'','','','ML4.  Bombs, torpedoes, rockets, missiles, other explosive devices and charges and related equipment and accessories, as follows, and specially designed components therefor:\nML4.b.  Equipment having all of the following:\nML4.b.2.  Specially designed for \'activities\' relating to any of the following:\nML4.b.2.b.  Improvised Explosive Devices (IEDs).\nML4.b.2.Technical Note.  For the purpose of ML4.b.2. \'activities\' applies to handling, launching, laying, controlling, discharging, detonating, activating, powering with one-time operational output, decoying, jamming, sweeping, detecting, disrupting or disposing.\nML4.b.Note 1.  ML4.b. includes:\nML4.b.Note 1.a.  Mobile gas liquefying equipment capable of producing 1,000 kg or more per day of gas in liquid form;\nML4.b.Note 1.b.  Buoyant electric conducting cable suitable for sweeping magnetic mines.\nML4.b.Note 2.  ML4.b. does not apply to hand-held devices limited by design solely to the detection of metal objects and incapable of distinguishing between mines and other metal objects.\n'),
(39581,'','','','ML19.  Directed Energy Weapon (DEW) systems, related or countermeasure equipment and test models, as follows, and specially designed components therefor:\nML19.Note 1.  DEW systems specified by ML19. include systems whose capability is derived from the controlled application of:\nML19.Note 1.a.  Lasers of sufficient power to effect destruction similar to the manner of conventional ammunition;\nML19.Note 1.b.  Particle accelerators which project a charged or neutral particle beam with destructive power;\nML19.Note 1.c.  High pulsed power or high average power radio frequency beam transmitters, which produce fields sufficiently intense to disable electronic circuitry at a distant target.\nML19.Note 2.  ML19. includes the following when specially designed for DEW systems:\nML19.Note 2.a.  Prime power generation, energy storage, switching, power conditioning or fuel-handling equipment;\nML19.Note 2.b.  Target acquisition or tracking systems;\nML19.Note 2.c.  Systems capable of assessing target damage, destruction or mission-abort;\nML19.Note 2.d.  Beam-handling, propagation or pointing equipment;\nML19.Note 2.e.  Equipment with rapid beam slew capability for rapid multiple target operations;\nML19.Note 2.f.  Adaptive optics and phase conjugators;\nML19.Note 2.g.  Current injectors for negative hydrogen ion beams;\nML19.Note 2.h.  Space-qualified accelerator components;\nML19.Note 2.i.  Negative ion beam funnelling equipment;\nML19.Note 2.j.  Equipment for controlling and slewing a high energy ion beam;\nML19.Note 2.k.  Space-qualified foils for neutralising negative hydrogen isotope beams.\n'),
(39582,'','','','ML8.  Energetic materials and related substances, as follows:\nML8.Technical Notes.1.  For the purposes of ML8., excluding ML8.c.11. or ML8.c.12., \'mixture\' refers to a composition of two or more substances with at least one substance being listed in the ML8 sub-items.\nML8.Technical Notes.2.  Any substance listed in the ML8 sub-items is subject to this list, even when utilised in an application other than that indicated.  (e.g., TAGN is predominantly used as an explosive but can also be used either as a fuel or an oxidizer.)\nML8.Technical Notes.3.  For the purposes of ML8., particle size is the mean particle diameter on a weight or volume basis.  International or equivalent national standards will be used in sampling and determining particle size.\nML8.a.  Explosives as follows, and \'mixtures\' thereof:\nML8.a.28.  TNAZ (1,3,3-trinitroazetidine) (CAS 97645-24-4)\nML8.a.28.  (see also ML8.g.2. for its \"precursors\");\nML8.a.Note.  ML8.a. includes \'explosive co-crystals\'.\nML8.a.Note.Technical Note.  An \'explosive co-crystal\' is a solid material consisting of an ordered three dimensional arrangement of two or more explosive molecules, where at least one is specified in ML8.a.\nML8.Note 1.  ML8. does not apply to the following substances unless they are compounded or mixed with the \"energetic material\" specified by ML8.a. or powdered metals specified by ML8.c.:\nML8.Note 1.a.  Ammonium picrate (CAS 131-74-8);\nML8.Note 1.b.  Black powder;\nML8.Note 1.c.  Hexanitrodiphenylamine (CAS 131-73-7);\nML8.Note 1.d.  Difluoroamine (CAS 10405-27-3);\nML8.Note 1.e.  Nitrostarch (CAS 9056-38-6);\nML8.Note 1.f.  Potassium nitrate (CAS 7757-79-1);\nML8.Note 1.g.  Tetranitronaphthalene;\nML8.Note 1.h.  Trinitroanisol;\nML8.Note 1.i.  Trinitronaphthalene;\nML8.Note 1.j.  Trinitroxylene;\nML8.Note 1.k.  N-pyrrolidinone; 1-methyl-2-pyrrolidinone (CAS 872-50-4);\nML8.Note 1.l.  Dioctylmaleate (CAS 142-16-5);\nML8.Note 1.m.  Ethylhexylacrylate (CAS 103-11-7);\nML8.Note 1.n.  Triethylaluminium (TEA) (CAS 97-93-8), trimethylaluminium (TMA) (CAS 75-24-1), and other pyrophoric metal alkyls and aryls of lithium, sodium, magnesium, zinc or boron;\nML8.Note 1.o.  Nitrocellulose (CAS 9004-70-0);\nML8.Note 1.p.  Nitroglycerin (or glyceroltrinitrate, trinitroglycerine) (NG) (CAS 55-63-0);\nML8.Note 1.q.  2,4,6-trinitrotoluene (TNT) (CAS 118-96-7);\nML8.Note 1.r.  Ethylenediaminedinitrate (EDDN) (CAS 20829-66-7);\nML8.Note 1.s.  Pentaerythritoltetranitrate (PETN) (CAS 78-11-5);\nML8.Note 1.t.  Lead azide (CAS 13424-46-9), normal lead styphnate (CAS 15245-44-0) and basic lead styphnate (CAS 12403-82-6), and primary explosives or priming compositions containing azides or azide complexes;\nML8.Note 1.u.  Triethyleneglycoldinitrate (TEGDN) (CAS 111-22-8);\nML8.Note 1.v.  2,4,6-trinitroresorcinol (styphnic acid) (CAS 82-71-3);\nML8.Note 1.w.  Diethyldiphenylurea; (CAS 85-98-3); dimethyldiphenylurea;\nML8.Note 1.w.  (CAS 611-92-7), methylethyldiphenylurea; [Centralites]\nML8.Note 1.x.  N,N-diphenylurea (unsymmetrical diphenylurea) (CAS 603-54-3);\nML8.Note 1.y.  Methyl-N,N-diphenylurea (methyl unsymmetrical diphenylurea)\nML8.Note 1.y.  (CAS 13114-72-2);\nML8.Note 1.z.  Ethyl-N,N-diphenylurea (ethyl unsymmetrical diphenylurea)\nML8.Note 1.z.  (CAS 64544-71-4);\nML8.Note 1.aa.  2-Nitrodiphenylamine (2-NDPA) (CAS 119-75-5);\nML8.Note 1.bb.  4-Nitrodiphenylamine (4-NDPA) (CAS 836-30-6);\nML8.Note 1.cc.  2,2-dinitropropanol (CAS 918-52-5);\nML8.Note 1.dd.  Nitroguanidine (CAS 556-88-7) (see 1.C.11.d. on the Dual-Use List).\nML8.Note 2.  ML8. does not apply to ammonium perchlorate (ML8.d.2.), NTO (ML8.a.18.) or catocene (ML8.f.4.b.), and meeting all of the following:\nML8.Note 2.a.  Specially shaped and formulated for civil-use gas generation devices;\nML8.Note 2.b.  Compounded or mixed, with non-active thermoset binders or plasticizers, and having a mass of less than 250 g;\nML8.Note 2.c.  Having a maximum of 80% ammonium perchlorate (ML8.d.2.) in mass of active material;\nML8.Note 2.d.  Having less than or equal to 4 g of NTO (ML8.a.18.); and\nML8.Note 2.e.  Having less than or equal to 1 g of catocene (ML8.f.4.b.).\n'),
(39583,'','','','ML10.  Aircraft, \"lighter-than-air vehicles\", \"Unmanned Aerial Vehicles\" (\"UAVs\"), aero-engines and \"aircraft\" equipment, related equipment, and components, as follows, specially designed or modified for military use:\nML10.a.  Manned \"aircraft\" and \"lighter-than-air vehicles\", and specially designed components therefor;\nML10.a.Note 1.  ML10.a. does not apply to \"aircraft\" and \"lighter-than-air vehicles\" or variants of those \"aircraft\", specially designed for military use and which are all of the following:\nML10.a.Note 1.a.  Not a combat \"aircraft\";\nML10.a.Note 1.b.  Not configured for military use and not fitted with equipment or attachments specially designed or modified for military use; and\nML10.a.Note 1.c.  Certified for civil use by civil aviation authorities of one or more Wassenaar Arrangement Participating States.\nML10.Note 3.  For the purposes of ML10.a. and ML10.d., specially designed components and related equipment for non-military \"aircraft\" or aero-engines modified for military use applies only to those military components and to military related equipment required for the modification to military use.\nML10.a.Note 4.  For the purposes of ML10.a., military use includes: combat, military reconnaissance, assault, military training, logistics support, and transporting and airdropping troops or military equipment.\nML10.a.Note 5.  ML10.a. does not apply to \"aircraft\" or \"lighter-than-air vehicles\" that meet all of the following:\nML10.a.Note 5.a.  Were first manufactured before 1946;\nML10.a.Note 5.b.  Do not incorporate items specified by the Munitions List, unless the items are required to meet safety or airworthiness standards of civil aviation authorities of one or more Wassenaar Arrangement Participating States; and\nML10.a.Note 5.c.  Do not incorporate weapons specified by the Munitions List, unless inoperable and incapable of being returned to operation.\n'),
(39584,'','','','ML7.  Chemical agents, \"biological agents\", \"riot control agents\", radioactive materials, related equipment, components and materials, as follows:\nML7.Note 1.  ML7.b. and ML7.d. do not apply to the following:\nML7.Note 1.a.  Cyanogen chloride (CAS 506-77-4);\nML7.Note 1.b.  Hydrocyanic acid (CAS 74-90-8);\nML7.Note 1.c.  Chlorine (CAS 7782-50-5);\nML7.Note 1.d.  Carbonyl chloride (phosgene) (CAS 75-44-5);\nML7.Note 1.e.  Diphosgene (trichloromethyl-chloroformate) (CAS 503-38-8);\nML7.Note 1.f.  Not used since 2004\nML7.Note 1.g.  Xylyl bromide, ortho: (CAS 89-92-9), meta: (CAS 620-13-3), para: (CAS 104-81-4);\nML7.Note 1.h.  Benzyl bromide (CAS 100-39-0);\nML7.Note 1.i.  Benzyl iodide (CAS 620-05-3);\nML7.Note 1.j.  Bromo acetone (CAS 598-31-2);\nML7.Note 1.k.  Cyanogen bromide (CAS 506-68-3);\nML7.Note 1.l.  Bromo methylethylketone (CAS 816-40-0);\nML7.Note 1.m.  Chloro acetone (CAS 78-95-5);\nML7.Note 1.n.  Ethyl iodoacetate (CAS 623-48-3);\nML7.Note 1.o.  Iodo acetone (CAS 3019-04-3);\nML7.Note 1.p.  Chloropicrin (CAS 76-06-2).\nML7.Note 2  The cultures of cells and biological systems specified by ML7.h. and ML7.i.2. are exclusive and these sub-items do not apply to cells or biological systems for civil purposes, such as agricultural, pharmaceutical, medical, veterinary, environmental, waste management, or in the food industry.\n'),
(39585,'','','','ML7.  Chemical agents, \"biological agents\", \"riot control agents\", radioactive materials, related equipment, components and materials, as follows:\nML7.Note 1.  ML7.b. and ML7.d. do not apply to the following:\nML7.Note 1.a.  Cyanogen chloride (CAS 506-77-4);\nML7.Note 1.b.  Hydrocyanic acid (CAS 74-90-8);\nML7.Note 1.c.  Chlorine (CAS 7782-50-5);\nML7.Note 1.d.  Carbonyl chloride (phosgene) (CAS 75-44-5);\nML7.Note 1.e.  Diphosgene (trichloromethyl-chloroformate) (CAS 503-38-8);\nML7.Note 1.f.  Not used since 2004\nML7.Note 1.g.  Xylyl bromide, ortho: (CAS 89-92-9), meta: (CAS 620-13-3), para: (CAS 104-81-4);\nML7.Note 1.h.  Benzyl bromide (CAS 100-39-0);\nML7.Note 1.i.  Benzyl iodide (CAS 620-05-3);\nML7.Note 1.j.  Bromo acetone (CAS 598-31-2);\nML7.Note 1.k.  Cyanogen bromide (CAS 506-68-3);\nML7.Note 1.l.  Bromo methylethylketone (CAS 816-40-0);\nML7.Note 1.m.  Chloro acetone (CAS 78-95-5);\nML7.Note 1.n.  Ethyl iodoacetate (CAS 623-48-3);\nML7.Note 1.o.  Iodo acetone (CAS 3019-04-3);\nML7.Note 1.p.  Chloropicrin (CAS 76-06-2).\nML7.Note 2  The cultures of cells and biological systems specified by ML7.h. and ML7.i.2. are exclusive and these sub-items do not apply to cells or biological systems for civil purposes, such as agricultural, pharmaceutical, medical, veterinary, environmental, waste management, or in the food industry.\n'),
