(39645,'','','','ML7.  Chemical agents, \"biological agents\", \"riot control agents\", radioactive materials, related equipment, components and materials, as follows:\nML7.b.  Chemical warfare (CW) agents, including:\nML7.b.1.  CW nerve agents:\nML7.b.1.a.  O-Alkyl (equal to or less than C10, including cycloalkyl) alkyl (Methyl, Ethyl, n-Propyl or Isopropyl) - phosphonofluoridates, such as:\nML7.b.1.a.  -Sarin (GB):O-Isopropyl methylphosphonofluoridate (CAS 107-44-8); and\nML7.b.1.a.  -Soman (GD):O-Pinacolyl methylphosphonofluoridate (CAS 96-64-0);\nML7.b.1.b.  O-Alkyl (equal to or less than C10, including cycloalkyl)\nML7.b.1.b.  N,N-dialkyl (Methyl, Ethyl, n-Propyl or Isopropyl) phosphoramidocyanidates, such as: Tabun (GA):O-Ethyl\nML7.b.1.b.  N,N-dimethylphosphoramidocyanidate (CAS 77-81-6);\nML7.b.1.c.  O-Alkyl (H or equal to or less than C10, including cycloalkyl)\nML7.b.1.c.  S-2-dialkyl (Methyl, Ethyl, n-Propyl or Isopropyl)-aminoethyl alkyl (Methyl, Ethyl, n-Propyl or Isopropyl) phosphonothiolates and corresponding alkylated and protonated salts, such as:\nML7.b.1.c.  VX: O-Ethyl S-2-diisopropylaminoethyl methyl phosphonothiolate (CAS 50782-69-9);\nML7.Note 1.  ML7.b. and ML7.d. do not apply to the following:\nML7.Note 1.a.  Cyanogen chloride (CAS 506-77-4);\nML7.Note 1.b.  Hydrocyanic acid (CAS 74-90-8);\nML7.Note 1.c.  Chlorine (CAS 7782-50-5);\nML7.Note 1.d.  Carbonyl chloride (phosgene) (CAS 75-44-5);\nML7.Note 1.e.  Diphosgene (trichloromethyl-chloroformate) (CAS 503-38-8);\nML7.Note 1.f.  Not used since 2004\nML7.Note 1.g.  Xylyl bromide, ortho: (CAS 89-92-9), meta: (CAS 620-13-3), para: (CAS 104-81-4);\nML7.Note 1.h.  Benzyl bromide (CAS 100-39-0);\nML7.Note 1.i.  Benzyl iodide (CAS 620-05-3);\nML7.Note 1.j.  Bromo acetone (CAS 598-31-2);\nML7.Note 1.k.  Cyanogen bromide (CAS 506-68-3);\nML7.Note 1.l.  Bromo methylethylketone (CAS 816-40-0);\nML7.Note 1.m.  Chloro acetone (CAS 78-95-5);\nML7.Note 1.n.  Ethyl iodoacetate (CAS 623-48-3);\nML7.Note 1.o.