(39844,'','','','ML8.  Energetic materials and related substances, as follows:\nML8.Technical Notes.1.  For the purposes of ML8., excluding ML8.c.11. or ML8.c.12., \'mixture\' refers to a composition of two or more substances with at least one substance being listed in the ML8 sub-items.\nML8.Technical Notes.2.  Any substance listed in the ML8 sub-items is subject to this list, even when utilised in an application other than that indicated.  (e.g., TAGN is predominantly used as an explosive but can also be used either as a fuel or an oxidizer.)\nML8.Technical Notes.3.  For the purposes of ML8., particle size is the mean particle diameter on a weight or volume basis.  International or equivalent national standards will be used in sampling and determining particle size.\nML8.a.  Explosives as follows, and \'mixtures\' thereof:\nML8.a.1.  ADNBF (aminodinitrobenzofuroxan or 7-amino-4,6-dinitrobenzofurazane-1-oxide) (CAS 97096-78-1);\nML8.a.2.  BNCP (cis-bis (5-nitrotetrazolato) tetra amine-cobalt (III) perchlorate)\nML8.a.2.   (CAS 117412-28-9);\nML8.a.3.  CL-14 (diamino dinitrobenzofuroxan or 5,7-diamino-4,6-dinitrobenzofurazane-1-oxide ) (CAS 117907-74-1);\nML8.a.4.  CL-20 (HNIW or Hexanitrohexaazaisowurtzitane) (CAS 135285-90-4); chlathrates of CL-20 (see also ML8.g.3. and g.4. for its \"precursors\");\nML8.a.5.  CP (2-(5-cyanotetrazolato) penta amine-cobalt (III) perchlorate)\nML8.a.5.   (CAS 70247-32-4);\nML8.a.6.  DADE (1,1-diamino-2,2-dinitroethylene, FOX-7) (CAS 145250-81-3);\nML8.a.7.  DATB (diaminotrinitrobenzene) (CAS 1630-08-6);\nML8.a.8.  DDFP (1,4-dinitrodifurazanopiperazine);\nML8.a.9.  DDPO (2,6-diamino-3,5-dinitropyrazine-1-oxide, PZO) (CAS 194486-77-6);\nML8.a.10.  DIPAM (3,3-diamino-2,2,4,4,6,6-hexanitrobiphenyl or dipicramide)\nML8.a.10.   (CAS 17215-44-0);\nML8.a.11.  DNGU (DINGU or dinitroglycoluril) (CAS 55510-04-8);\nML8.a.12.  Furazans as follows:\nML8.a.12.a.  DAAOF (DAAF, DAAFox, or diaminoazoxyfurazan);\nML8.a.12.b.  DAAzF (diaminoazofurazan) (CAS 78644-90-3);\nML8.a.13.  HMX and derivatives (see also ML8.g.5. for its \"precursors\"), as follows:\nML8.a.13.a.  HMX (Cyclotetramethylenetetranitramine, octahydro-1,3,5,7-tetranitro-1,3,5,7-tetrazine, 1,3,5,7-tetranitro-1,3,5,7-tetraza-cyclooctane, octogen or octogene) (CAS 2691-41-0);\nML8.a.13.b.  difluoroaminated analogs of HMX;\nML8.a.13.c.  K-55 (2,4,6,8-tetranitro-2,4,6,8-tetraazabicyclo [3,3,0]-octanone-3, tetranitrosemiglycouril or keto-bicyclic HMX) (CAS 130256-72-3);\nML8.a.14.  HNAD (hexanitroadamantane) (CAS 143850-71-9);\nML8.a.15.  HNS (hexanitrostilbene) (CAS 20062-22-0);\nML8.a.16.  Imidazoles as follows:\nML8.a.16.a.  BNNII (Octahydro-2,5-bis(nitroimino)imidazo [4,5-d]imidazole);\nML8.a.16.b.  DNI (2,4-dinitroimidazole) (CAS 5213-49-0);\nML8.a.16.c.  FDIA (1-fluoro-2,4-dinitroimidazole);\nML8.a.16.d.  NTDNIA (N-(2-nitrotriazolo)-2,4-dinitroimidazole);\nML8.a.16.e.  PTIA (1-picryl-2,4,5-trinitroimidazole);\nML8.a.17.  NTNMH (1-(2-nitrotriazolo)-2-dinitromethylene hydrazine);\nML8.a.18.  NTO (ONTA or 3-nitro-1,2,4-triazol-5-one) (CAS 932-64-9);\nML8.a.19.  Polynitrocubanes with more than four nitro groups;\nML8.a.20.  PYX (2,6-Bis(picrylamino)-3,5-dinitropyridine) (CAS 38082-89-2);\nML8.a.21.  RDX and derivatives, as follows:\nML8.a.21.a.  RDX (cyclotrimethylenetrinitramine, cyclonite, T4, hexahydro-1,3,5-trinitro-1,3,5-triazine, 1,3,5-trinitro-1,3,5-triaza-cyclohexane, hexogen or hexogene) (CAS 121-82-4);\nML8.a.21.b.  Keto-RDX (K-6 or 2,4,6-trinitro-2,4,6-triazacyclohexanone)\nML8.a.21.b.  (CAS 115029-35-1);\nML8.a.22.  TAGN (triaminoguanidinenitrate) (CAS 4000-16-2);\nML8.a.23.  TATB (triaminotrinitrobenzene) (CAS 3058-38-6) (see also ML8.g.7 for its \"precursors\");\nML8.a.24.  TEDDZ (3,3,7,7-tetrabis(difluoroamine) octahydro-1,5-dinitro-1,5-diazocine);\nML8.a.25.  Tetrazoles as follows:\nML8.a.25.a.  NTAT (nitrotriazol aminotetrazole);\nML8.a.25.b.  NTNT (1-N-(2-nitrotriazolo)-4-nitrotetrazole);\nML8.a.26.  Tetryl (trinitrophenylmethylnitramine) (CAS 479-45-8);\nML8.a.27.  TNAD (1,4,5,8-tetranitro-1,4,5,8-tetraazadecalin) (CAS 135877-16-6)\nML8.a.27.  (see also ML8.g.6. for its \"precursors\");\nML8.a.28.  TNAZ (1,3,3-trinitroazetidine) (CAS 97645-24-4)\nML8.a.28.  (see also ML8.g.2. for its \"precursors\");\nML8.a.29.  TNGU (SORGUYL or tetranitroglycoluril) (CAS 55510-03-7);\nML8.a.30.  TNP (1,4,5,8-tetranitro-pyridazino[4,5-d]pyridazine) (CAS 229176-04-9);\nML8.a.31.  Triazines as follows:\nML8.a.31.a.  DNAM (2-oxy-4,6-dinitroamino-s-triazine) (CAS 19899-80-0);\nML8.a.31.b.  NNHT (2-nitroimino-5-nitro-hexahydro-1,3,5-triazine)\nML8.a.31.b.  (CAS 130400-13-4);\nML8.a.32.  Triazoles as follows:\nML8.a.32.a.  5-azido-2-nitrotriazole;\nML8.a.32.b.  ADHTDN (4-amino-3,5-dihydrazino-1,2,4-triazole dinitramide)\nML8.a.32.b.  (CAS 1614-08-0);\nML8.a.32.c.  ADNT (1-amino-3,5-dinitro-1,2,4-triazole);\nML8.a.32.d.  BDNTA ((bis-dinitrotriazole)amine);\nML8.a.32.e.  DBT (3,3-dinitro-5,5-bi-1,2,4-triazole) (CAS 30003-46-4);\nML8.a.32.f.  DNBT (dinitrobistriazole) (CAS 70890-46-9);\nML8.a.32.g.  Not used since 2010\nML8.a.32.h.  NTDNT (1-N-(2-nitrotriazolo) 3,5-dinitrotriazole);\nML8.a.32.i.  PDNT (1-picryl-3,5-dinitrotriazole);\nML8.a.32.j.  TACOT (tetranitrobenzotriazolobenzotriazole) (CAS 25243-36-1);\nML8.a.33.  Explosives not listed elsewhere in ML8.a. and having any of the following:\nML8.a.33.a.  Detonation velocity exceeding 8,700 m/s, at maximum density, or\nML8.a.33.b.  Detonation pressure exceeding 34 GPa (340 kbar);\nML8.a.34.  Not used since 2013\nML8.a.35.  DNAN (2,4-dinitroanisole) (CAS 119-27-7);\nML8.a.36.  TEX (4,10-Dinitro-2,6,8,12-tetraoxa-4,10-diazaisowurtzitane);\nML8.a.37.  GUDN (Guanylurea dinitramide) FOX-12 (CAS 217464-38-5);\nML8.a.38.  Tetrazines as follows:\nML8.a.38.a.  BTAT (Bis(2,2,2-trinitroethyl)-3,6-diaminotetrazine);\nML8.a.38.b.  LAX-112 (3,6-diamino-1,2,4,5-tetrazine-1,4-dioxide);\nML8.a.39.  Energetic ionic materials melting between 343 K (70°C) and 373 K (100°C) and with detonation velocity exceeding 6,800 m/s or detonation pressure exceeding 18 GPa (180 kbar);\nML8.a.40.  BTNEN (Bis(2,2,2-trinitroethyl)-nitramine) (CAS 19836-28-3);\nML8.a.41.  FTDO (5,6-(3\',4\'-furazano)- 1,2,3,4-tetrazine-1,3-dioxide);\nML8.a.42.  EDNA (Ethylenedinitramine) (CAS 505-71-5);\nML8.a.43.  TKX-50 (Dihydroxylammonium 5,5\'-bistetrazole-1,1\'-diolate);\nML8.a.Note.  ML8.a. includes \'explosive co-crystals\'.\nML8.a.Note.Technical Note.  An \'explosive co-crystal\' is a solid material consisting of an ordered three dimensional arrangement of two or more explosive molecules, where at least one is specified in ML8.a.\nML8.Note 1.  ML8. does not apply to the following substances unless they are compounded or mixed with the \"energetic material\" specified by ML8.a. or powdered metals specified by ML8.c.:\nML8.Note 1.a.  Ammonium picrate (CAS 131-74-8);\nML8.Note 1.b.  Black powder;\nML8.Note 1.c.  Hexanitrodiphenylamine (CAS 131-73-7);\nML8.Note 1.d.  Difluoroamine (CAS 10405-27-3);\nML8.Note 1.e.  Nitrostarch (CAS 9056-38-6);\nML8.Note 1.f.  Potassium nitrate (CAS 7757-79-1);\nML8.Note 1.g.  Tetranitronaphthalene;\nML8.Note 1.h.  Trinitroanisol;\nML8.Note 1.i.  Trinitronaphthalene;\nML8.Note 1.j.  Trinitroxylene;\nML8.Note 1.k.  N-pyrrolidinone; 1-methyl-2-pyrrolidinone (CAS 872-50-4);\nML8.Note 1.l.  Dioctylmaleate (CAS 142-16-5);\nML8.Note 1.m.  Ethylhexylacrylate (CAS 103-11-7);\nML8.Note 1.n.  Triethylaluminium (TEA) (CAS 97-93-8), trimethylaluminium (TMA) (CAS 75-24-1), and other pyrophoric metal alkyls and aryls of lithium, sodium, magnesium, zinc or boron;\nML8.Note 1.o.  Nitrocellulose (CAS 9004-70-0);\nML8.Note 1.p.  Nitroglycerin (or glyceroltrinitrate, trinitroglycerine) (NG) (CAS 55-63-0);\nML8.Note 1.q.  2,4,6-trinitrotoluene (TNT) (CAS 118-96-7);\nML8.Note 1.r.  Ethylenediaminedinitrate (EDDN) (CAS 20829-66-7);\nML8.Note 1.s.  Pentaerythritoltetranitrate (PETN) (CAS 78-11-5);\nML8.Note 1.t.  Lead azide (CAS 13424-46-9), normal lead styphnate (CAS 15245-44-0) and basic lead styphnate (CAS 12403-82-6), and primary explosives or priming compositions containing azides or azide complexes;\nML8.Note 1.u.  Triethyleneglycoldinitrate (TEGDN) (CAS 111-22-8);\nML8.Note 1.v.  2,4,6-trinitroresorcinol (styphnic acid) (CAS 82-71-3);\nML8.Note 1.w.  Diethyldiphenylurea; (CAS 85-98-3); dimethyldiphenylurea;\nML8.Note 1.w.  (CAS 611-92-7), methylethyldiphenylurea; [Centralites]\nML8.Note 1.x.  N,N-diphenylurea (unsymmetrical diphenylurea) (CAS 603-54-3);\nML8.Note 1.y.  Methyl-N,N-diphenylurea (methyl unsymmetrical diphenylurea)\nML8.Note 1.y.  (CAS 13114-72-2);\nML8.Note 1.z.  Ethyl-N,N-diphenylurea (ethyl unsymmetrical diphenylurea)\nML8.Note 1.z.  (CAS 64544-71-4);\nML8.Note 1.aa.  2-Nitrodiphenylamine (2-NDPA) (CAS 119-75-5);\nML8.Note 1.bb.  4-Nitrodiphenylamine (4-NDPA) (CAS 836-30-6);\nML8.Note 1.cc.  2,2-dinitropropanol (CAS 918-52-5);\nML8.Note 1.dd.  Nitroguanidine (CAS 556-88-7) (see 1.C.11.d. on the Dual-Use List).\nML8.Note 2.  ML8. does not apply to ammonium perchlorate (ML8.d.2.), NTO (ML8.a.18.) or catocene (ML8.f.4.b.), and meeting all of the following:\nML8.Note 2.a.  Specially shaped and formulated for civil-use gas generation devices;\nML8.Note 2.b.  Compounded or mixed, with non-active thermoset binders or plasticizers, and having a mass of less than 250 g;\nML8.Note 2.c.  Having a maximum of 80% ammonium perchlorate (ML8.d.2.) in mass of active material;\nML8.Note 2.d.  Having less than or equal to 4 g of NTO (ML8.a.18.); and\nML8.Note 2.e.  Having less than or equal to 1 g of catocene (ML8.f.4.b.).\n'),
(39845,'','','','ML17.  Miscellaneous equipment, materials and \"libraries\", as follows, and specially designed components therefor:\nML17.o.  Laser protection equipment (e.g., eye or sensor protection) specially designed for military use;\nML17.Technical Note.1.  Not used since 2014\nML17.Technical Note.2.  For the purpose of ML17, \'modified\' means any structural, electrical, mechanical, or other change that provides a non-military item with military capabilities equivalent to an item which is specially designed for military use.\n'),
(39846,'','','','ML6.  Ground vehicles and components, as follows:\nML6.a.  Ground vehicles and components therefor, specially designed or modified for military use;\nML6.a.Note 1.  ML6.a. includes:\nML6.a.Note 1.a.  Tanks and other military armed vehicles and military vehicles fitted with mountings for arms or equipment for mine laying or the launching of munitions specified by ML4;\nML6.a.Note 1.b.  Armoured vehicles;\nML6.a.Note 1.c.  Amphibious and deep water fording vehicles;\nML6.a.Note 1.d.  Recovery vehicles and vehicles for towing or transporting ammunition or weapon systems and associated load handling equipment;\nML6.a.Note 1.e.  Trailers.\nML6.a.Note 2.  Modification of a ground vehicle for military use specified by ML6.a. entails a structural, electrical or mechanical change involving one or more components that are specially designed for military use.  Such components include:\nML6.a.Note 2.a.  Pneumatic tyre casings of a kind specially designed to be bullet-proof;\nML6.a.Note 2.b.  Armoured protection of vital parts (e.g., fuel tanks or vehicle cabs);\nML6.a.Note 2.c.  Special reinforcements or mountings for weapons;\nML6.a.Note 2.d.  Black-out lighting.\nML6.Note 1.  ML6. does not apply to civil vehicles designed or modified for transporting money or valuables.\nML6.Note 2.  ML6. does not apply to vehicles that meet all of the following;\nML6.Note 2.a.  Were manufactured before 1946;\nML6.Note 2.b.  Do not have items specified by the Munitions List and manufactured after 1945, except for reproductions of original components or accessories for the vehicle; and\nML6.Note 2.c.  Do not incorporate weapons specified in ML1., ML2. or ML4. unless they are inoperable and incapable of discharging a projectile.\n'),
(39847,'','','','ML7.  Chemical agents, \"biological agents\", \"riot control agents\", radioactive materials, related equipment, components and materials, as follows:\nML7.b.  Chemical warfare (CW) agents, including:\nML7.b.2.  CW vesicant agents:\nML7.b.2.a.  Sulphur mustards, such as:\nML7.b.2.a.3.  Bis(2-chloroethylthio) methane (CAS 63869-13-6);\nML7.Note 1.  ML7.b. and ML7.d. do not apply to the following:\nML7.Note 1.a.  Cyanogen chloride (CAS 506-77-4);\nML7.Note 1.b.  Hydrocyanic acid (CAS 74-90-8);\nML7.Note 1.c.  Chlorine (CAS 7782-50-5);\nML7.Note 1.d.  Carbonyl chloride (phosgene) (CAS 75-44-5);\nML7.Note 1.e.  Diphosgene (trichloromethyl-chloroformate) (CAS 503-38-8);\nML7.Note 1.f.  Not used since 2004\nML7.Note 1.g.  Xylyl bromide, ortho: (CAS 89-92-9), meta: (CAS 620-13-3), para: (CAS 104-81-4);\nML7.Note 1.h.  Benzyl bromide (CAS 100-39-0);\nML7.Note 1.i.  Benzyl iodide (CAS 620-05-3);\nML7.Note 1.j.  Bromo acetone (CAS 598-31-2);\nML7.Note 1.k.  Cyanogen bromide (CAS 506-68-3);\nML7.Note 1.l.  Bromo methylethylketone (CAS 816-40-0);\nML7.Note 1.m.  Chloro acetone (CAS 78-95-5);\nML7.Note 1.n.  Ethyl iodoacetate (CAS 623-48-3);\nML7.Note 1.o.  Iodo acetone (CAS 3019-04-3);\nML7.Note 1.p.  Chloropicrin (CAS 76-06-2).\nML7.Note 2  The cultures of cells and biological systems specified by ML7.h. and ML7.i.2. are exclusive and these sub-items do not apply to cells or biological systems for civil purposes, such as agricultural, pharmaceutical, medical, veterinary, environmental, waste management, or in the food industry.\n'),
(39848,'','','','ML8.  Energetic materials and related substances, as follows:\nML8.Technical Notes.1.  For the purposes of ML8., excluding ML8.c.11. or ML8.c.12., \'mixture\' refers to a composition of two or more substances with at least one substance being listed in the ML8 sub-items.\nML8.Technical Notes.2.  Any substance listed in the ML8 sub-items is subject to this list, even when utilised in an application other than that indicated.  (e.g., TAGN is predominantly used as an explosive but can also be used either as a fuel or an oxidizer.)\nML8.Technical Notes.3.  For the purposes of ML8., particle size is the mean particle diameter on a weight or volume basis.  International or equivalent national standards will be used in sampling and determining particle size.\nML8.c.  Pyrotechnics, fuels and related substances, as follows, and \'mixtures\' thereof:\nML8.c.12.  Fuel mixtures, \"pyrotechnic\" mixtures or \"energetic materials\", not specified elsewhere in ML8, having all of the following:\nML8.c.12.a.  Containing greater than 0.5% of particles of any of the following:\nML8.c.12.a.2.  Beryllium;\nML8.c.12.Note.  ML8.c.12. includes thermites.\nML8.Note 1.  ML8. does not apply to the following substances unless they are compounded or mixed with the \"energetic material\" specified by ML8.a. or powdered metals specified by ML8.c.:\nML8.Note 1.a.  Ammonium picrate (CAS 131-74-8);\nML8.Note 1.b.  Black powder;\nML8.Note 1.c.  Hexanitrodiphenylamine (CAS 131-73-7);\nML8.Note 1.d.  Difluoroamine (CAS 10405-27-3);\nML8.Note 1.e.  Nitrostarch (CAS 9056-38-6);\nML8.Note 1.f.  Potassium nitrate (CAS 7757-79-1);\nML8.Note 1.g.  Tetranitronaphthalene;\nML8.Note 1.h.  Trinitroanisol;\nML8.Note 1.i.  Trinitronaphthalene;\nML8.Note 1.j.  Trinitroxylene;\nML8.Note 1.k.  N-pyrrolidinone; 1-methyl-2-pyrrolidinone (CAS 872-50-4);\nML8.Note 1.l.  Dioctylmaleate (CAS 142-16-5);\nML8.Note 1.m.  Ethylhexylacrylate (CAS 103-11-7);\nML8.Note 1.n.  Triethylaluminium (TEA) (CAS 97-93-8), trimethylaluminium (TMA) (CAS 75-24-1), and other pyrophoric metal alkyls and aryls of lithium, sodium, magnesium, zinc or boron;\nML8.Note 1.o.  Nitrocellulose (CAS 9004-70-0);\nML8.Note 1.p.  Nitroglycerin (or glyceroltrinitrate, trinitroglycerine) (NG) (CAS 55-63-0);\nML8.Note 1.q.  2,4,6-trinitrotoluene (TNT) (CAS 118-96-7);\nML8.Note 1.r.  Ethylenediaminedinitrate (EDDN) (CAS 20829-66-7);\nML8.Note 1.s.  Pentaerythritoltetranitrate (PETN) (CAS 78-11-5);\nML8.Note 1.t.  Lead azide (CAS 13424-46-9), normal lead styphnate (CAS 15245-44-0) and basic lead styphnate (CAS 12403-82-6), and primary explosives or priming compositions containing azides or azide complexes;\nML8.Note 1.u.  Triethyleneglycoldinitrate (TEGDN) (CAS 111-22-8);\nML8.Note 1.v.  2,4,6-trinitroresorcinol (styphnic acid) (CAS 82-71-3);\nML8.Note 1.w.  Diethyldiphenylurea; (CAS 85-98-3); dimethyldiphenylurea;\nML8.Note 1.w.  (CAS 611-92-7), methylethyldiphenylurea; [Centralites]\nML8.Note 1.x.  N,N-diphenylurea (unsymmetrical diphenylurea) (CAS 603-54-3);\nML8.Note 1.y.  Methyl-N,N-diphenylurea (methyl unsymmetrical diphenylurea)\nML8.Note 1.y.  (CAS 13114-72-2);\nML8.Note 1.z.  Ethyl-N,N-diphenylurea (ethyl unsymmetrical diphenylurea)\nML8.Note 1.z.  (CAS 64544-71-4);\nML8.Note 1.aa.  2-Nitrodiphenylamine (2-NDPA) (CAS 119-75-5);\nML8.Note 1.bb.  4-Nitrodiphenylamine (4-NDPA) (CAS 836-30-6);\nML8.Note 1.cc.  2,2-dinitropropanol (CAS 918-52-5);\nML8.Note 1.dd.  Nitroguanidine (CAS 556-88-7) (see 1.C.11.d. on the Dual-Use List).\nML8.Note 2.  ML8. does not apply to ammonium perchlorate (ML8.d.2.), NTO (ML8.a.18.) or catocene (ML8.f.4.b.), and meeting all of the following:\nML8.Note 2.a.  Specially shaped and formulated for civil-use gas generation devices;\nML8.Note 2.b.  Compounded or mixed, with non-active thermoset binders or plasticizers, and having a mass of less than 250 g;\nML8.Note 2.c.  Having a maximum of 80% ammonium perchlorate (ML8.d.2.) in mass of active material;\nML8.Note 2.d.  Having less than or equal to 4 g of NTO (ML8.a.18.); and\nML8.Note 2.e.  Having less than or equal to 1 g of catocene (ML8.f.4.b.).\n'),
(39849,'','','','ML1.  Smooth-bore weapons with a calibre of less than 20 mm, other arms and automatic weapons with a calibre of 12.7 mm (calibre 0.50 inches) or less and accessories, as follows, and specially designed components therefor:\nML1.Note  ML1. does not apply to:\nML1.Note.a.  Firearms specially designed for dummy ammunition and which are incapable of discharging a projectile;\nML1.Note.b.  Firearms specially designed to launch tethered projectiles having no high explosive charge or communications link, to a range of less than or equal to 500 m.;\nML1.Note.c.  Weapons using non-centre fire cased ammunition and which are not of the fully automatic firing type;\nML1.Note.d.  Deactivated firearms.\n'),
(39850,'','','','ML8.  Energetic materials and related substances, as follows:\nML8.Technical Notes.1.  For the purposes of ML8., excluding ML8.c.11. or ML8.c.12., \'mixture\' refers to a composition of two or more substances with at least one substance being listed in the ML8 sub-items.\nML8.Technical Notes.2.  Any substance listed in the ML8 sub-items is subject to this list, even when utilised in an application other than that indicated.  (e.g., TAGN is predominantly used as an explosive but can also be used either as a fuel or an oxidizer.)\nML8.Technical Notes.3.  For the purposes of ML8., particle size is the mean particle diameter on a weight or volume basis.  International or equivalent national standards will be used in sampling and determining particle size.\nML8.Note 1.  ML8. does not apply to the following substances unless they are compounded or mixed with the \"energetic material\" specified by ML8.a. or powdered metals specified by ML8.c.:\nML8.Note 1.a.  Ammonium picrate (CAS 131-74-8);\nML8.Note 1.b.  Black powder;\nML8.Note 1.c.  Hexanitrodiphenylamine (CAS 131-73-7);\nML8.Note 1.d.  Difluoroamine (CAS 10405-27-3);\nML8.Note 1.e.  Nitrostarch (CAS 9056-38-6);\nML8.Note 1.f.  Potassium nitrate (CAS 7757-79-1);\nML8.Note 1.g.  Tetranitronaphthalene;\nML8.Note 1.h.  Trinitroanisol;\nML8.Note 1.i.  Trinitronaphthalene;\nML8.Note 1.j.  Trinitroxylene;\nML8.Note 1.k.  N-pyrrolidinone; 1-methyl-2-pyrrolidinone (CAS 872-50-4);\nML8.Note 1.l.  Dioctylmaleate (CAS 142-16-5);\nML8.Note 1.m.  Ethylhexylacrylate (CAS 103-11-7);\nML8.Note 1.n.  Triethylaluminium (TEA) (CAS 97-93-8), trimethylaluminium (TMA) (CAS 75-24-1), and other pyrophoric metal alkyls and aryls of lithium, sodium, magnesium, zinc or boron;\nML8.Note 1.o.  Nitrocellulose (CAS 9004-70-0);\nML8.Note 1.p.  Nitroglycerin (or glyceroltrinitrate, trinitroglycerine) (NG) (CAS 55-63-0);\nML8.Note 1.q.  2,4,6-trinitrotoluene (TNT) (CAS 118-96-7);\nML8.Note 1.r.  Ethylenediaminedinitrate (EDDN) (CAS 20829-66-7);\nML8.Note 1.s.  Pentaerythritoltetranitrate (PETN) (CAS 78-11-5);\nML8.Note 1.t.  Lead azide (CAS 13424-46-9), normal lead styphnate (CAS 15245-44-0) and basic lead styphnate (CAS 12403-82-6), and primary explosives or priming compositions containing azides or azide complexes;\nML8.Note 1.u.  Triethyleneglycoldinitrate (TEGDN) (CAS 111-22-8);\nML8.Note 1.v.  2,4,6-trinitroresorcinol (styphnic acid) (CAS 82-71-3);\nML8.Note 1.w.  Diethyldiphenylurea; (CAS 85-98-3); dimethyldiphenylurea;\nML8.Note 1.w.  (CAS 611-92-7), methylethyldiphenylurea; [Centralites]\nML8.Note 1.x.  N,N-diphenylurea (unsymmetrical diphenylurea) (CAS 603-54-3);\nML8.Note 1.y.  Methyl-N,N-diphenylurea (methyl unsymmetrical diphenylurea)\nML8.Note 1.y.  (CAS 13114-72-2);\nML8.Note 1.z.  Ethyl-N,N-diphenylurea (ethyl unsymmetrical diphenylurea)\nML8.Note 1.z.  (CAS 64544-71-4);\nML8.Note 1.aa.  2-Nitrodiphenylamine (2-NDPA) (CAS 119-75-5);\nML8.Note 1.bb.  4-Nitrodiphenylamine (4-NDPA) (CAS 836-30-6);\nML8.Note 1.cc.  2,2-dinitropropanol (CAS 918-52-5);\nML8.Note 1.dd.  Nitroguanidine (CAS 556-88-7) (see 1.C.11.d. on the Dual-Use List).\nML8.Note 2.  ML8. does not apply to ammonium perchlorate (ML8.d.2.), NTO (ML8.a.18.) or catocene (ML8.f.4.b.), and meeting all of the following:\nML8.Note 2.a.  Specially shaped and formulated for civil-use gas generation devices;\nML8.Note 2.b.  Compounded or mixed, with non-active thermoset binders or plasticizers, and having a mass of less than 250 g;\nML8.Note 2.c.  Having a maximum of 80% ammonium perchlorate (ML8.d.2.) in mass of active material;\nML8.Note 2.d.  Having less than or equal to 4 g of NTO (ML8.a.18.); and\nML8.Note 2.e.  Having less than or equal to 1 g of catocene (ML8.f.4.b.).\n'),
(39851,'','','','ML9.  Vessels of war (surface or underwater), special naval equipment, accessories, components and other surface vessels, as follows:\nML9.a.  Vessels and components, as follows:\nML9.a.2.  Surface vessels, not specified in ML9.a.1., having any of the following, fixed or integrated into the vessel:\nML9.a.2.d.  Active weapon countermeasure systems specified in ML4.b., ML5.c. or ML11.a. and having any of the following:\nML9.a.2.d.4.  A degaussing system designed to reduce the magnetic signature of the whole vessel;\n'),
(39852,'','','','ML6.  Ground vehicles and components, as follows:\nML6.a.  Ground vehicles and components therefor, specially designed or modified for military use;\nML6.a.Note 1.  ML6.a. includes:\nML6.a.Note 1.a.  Tanks and other military armed vehicles and military vehicles fitted with mountings for arms or equipment for mine laying or the launching of munitions specified by ML4;\nML6.a.Note 1.b.  Armoured vehicles;\nML6.a.Note 1.c.  Amphibious and deep water fording vehicles;\nML6.a.Note 1.d.  Recovery vehicles and vehicles for towing or transporting ammunition or weapon systems and associated load handling equipment;\nML6.a.Note 1.e.  Trailers.\nML6.a.Note 2.  Modification of a ground vehicle for military use specified by ML6.a. entails a structural, electrical or mechanical change involving one or more components that are specially designed for military use.  Such components include:\nML6.a.Note 2.a.  Pneumatic tyre casings of a kind specially designed to be bullet-proof;\nML6.a.Note 2.b.  Armoured protection of vital parts (e.g., fuel tanks or vehicle cabs);\nML6.a.Note 2.c.  Special reinforcements or mountings for weapons;\nML6.a.Note 2.d.  Black-out lighting.\nML6.Note 1.  ML6. does not apply to civil vehicles designed or modified for transporting money or valuables.\nML6.Note 2.  ML6. does not apply to vehicles that meet all of the following;\nML6.Note 2.a.  Were manufactured before 1946;\nML6.Note 2.b.  Do not have items specified by the Munitions List and manufactured after 1945, except for reproductions of original components or accessories for the vehicle; and\nML6.Note 2.c.  Do not incorporate weapons specified in ML1., ML2. or ML4. unless they are inoperable and incapable of discharging a projectile.\n'),
(39853,'','','','ML8.  Energetic materials and related substances, as follows:\nML8.Technical Notes.1.  For the purposes of ML8., excluding ML8.c.11. or ML8.c.12., \'mixture\' refers to a composition of two or more substances with at least one substance being listed in the ML8 sub-items.\nML8.Technical Notes.2.  Any substance listed in the ML8 sub-items is subject to this list, even when utilised in an application other than that indicated.  (e.g., TAGN is predominantly used as an explosive but can also be used either as a fuel or an oxidizer.)\nML8.Technical Notes.3.  For the purposes of ML8., particle size is the mean particle diameter on a weight or volume basis.  International or equivalent national standards will be used in sampling and determining particle size.\nML8.Note 1.  ML8. does not apply to the following substances unless they are compounded or mixed with the \"energetic material\" specified by ML8.a. or powdered metals specified by ML8.c.:\nML8.Note 1.a.  Ammonium picrate (CAS 131-74-8);\nML8.Note 1.b.  Black powder;\nML8.Note 1.c.  Hexanitrodiphenylamine (CAS 131-73-7);\nML8.Note 1.d.  Difluoroamine (CAS 10405-27-3);\nML8.Note 1.e.  Nitrostarch (CAS 9056-38-6);\nML8.Note 1.f.  Potassium nitrate (CAS 7757-79-1);\nML8.Note 1.g.  Tetranitronaphthalene;\nML8.Note 1.h.  Trinitroanisol;\nML8.Note 1.i.  Trinitronaphthalene;\nML8.Note 1.j.  Trinitroxylene;\nML8.Note 1.k.  N-pyrrolidinone; 1-methyl-2-pyrrolidinone (CAS 872-50-4);\nML8.Note 1.l.  Dioctylmaleate (CAS 142-16-5);\nML8.Note 1.m.  Ethylhexylacrylate (CAS 103-11-7);\nML8.Note 1.n.  Triethylaluminium (TEA) (CAS 97-93-8), trimethylaluminium (TMA) (CAS 75-24-1), and other pyrophoric metal alkyls and aryls of lithium, sodium, magnesium, zinc or boron;\nML8.Note 1.o.  Nitrocellulose (CAS 9004-70-0);\nML8.Note 1.p.  Nitroglycerin (or glyceroltrinitrate, trinitroglycerine) (NG) (CAS 55-63-0);\nML8.Note 1.q.  2,4,6-trinitrotoluene (TNT) (CAS 118-96-7);\nML8.Note 1.r.  Ethylenediaminedinitrate (EDDN) (CAS 20