(39854,'','','','ML17.  Miscellaneous equipment, materials and \"libraries\", as follows, and specially designed components therefor:\nML17.j.  Mobile repair shops specially designed or \'modified\' to service military equipment;\nML17.Technical Note.1.  Not used since 2014\nML17.Technical Note.2.  For the purpose of ML17, \'modified\' means any structural, electrical, mechanical, or other change that provides a non-military item with military capabilities equivalent to an item which is specially designed for military use.\n'),
(39855,'','','','ML22.  Technology as follows:\nML22.Note 1.  Technology \"required\" for the \"development\", \"production\", operation, installation, maintenance (checking), repair, overhaul or refurbishing of items specified by the Munitions List remains under control even when applicable to any item not specified by the Munitions List.\nML22.Note 2.  ML22 does not apply to:\nML22.Note 2.a.  Technology that is the minimum necessary for the installation, operation, maintenance (checking) or repair, of those items which are not controlled or whose export has been authorised;\nML22.Note 2.b.  Technology that is \"in the public domain\", \"basic scientific research\" or the minimum necessary information for patent applications;\nML22.Note 2.c.  Technology for magnetic induction for continuous propulsion of civil transport devices.\n'),
(39856,'','','','ML8.  Energetic materials and related substances, as follows:\nML8.Technical Notes.1.  For the purposes of ML8., excluding ML8.c.11. or ML8.c.12., \'mixture\' refers to a composition of two or more substances with at least one substance being listed in the ML8 sub-items.\nML8.Technical Notes.2.  Any substance listed in the ML8 sub-items is subject to this list, even when utilised in an application other than that indicated.  (e.g., TAGN is predominantly used as an explosive but can also be used either as a fuel or an oxidizer.)\nML8.Technical Notes.3.  For the purposes of ML8., particle size is the mean particle diameter on a weight or volume basis.  International or equivalent national standards will be used in sampling and determining particle size.\nML8.d.  Oxidizers as follows, and \'mixtures\' thereof:\nML8.d.1.  ADN (ammonium dinitramide or SR 12) (CAS 140456-78-6);\nML8.Note 1.  ML8. does not apply to the following substances unless they are compounded or mixed with the \"energetic material\" specified by ML8.a. or powdered metals specified by ML8.c.:\nML8.Note 1.a.  Ammonium picrate (CAS 131-74-8);\nML8.Note 1.b.  Black powder;\nML8.Note 1.c.  Hexanitrodiphenylamine (CAS 131-73-7);\nML8.Note 1.d.  Difluoroamine (CAS 10405-27-3);\nML8.Note 1.e.  Nitrostarch (CAS 9056-38-6);\nML8.Note 1.f.  Potassium nitrate (CAS 7757-79-1);\nML8.Note 1.g.  Tetranitronaphthalene;\nML8.Note 1.h.  Trinitroanisol;\nML8.Note 1.i.  Trinitronaphthalene;\nML8.Note 1.j.  Trinitroxylene;\nML8.Note 1.k.  N-pyrrolidinone; 1-methyl-2-pyrrolidinone (CAS 872-50-4);\nML8.Note 1.l.  Dioctylmaleate (CAS 142-16-5);\nML8.Note 1.m.  Ethylhexylacrylate (CAS 103-11-7);\nML8.Note 1.n.  Triethylaluminium (TEA) (CAS 97-93-8), trimethylaluminium (TMA) (CAS 75-24-1), and other pyrophoric metal alkyls and aryls of lithium, sodium, magnesium, zinc or boron;\nML8.Note 1.o.  Nitrocellulose (CAS 9004-70-0);\nML8.Note 1.p.  Nitroglycerin (or glyceroltrinitrate, trinitroglycerine) (NG) (CAS 55-63-0);\nML8.Note 1.q.  2,4,6-trinitrotoluene (TNT) (CAS 118-96-7);\nML8.Note 1.r.  Ethylenediaminedinitrate (EDDN) (CAS 20829-66-7);\nML8.Note 1.s.  Pentaerythritoltetranitrate (PETN) (CAS 78-11-5);\nML8.Note 1.t.  Lead azide (CAS 13424-46-9), normal lead styphnate (CAS 15245-44-0) and basic lead styphnate (CAS 12403-82-6), and primary explosives or priming compositions containing azides or azide complexes;\nML8.Note 1.u.  Triethyleneglycoldinitrate (TEGDN) (CAS 111-22-8);\nML8.Note 1.v.  2,4,6-trinitroresorcinol (styphnic acid) (CAS 82-71-3);\nML8.Note 1.w.  Diethyldiphenylurea; (CAS 85-98-3); dimethyldiphenylurea;\nML8.Note 1.w.  (CAS 611-92-7), methylethyldiphenylurea; [Centralites]\nML8.Note 1.x.  N,N-diphenylurea (unsymmetrical diphenylurea) (CAS 603-54-3);\nML8.Note 1.y.  Methyl-N,N-diphenylurea (methyl unsymmetrical diphenylurea)\nML8.Note 1.y.  (CAS 13114-72-2);\nML8.Note 1.z.  Ethyl-N,N-diphenylurea (ethyl unsymmetrical diphenylurea)\nML8.Note 1.z.  (CAS 64544-71-4);\nML8.Note 1.aa.  2-Nitrodiphenylamine (2-NDPA) (CAS 119-75-5);\nML8.Note 1.bb.  4-Nitrodiphenylamine (4-NDPA) (CAS 836-30-6);\nML8.Note 1.cc.  2,2-dinitropropanol (CAS 918-52-5);\nML8.Note 1.dd.  Nitroguanidine (CAS 556-88-7) (see 1.C.11.d. on the Dual-Use List).\nML8.Note 2.  ML8. does not apply to ammonium perchlorate (ML8.d.2.), NTO (ML8.a.18.) or catocene (ML8.f.4.b.), and meeting all of the following:\nML8.Note 2.a.  Specially shaped and formulated for civil-use gas generation devices;\nML8.Note 2.b.  Compounded or mixed, with non-active thermoset binders or plasticizers, and having a mass of less than 250 g;\nML8.Note 2.c.  Having a maximum of 80% ammonium perchlorate (ML8.d.2.) in mass of active material;\nML8.Note 2.d.  Having less than or equal to 4 g of NTO (ML8.a.18.); and\nML8.Note 2.e.  Having less than or equal to 1 g of catocene (ML8.f.4.b.).\n'),
(39857,'','','','ML17.  Miscellaneous equipment, materials and \"libraries\", as follows, and specially designed components therefor:\nML17.a.  Diving and underwater swimming apparatus, specially designed or modified for military use, as follows:\nML17.a.1.  Self-contained diving rebreathers, closed or semi-closed circuit;\nML17.a.2.  Underwater swimming apparatus specially designed for use with the diving apparatus specified in ML17.a.1;\nML17.a.N.B.  See also 8.A.2.q. on the Dual-Use List.\nML17.b.  Construction equipment specially designed for military use;\nML17.c.  Fittings, coatings and treatments, for signature suppression, specially designed for military use;\nML17.d.  Field engineer equipment specially designed for use in a combat zone;\nML17.e.  Robots, \"robot\" controllers and \"robot\" \"end-effectors\", having any of the following characteristics:\nML17.e.1.  Specially designed for military use;\nML17.e.2.  Incorporating means of protecting hydraulic lines against externally induced punctures caused by ballistic fragments (e.g., incorporating self-sealing lines) and designed to use hydraulic fluids with flash points higher than 839 K (566°C); or\nML17.e.3.  Specially designed or rated for operating in an electro-magnetic pulse (EMP) environment;\nML17.e.3.Technical Note.  Electro-magnetic pulse does not refer to unintentional interference caused by electromagnetic radiation from nearby equipment (e.g., machinery, appliances or electronics) or lightning.\nML17.f.  Libraries specially designed or modified for military use with systems, equipment or components, specified by the Munitions List;\nML17.g.  Nuclear power generating equipment or propulsion equipment, not specified elsewhere, specially designed for military use and components therefor specially designed or \'modified\' for military use;\nML17.g.Note.  ML17.g. includes \"nuclear reactors\".\nML17.h.  Equipment and material, coated or treated for signature suppression, specially designed for military use, not specified elsewhere in the Munitions List;\nML17.i.  Simulators specially designed for military \"nuclear reactors\";\nML17.j.  Mobile repair shops specially designed or \'modified\' to service military equipment;\nML17.k.  Field generators specially designed or \'modified\' for military use;\nML17.l.  ISO intermodal containers or demountable vehicle bodies (i.e., swap bodies), specially designed or \'modified\' for military use;\nML17.m.  Ferries, not specified elsewhere in the Munitions List, bridges and pontoons, specially designed for military use;\nML17.n.  Test models specially designed for the \"development\" of items specified by ML4., ML6., ML9. or ML10.;\nML17.o.  Laser protection equipment (e.g., eye or sensor protection) specially designed for military use;\nML17.p.  Fuel cells, not specified elsewhere in the Munitions List, specially designed or \'modified\' for military use.\nML17.Technical Note.1.  Not used since 2014\nML17.Technical Note.2.  For the purpose of ML17, \'modified\' means any structural, electrical, mechanical, or other change that provides a non-military item with military capabilities equivalent to an item which is specially designed for military use.\n'),
(39858,'','','','ML21.  Software as follows:\nML21.c.  Software, not specified by ML21.a. or ML21.b., specially designed or modified to enable equipment not specified by the Munitions List to perform the military functions of equipment specified by the Munitions List.\n'),
(39859,'','','','ML4.  Bombs, torpedoes, rockets, missiles, other explosive devices and charges and related equipment and accessories, as follows, and specially designed components therefor:\nML4.c.  Aircraft Missile Protection Systems (AMPS).\nML4.c.Note.  ML4.c. does not apply to AMPS having all of the following:\nML4.c.Note.a.  Any of the following missile warning sensors:\nML4.c.Note.a.1.  Passive sensors having peak response between 100-400 nm; or\nML4.c.Note.a.2.  Active pulsed Doppler missile warning sensors;\nML4.c.Note.b.  Countermeasures dispensing systems;\nML4.c.Note.c.  Flares, which exhibit both a visible signature and an infrared signature, for decoying surface-to-air missiles; and\nML4.c.Note.d.  Installed on \"civil aircraft\" and having all of the following:\nML4.c.Note.d.1.  The AMPS is only operable in a specific \"civil aircraft\" in which the specific AMPS is installed and for which any of the following has been issued:\nML4.c.Note.d.1.a.  A civil Type Certificate issued by civil aviation authorities of one or more Wassenaar Arrangement Participating States; or\nML4.c.Note.d.1.b.  An equivalent document recognised by the International Civil Aviation Organisation (ICAO);\nML4.c.Note.d.2.  The AMPS employs protection to prevent unauthorised access to \"software\"; and\nML4.c.Note.d.3.  The AMPS incorporates an active mechanism that forces the system not to function when it is removed from the \"civil aircraft\" in which it was installed.\n'),
(39860,'','','','ML17.  Miscellaneous equipment, materials and \"libraries\", as follows, and specially designed components therefor:\nML17.c.  Fittings, coatings and treatments, for signature suppression, specially designed for military use;\nML17.Technical Note.1.  Not used since 2014\nML17.Technical Note.2.  For the purpose of ML17, \'modified\' means any structural, electrical, mechanical, or other change that provides a non-military item with military capabilities equivalent to an item which is specially designed for military use.\n'),
(39861,'','','','ML13.  Armoured or protective equipment, constructions and components, as follows:\nML13.d.  Body armour or protective garments, and components therefor, as follows:\nML13.d.1.  Soft body armour or protective garments, manufactured to military standards or specifications, or to their equivalents, and specially designed components therefor;\nML13.d.1.Note.  For the purposes of ML13.d.1., military standards or specifications include, at a minimum, specifications for fragmentation protection.\nML13.d.2.  Hard body armour plates providing ballistic protection equal to or greater than level III (NIJ 0101.06, July 2008) or national equivalents.\nML13.Note 3.  ML13.c. and d. do not apply to helmets, body armour or protective garments, when accompanying their user for the user\'s own personal protection.\nML13.d.N.B. 1   See also entry 1.A.5. on the Dual-Use List.\nML13.d.N.B. 2  For \"fibrous or filamentary materials\" used in the manufacture of body armour and helmets, see entry 1.C.10. on the Dual-Use List.\n'),
(39862,'','','','ML18.  \'Production\' equipment and components, as follows:\nML18.Technical Note.  For the purposes of ML18., the term \'production\' includes design, examination, manufacture, testing and checking.\nML18.Note.  ML18.a. and ML18.b. include the following equipment:\nML18.Note.a.  Continuous nitrators;\nML18.Note.b.  Centrifugal testing apparatus or equipment, having any of the following:\nML18.Note.b.1.  Driven by a motor or motors having a total rated horsepower of more than 298 kW (400 hp);\nML18.Note.b.2.  Capable of carrying a payload of 113 kg or more; or\nML18.Note.b.3.  Capable of exerting a centrifugal acceleration of 8 g or more on a payload of 91 kg or more;\nML18.Note.c.  Dehydration presses;\nML18.Note.d.  Screw extruders specially designed or modified for military \"explosive\" extrusion;\nML18.Note.e.  Cutting machines for the sizing of extruded \"propellants\";\nML18.Note.f.  Sweetie barrels (tumblers) 1.85 m or more in diameter and having over 227 kg product capacity;\nML18.Note.g.  Continuous mixers for solid \"propellants\";\nML18.Note.h.  Fluid energy mills for grinding or milling the ingredients of military \"explosives\";\nML18.Note.i.  Equipment to achieve both sphericity and uniform particle size in metal powder listed in ML8.c.8.;\nML18.Note.j.  Convection current converters for the conversion of materials listed in ML8.c.3.\n'),
(39863,'','','','ML8.  Energetic materials and related substances, as follows:\nML8.Technical Notes.1.  For the purposes of ML8., excluding ML8.c.11. or ML8.c.12., \'mixture\' refers to a composition of two or more substances with at least one substance being listed in the ML8 sub-items.\nML8.Technical Notes.2.  Any substance listed in the ML8 sub-items is subject to this list, even when utilised in an application other than that indicated.  (e.g., TAGN is predominantly used as an explosive but can also be used either as a fuel or an oxidizer.)\nML8.Technical Notes.3.  For the purposes of ML8., particle size is the mean particle diameter on a weight or volume basis.  International or equivalent national standards will be used in sampling and determining particle size.\nML8.e.  Binders, plasticizers, monomers and polymers, as follows:\nML8.e.13.  Alcohol functionalised poly(epichlorohydrin) with a molecular weight less than 10,000, as follows:\nML8.e.13.a.  Poly(epichlorohydrindiol);\nML8.Note 1.  ML8. does not apply to the following substances unless they are compounded or mixed with the \"energetic material\" specified by ML8.a. or powdered metals specified by ML8.c.:\nML8.Note 1.a.  Ammonium picrate (CAS 131-74-8);\nML8.Note 1.b.  Black powder;\nML8.Note 1.c.  Hexanitrodiphenylamine (CAS 131-73-7);\nML8.Note 1.d.  Difluoroamine (CAS 10405-27-3);\nML8.Note 1.e.  Nitrostarch (CAS 9056-38-6);\nML8.Note 1.f.  Potassium nitrate (CAS 7757-79-1);\nML8.Note 1.g.  Tetranitronaphthalene;\nML8.Note 1.h.  Trinitroanisol;\nML8.Note 1.i.  Trinitronaphthalene;\nML8.Note 1.j.  Trinitroxylene;\nML8.Note 1.k.  N-pyrrolidinone; 1-methyl-2-pyrrolidinone (CAS 872-50-4);\nML8.Note 1.l.  Dioctylmaleate (CAS 142-16-5);\nML8.Note 1.m.  Ethylhexylacrylate (CAS 103-11-7);\nML8.Note 1.n.  Triethylaluminium (TEA) (CAS 97-93-8), trimethylaluminium (TMA) (CAS 75-24-1), and other pyrophoric metal alkyls and aryls of lithium, sodium, magnesium, zinc or boron;\nML8.Note 1.o.  Nitrocellulose (CAS 9004-70-0);\nML8.Note 1.p.  Nitroglycerin (or glyceroltrinitrate, trinitroglycerine) (NG) (CAS 55-63-0);\nML8.Note 1.q.  2,4,6-trinitrotoluene (TNT) (CAS 118-96-7);\nML8.Note 1.r.  Ethylenediaminedinitrate (EDDN) (CAS 20829-66-7);\nML8.Note 1.s.  Pentaerythritoltetranitrate (PETN) (CAS 78-11-5);\nML8.Note 1.t.  Lead azide (CAS 13424-46-9), normal lead styphnate (CAS 15245-44-0) and basic lead styphnate (CAS 12403-82-6), and primary explosives or priming compositions containing azides or azide complexes;\nML8.Note 1.u.  Triethyleneglycoldinitrate (TEGDN) (CAS 111-22-8);\nML8.Note 1.v.  2,4,6-trinitroresorcinol (styphnic acid) (CAS 82-71-3);\nML8.Note 1.w.  Diethyldiphenylurea; (CAS 85-98-3); dimethyldiphenylurea;\nML8.Note 1.w.  (CAS 611-92-7), methylethyldiphenylurea; [Centralites]\nML8.Note 1.x.  N,N-diphenylurea (unsymmetrical diphenylurea) (CAS 603-54-3);\nML8.Note 1.y.  Methyl-N,N-diphenylurea (methyl unsymmetrical diphenylurea)\nML8.Note 1.y.  (CAS 13114-72-2);\nML8.Note 1.z.  Ethyl-N,N-diphenylurea (ethyl unsymmetrical diphenylurea)\nML8.Note 1.z.  (CAS 64544-71-4);\nML8.Note 1.aa.  2-Nitrodiphenylamine (2-NDPA) (CAS 119-75-5);\nML8.Note 1.bb.  4-Nitrodiphenylamine (4-NDPA) (CAS 836-30-6);\nML8.Note 1.cc.  2,2-dinitropropanol (CAS 918-52-5);\nML8.Note 1.dd.  Nitroguanidine (CAS 556-88-7) (see 1.C.11.d. on the Dual-Use List).\nML8.Note 2.  ML8. does not apply to ammonium perchlorate (ML8.d.2.), NTO (ML8.a.18.) or catocene (ML8.f.4.b.), and meeting all of the following:\nML8.Note 2.a.  Specially shaped and formulated for civil-use gas generation devices;\nML8.Note 2.b.  Compounded or mixed, with non-active thermoset binders or plasticizers, and having a mass of less than 250 g;\nML8.Note 2.c.  Having a maximum of 80% ammonium perchlorate (ML8.d.2.) in mass of active material;\nML8.Note 2.d.  Having less than or equal to 4 g of NTO (ML8.a.18.); and\nML8.Note 2.e.  Having less than or equal to 1 g of catocene (ML8.f.4.b.).\n'),
(39864,'','','','ML8.  Energetic materials and related substances, as follows:\nML8.Technical Notes.1.  For the purposes of ML8., excluding ML8.c.11. or ML8.c.12., \'mixture\' refers to a composition of two or more substances with at least one substance being listed in the ML8 sub-items.\nML8.Technical Notes.2.  Any substance listed in the ML8 sub-items is subject to this list, even when utilised in an application other than that indicated.  (e.g., TAGN is predominantly used as an explosive but can also be used either as a fuel or an oxidizer.)\nML8.Technical Notes.3.  For the purposes of ML8., particle size is the mean particle diameter on a weight or volume basis.  International or equivalent national standards will be used in sampling and determining particle size.\nML8.a.  Explosives as follows, and \'mixtures\' thereof:\nML8.a.37.  GUDN (Guanylurea dinitramide) FOX-12 (CAS 217464-38-5);\nML8.a.Note.  ML8.a. includes \'explosive co-crystals\'.\nML8.a.Note.Technical Note.  An \'explosive co-crystal\' is a solid material consisting of an ordered three dimensional arrangement of two or more explosive molecules, where at least one is specified in ML8.a.\nML8.Note 1.  ML8. does not apply to the following substances unless they are compounded or mixed with the \"energetic material\" specified by ML8.a. or powdered metals specified by ML8.c.:\nML8.Note 1.a.  Ammonium picrate (CAS 131-74-8);\nML8.Note 1.b.  Black powder;\nML8.Note 1.c.  Hexanitrodiphenylamine (CAS 131-73-7);\nML8.Note 1.d.  Difluoroamine (CAS 10405-27-3);\nML8.Note 1.e.  Nitrostarch (CAS 9056-38-6);\nML8.Note 1.f.  Potassium nitrate (CAS 7757-79-1);\nML8.Note 1.g.  Tetranitronaphthalene;\nML8.Note 1.h.  Trinitroanisol;\nML8.Note 1.i.  Trinitronaphthalene;\nML8.Note 1.j.  Trinitroxylene;\nML8.Note 1.k.  N-pyrrolidinone; 1-methyl-2-pyrrolidinone (CAS 872-50-4);\nML8.Note 1.l.  Dioctylmaleate (CAS 142-16-5);\nML8.Note 1.m.  Ethylhexylacrylate (CAS 103-11-7);\nML8.Note 1.n.  Triethylaluminium (TEA) (CAS 97-93-8), trimethylaluminium (TMA) (CAS 75-24-1), and other pyrophoric metal alkyls and aryls of lithium, sodium, magnesium, zinc or boron;\nML8.Note 1.o.  Nitrocellulose (CAS 9004-70-0);\nML8.Note 1.p.  Nitroglycerin (or glyceroltrinitrate, trinitroglycerine) (NG) (CAS 55-63-0);\nML8.Note 1.q.  2,4,6-trinitrotoluene (TNT) (CAS 118-96-7);\nML8.Note 1.r.  Ethylenediaminedinitrate (EDDN) (CAS 20829-66-7);\nML8.Note 1.s.  Pentaerythritoltetranitrate (PETN) (CAS 78-11-5);\nML8.Note 1.t.  Lead azide (CAS 13424-46-9), normal lead styphnate (CAS 15245-44-0) and basic lead styphnate (CAS 12403-82-6), and primary explosives or priming compositions containing azides or azide complexes;\nML8.Note 1.u.  Triethyleneglycoldinitrate (TEGDN) (CAS 111-22-8);\nML8.Note 1.v.  2,4,6-trinitroresorcinol (styphnic acid) (CAS 82-71-3);\nML8.Note 1.w.  Diethyldiphenylurea; (CAS 85-98-3); dimethyldiphenylurea;\nML8.Note 1.w.  (CAS 611-92-7), methylethyldiphenylurea; [Centralites]\nML8.Note 1.x.  N,N-diphenylurea (unsymmetrical diphenylurea) (CAS 603-54-3);\nML8.Note 1.y.  Methyl-N,N-diphenylurea (methyl unsymmetrical diphenylurea)\nML8.Note 1.y.  (CAS 13114-72-2);\nML8.Note 1.z.  Ethyl-N,N-diphenylurea (ethyl unsymmetrical diphenylurea)\nML8.Note 1.z.  (CAS 64544-71-4);\nML8.Note 1.aa.  2-Nitrodiphenylamine (2-NDPA) (CAS 119-75-5);\nML8.Note 1.bb.  4-Nitrodiphenylamine (4-NDPA) (CAS 836-30-6);\nML8.Note 1.cc.  2,2-dinitropropanol (CAS 918-52-5);\nML8.Note 1.dd.  Nitroguanidine (CAS 556-88-7) (see 1.C.11.d. on the Dual-Use List).\nML8.Note 2.  ML8. does not apply to ammonium perchlorate (ML8.d.2.), NTO (ML8.a.18.) or catocene (ML8.f.4.b.), and meeting all of the following:\nML8.Note 2.a.  Specially shaped and formulated for civil-use gas generation devices;\nML8.Note 2.b.  Compounded or mixed, with non-active thermoset binders or plasticizers, and having a mass of less than 250 g;\nML8.Note 2.c.  Having a maximum of 80% ammonium perchlorate (ML8.d.2.) in mass of active material;\nML8.Note 2.d.  Having less than or equal to 4 g of NTO (ML8.a.18.); and\nML8.Note 2.e.  Having less than or equal to 1 g of catocene (ML8.f.4.b.).\n'),
(39865,'','','','ML1.  Smooth-bore weapons with a calibre of less than 20 mm, other arms and automatic weapons with a calibre of 12.7 mm (calibre 0.50 inches) or less and accessories, as follows, and specially designed components therefor:\nML1.Note  ML1. does not apply to:\nML1.Note.a.  Firearms specially designed for dummy ammunition and which are incapable of discharging a projectile;\nML1.Note.b.  Firearms specially designed to launch tethered projectiles having no high explosive charge or communications link, to a range of less than or equal to 500 m.;\nML1.Note.c.  Weapons using non-centre fire cased ammunition and which are not of the fully automatic firing type;\nML1.Note.d.  Deactivated firearms.\nML1.a.  Rifles and combination guns, handguns, machine, sub-machine and volley guns;\nML1.a.Note  ML1.a. does not apply to the following:\nML1.a.Note.a.  Rifles and combination guns, manufactured earlier than 1938;\nML1.a.Note.b.  Reproductions of rifles and combination guns, the originals of which were manufactured earlier than 1890;\nML1.a.Note.c.  Handguns, volley guns and machine guns, manufactured earlier than 1890, and their reproductions;\nML1.a.Note.d.  Rifles or handguns, specially designed to discharge an inert projectile by compressed air or CO2.\nML1.b.  Smooth-bore weapons as follows:\nML1.b.1.  Smooth-bore weapons specially designed for military use;\nML1.b.2.  Other smooth-bore weapons as follows:\nML1.b.2.a.  Fully automatic type weapons;\nML1.b.2.b.  Semi-automatic or pump-action type weapons;\nML1.b.2.Note  ML1.b.2. does not apply to weapons specially designed to discharge an inert projectile by compressed air or CO2.\nML1.b.Note  ML1.b. does not apply to the following:\nML1.b.Note.a.  Smooth-bore weapons manufactured earlier than 1938;\nML1.b.Note.b.  Reproductions of smooth-bore weapons, the originals of which were manufactured earlier than 1890.\nML1.b.Note.c.  Smooth-bore weapons used for hunting or sporting purposes. These weapons must not be specially designed for military use or of the fully automatic firing type;\nML1.b.Note.d.  Smooth-bore weapons specially designed for any of the following:\nML1.b.Note.d.1.  Slaughtering of domestic animals;\nML1.b.Note.d.2.  Tranquilizing of animals;\nML1.b.Note.d.3.  Seismic testing;\nML1.b.Note.d.4.  Firing of industrial projectiles; or\nML1.b.Note.d.5.  Disrupting Improvised Explosive Devices (IEDs).\nML1.b.Note.d.5.N.B.  For disruptors, see ML4. and 1.A.6. on the Dual-Use List.\nML1.c.  Weapons using caseless ammunition;\nML1.d.  Accessories designed for arms specified by ML1.a., ML1.b. or ML1.c., as follows:\nML1.d.1.  Detachable cartridge magazines;\nML1.d.2.  Sound suppressors or moderators;\nML1.d.3.  Special gun-mountings;\nML1.d.4.  Flash suppressors;\nML1.d.5.  Optical weapon-sights with electronic image processing;\nML1.d.6.  Optical weapon-sights specially designed for military use.\n'),
(39866,'','','','ML8.  Energetic materials and related substances, as follows:\nML8.Technical Notes.1.  For the purposes of ML8., excluding ML8.c.11. or ML8.c.12., \'mixture\' refers to a composition of two or more substances with at least one substance being listed in the ML8 sub-items.\nML8.Technical Notes.2.  Any substance listed in the ML8 sub-items is subject to this list, even when utilised in an application other than that indicated.  (e.g., TAGN is predominantly used as an explosive but can also be used either as a fuel or an oxidizer.)\nML8.Technical Notes.3.  For the purposes of ML8., particle size is the mean particle diameter on a weight or volume basis.  International or equivalent national standards will be used in sampling and determining particle size.\nML8.Note 1.  ML8. does not apply to the following substances unless they are compounded or mixed with the \"energetic material\" specified by ML8.a. or powdered metals specified by ML8.c.:\nML8.Note 1.a.  Ammonium picrate (CAS 131-74-8);\nML8.Note 1.b.  Black powder;\nML8.Note 1.c.  Hexanitrodiphenylamine (CAS 131-73-7);\nML8.Note 1.d.  Difluoroamine (CAS 10405-27-3);\nML8.Note 1.e.  Nitrostarch (CAS 9056-38-6);\nML8.Note 1.f.  Potassium nitrate (CAS 7757-79-1);\nML8.Note 1.g.  Tetranitronaphthalene;\nML8.Note 1.h.  Trinitroanisol;\nML8.Note 1.i.  Trinitronaphthalene;\nML8.Note 1.j.  Trinitroxylene;\nML8.Note 1.k.  N-pyrrolidinone; 1-methyl-2-pyrrolidinone (CAS 872-50-4);\nML8.Note 1.l.  Dioctylmaleate (CAS 142-16-5);\nML8.Note 1.m.  Ethylhexylacrylate (CAS 103-11-7);\nML8.Note 1.n.  Triethylaluminium (TEA) (CAS 97-93-8), trimethylaluminium (TMA) (CAS 75-24-1), and other pyrophoric metal alkyls and aryls of lithium, sodium, magnesium, zinc or boron;\nML8.Note 1.o.  Nitrocellulose (CAS 9004-70-0);\nML8.Note 1.p.  Nitroglycerin (or glyceroltrinitrate, trinitroglycerine) (NG) (CAS 55-63-0);\nML8.Note 1.q.  2,4,6-trinitrotoluene (TNT) (CAS 118-96-7);\nML8.Note 1.r.  Ethylenediaminedinitrate (EDDN) (CAS 20829-66-7);\nML8.Note 1.s.  Pentaerythritoltetranitrate (PETN) (CAS 78-11-5);\nML8.Note 1.t.  Lead azide (CAS 13424-46-9), normal lead styphnate (CAS 15245-44-0) and basic lead styphnate (CAS 12403-82-6), and primary explosives or priming compositions containing azides or azide complexes;\nML8.Note 1.u.  Triethyleneglycoldinitrate (TEGDN) (CAS 111-22-8);\nML8.Note 1.v.  2,4,6-trinitroresorcinol (styphnic acid) (CAS 82-71-3);\nML8.Note 1.w.  Diethyldiphenylurea; (CAS 85-98-3); dimethyldiphenylurea;\nML8.Note 1.w.  (CAS 611-92-7), methylethyldiphenylurea; [Centralites]\nML8.Note 1.x.  N,N-diphenylurea (unsymmetrical diphenylurea) (CAS 603-54-3);\nML8.Note 1.y.  Methyl-N,N-diphenylurea (methyl unsymmetrical diphenylurea)\nML8.Note 1.y.  (CAS 13114-72-2);\nML8.Note 1.z.  Ethyl-N,N-diphenylurea (ethyl unsymmetrical diphenylurea)\nML8.Note 1.z.  (CAS 64544-71-4);\nML8.Note 1.aa.  2-Nitrodiphenylamine (2-NDPA) (CAS 119-75-5);\nML8.Note 1.bb.  4-Nitrodiphenylamine (4-NDPA) (CAS 836-30-6);\nML8.Note 1.cc.  2,2-dinitropropanol (CAS 918-52-5);\nML8.Note 1.dd.  Nitroguanidine (CAS 556-88-7) (see 1.C.11.d. on the Dual-Use List).\nML8.Note 2.  ML8. does not apply to ammonium perchlorate (ML8.d.2.), NTO (ML8.a.18.) or catocene (ML8.f.4.b.), and meeting all of the following:\nML8.Note 2.a.  Specially shaped and formulated for civil-use gas generation devices;\nML8.Note 2.b.  Compounded or mixed, with non-active thermoset binders or plasticizers, and having a mass of less than 250 g;\nML8.Note 2.c.  Having a maximum of 80% ammonium perchlorate (ML8.d.2.) in mass of active material;\nML8.Note 2.d.  Having less than or equal to 4 g of NTO (ML8.a.18.); and\nML8.Note 2.e.  Having less than or equal to 1 g of catocene (ML8.f.4.b.).\n'),
(39867,'','','','ML9.  Vessels of war (surface or underwater), special naval equipment, accessories, components and other surface vessels, as follows:\nML9.a.  Vessels and components, as follows:\nML9.a.1.  Vessels (surface or underwater) specially designed or modified for military use, regardless of current state of repair or operating condition, and whether or not they contain weapon delivery systems or armour, and hulls or parts of hulls for such vessels, and components therefor specially designed for military use;\nML9.a.1.Note.  ML9.a.1. includes vehicles specially designed or modified for the delivery of divers.\n'),
(39868,'','','','ML10.  Aircraft, \"lighter-than-air vehicles\", \"Unmanned Aerial Vehicles\" (\"UAVs\"), aero-engines and \"aircraft\" equipment, related equipment, and components, as follows, specially designed or modified for military use:\nML10.d.  Propulsion aero-engines and specially designed components therefor;\nML10.d.Note 2.  ML10.d. does not apply to:\nML10.d.Note 2.a.  Aero-engines designed or modified for military use which have been certified by civil aviation authorities of one or more Wassenaar Arrangement Participating States for use in \"civil aircraft\", or specially designed components therefor;\nML10.d.Note 2.b.  Reciprocating engines or specially designed components therefor, except those specially designed for \"UAVs\".\nML10.Note 3.  For the purposes of ML10.a. and ML10.d., specially designed components and related equipment for non-military \"aircraft\" or aero-engines modified for military use applies only to those military components and to military related equipment required for the modification to military use.\nML10.d.Note 6.  ML10.d. does not apply to propulsion aero-engines that were first manufactured before 1946.\n'),
(39869,'','','','ML3.  Ammunition and fuze setting devices, as follows, and specially designed components therefor:\nML3.a.  Ammunition for weapons specified by ML1., ML2. or ML12.;\nML3.Note 1.  Specially designed components specified by ML3. include:\nML3.Note 1.a.  Metal or plastic fabrications such as primer anvils, bullet cups, cartridge links, rotating bands and munitions metal parts;\nML3.Note 1.b.  Safing and arming devices, fuzes, sensors and initiation devices ;\nML3.Note 1.c.  Power supplies with high one-time operational output;\nML3.Note 1.d.  Combustible cases for charges;\nML3.Note 1.e.  Submunitions including bomblets, minelets and terminally guided projectiles.\nML3.a.Note 2.  ML3.a. does not apply to any of the following:\nML3.a.Note 2.a.  Ammunition crimped without a projectile (blank star);\nML3.a.Note 2.b.  Dummy ammunition with a pierced powder chamber;\nML3.a.Note 2.c.  Other blank and dummy ammunition, not incorporating components designed for live ammunition; or\nML3.a.Note 2.d.  Components specially designed for blank or dummy ammunition, specified in this Note 2.a., b. or c.\nML3.a.Note 3.  ML3.a. does not apply to cartridges specially designed for any of the following purposes:\nML3.a.Note 3.a.  Signalling;\nML3.a.Note 3.b.  Bird scaring; or\nML3.a.Note 3.c.  Lighting of gas flares at oil wells.\n'),
(39870,'','','','ML22.  Technology as follows:\nML22.b.  Technology as follows:\nML22.b.2.  Technology \"required\" for the \"development\" and \"production\" of small arms, even if used to produce reproductions of antique small arms;\nML22.Note 1.  Technology \"required\" for the \"development\", \"production\", operation, installation, maintenance (checking), repair, overhaul or refurbishing of items specified by the Munitions List remains under control even when applicable to any item not specified by the Munitions List.\nML22.Note 2.  ML22 does not apply to:\nML22.Note 2.a.  Technology that is the minimum necessary for the installation, operation, maintenance (checking) or repair, of those items which are not controlled or whose export has been authorised;\nML22.Note 2.b.  Technology that is \"in the public domain\", \"basic scientific research\" or the minimum necessary information for patent applications;\nML22.Note 2.c.  Technology for magnetic induction for continuous propulsion of civil transport devices.\n'),
(39871,'','','','ML8.  Energetic materials and related substances, as follows:\nML8.Technical Notes.1.  For the purposes of ML8., excluding ML8.c.11. or ML8.c.12., \'mixture\' refers to a composition of two or more substances with at least one substance being listed in the ML8 sub-items.\nML8.Technical Notes.2.  Any substance listed in the ML8 sub-items is subject to this list, even when utilised in an application other than that indicated.  (e.g., TAGN is predominantly used as an explosive but can also be used either as a fuel or an oxidizer.)\nML8.Technical Notes.3.  For the purposes of ML8., particle size is the mean particle diameter on a weight or volume basis.  International or equivalent national standards will be used in sampling and determining particle size.\nML8.g.  Precursors as follows:\nML8.g.4.  Not used since 2013\nML8.Note 1.  ML8. does not apply to the following substances unless they are compounded or mixed with the \"energetic material\" specified by ML8.a. or powdered metals specified by ML8.c.:\nML8.Note 1.a.  Ammonium picrate (CAS 131-74-8);\nML8.Note 1.b.  Black powder;\nML8.Note 1.c.  Hexanitrodiphenylamine (CAS 131-73-7);\nML8.Note 1.d.  Difluoroamine (CAS 10405-27-3);\nML8.Note 1.e.  Nitrostarch (CAS 9056-38-6);\nML8.Note 1.f.  Potassium nitrate (CAS 7757-79-1);\nML8.Note 1.g.  Tetranitronaphthalene;\nML8.Note 1.h.  Trinitroanisol;\nML8.Note 1.i.  Trinitronaphthalene;\nML8.Note 1.j.  Trinitroxylene;\nML8.Note 1.k.  N-pyrrolidinone; 1-methyl-2-pyrrolidinone (CAS 872-50-4);\nML8.Note 1.l.  Dioctylmaleate (CAS 142-16-5);\nML8.Note 1.m.  Ethylhexylacrylate (CAS 103-11-7);\nML8.Note 1.n.  Triethylaluminium (TEA) (CAS 97-93-8), trimethylaluminium (TMA) (CAS 75-24-1), and other pyrophoric metal alkyls and aryls of lithium, sodium, magnesium, zinc or boron;\nML8.Note 1.o.  Nitrocellulose (CAS 9004-70-0);\nML8.Note 1.p.  Nitroglycerin (or glyceroltrinitrate, trinitroglycerine) (NG) (CAS 55-63-0);\nML8.Note 1.q.  2,4,6-trinitrotoluene (TNT) (CAS 118-96-7);\nML8.Note 1.r.  Ethylenediaminedinitrate (EDDN) (CAS 20829-66-7);\nML8.Note 1.s.  Pentaerythritoltetranitrate (PETN) (CAS 78-11-5);\nML8.Note 1.t.  Lead azide (CAS 13424-46-9), normal lead styphnate (CAS 15245-44-0) and basic lead styphnate (CAS 12403-82-6), and primary explosives or priming compositions containing azides or azide complexes;\nML8.Note 1.u.  Triethyleneglycoldinitrate (TEGDN) (CAS 111-22-8);\nML8.Note 1.v.  2,4,6-trinitroresorcinol (styphnic acid) (CAS 82-71-3);\nML8.Note 1.w.  Diethyldiphenylurea; (CAS 85-98-3); dimethyldiphenylurea;\nML8.Note 1.w.  (CAS 611-92-7), methylethyldiphenylurea; [Centralites]\nML8.Note 1.x.  N,N-diphenylurea (unsymmetrical diphenylurea) (CAS 603-54-3);\nML8.Note 1.y.  Methyl-N,N-diphenylurea (methyl unsymmetrical diphenylurea)\nML8.Note 1.y.  (CAS 13114-72-2);\nML8.Note 1.z.  Ethyl-N,N-diphenylurea (ethyl unsymmetrical diphenylurea)\nML8.Note 1.z.  (CAS 64544-71-4);\nML8.Note 1.aa.  2-Nitrodiphenylamine (2-NDPA) (CAS 119-75-5);\nML8.Note 1.bb.  4-Nitrodiphenylamine (4-NDPA) (CAS 836-30-6);\nML8.Note 1.cc.  2,2-dinitropropanol (CAS 918-52-5);\nML8.Note 1.dd.  Nitroguanidine (CAS 556-88-7) (see 1.C.11.d. on the Dual-Use List).\nML8.Note 2.  ML8. does not apply to ammonium perchlorate (ML8.d.2.), NTO (ML8.a.18.) or catocene (ML8.f.4.b.), and meeting all of the following:\nML8.Note 2.a.  Specially shaped and formulated for civil-use gas generation devices;\nML8.Note 2.b.  Compounded or mixed, with non-active thermoset binders or plasticizers, and having a mass of less than 250 g;\nML8.Note 2.c.  Having a maximum of 80% ammonium perchlorate (ML8.d.2.) in mass of active material;\nML8.Note 2.d.  Having less than or equal to 4 g of NTO (ML8.a.18.); and\nML8.Note 2.e.  Having less than or equal to 1 g of catocene (ML8.f.4.b.).\n'),
(39872,'','','','ML17.  Miscellaneous equipment, materials and \"libraries\", as follows, and specially designed components therefor:\nML17.g.  Nuclear power generating equipment or propulsion equipment, not specified elsewhere, specially designed for military use and components therefor specially designed or \'modified\' for military use;\nML17.g.Note.  ML17.g. includes \"nuclear reactors\".\nML17.Technical Note.1.  Not used since 2014\nML17.Technical Note.2.  For the purpose of ML17, \'modified\' means any structural, electrical, mechanical, or other change that provides a non-military item with military capabilities equivalent to an item which is specially designed for military use.\n'),
(39873,'','','','ML8.  Energetic materials and related substances, as follows:\nML8.Technical Notes.1.  For the purposes of ML8., excluding ML8.c.11. or ML8.c.12., \'mixture\' refers to a composition of two or more substances with at least one substance being listed in the ML8 sub-items.\nML8.Technical Notes.2.  Any substance listed in the ML8 sub-items is subject to this list, even when utilised in an application other than that indicated.  (e.g., TAGN is predominantly used as an explosive but can also be used either as a fuel or an oxidizer.)\nML8.Technical Notes.3.  For the purposes of ML8., particle size is the mean particle diameter on a weight or volume basis.  International or equivalent national standards will be used in sampling and determining particle size.\nML8.a.  Explosives as follows, and \'mixtures\' thereof:\nML8.a.36.  TEX (4,10-Dinitro-2,6,8,12-tetraoxa-4,10-diazaisowurtzitane);\nML8.a.Note.  ML8.a. includes \'explosive co-crystals\'.\nML8.a.Note.Technical Note.  An \'explosive co-crystal\' is a solid material consisting of an ordered three dimensional arrangement of two or more explosive molecules, where at least one is specified in ML8.a.\nML8.Note 1.  ML8. does not apply to the following substances unless they are compounded or mixed with the \"energetic material\" specified by ML8.a. or powdered metals specified by ML8.c.:\nML8.Note 1.a.  Ammonium picrate (CAS 131-74-8);\nML8.Note 1.b.  Black powder;\nML8.Note 1.c.  Hexanitrodiphenylamine (CAS 131-73-7);\nML8.Note 1.d.  Difluoroamine (CAS 10405-27-3);\nML8.Note 1.e.  Nitrostarch (CAS 9056-38-6);\nML8.Note 1.f.  Potassium nitrate (CAS 7757-79-1);\nML8.Note 1.g.  Tetranitronaphthalene;\nML8.Note 1.h.  Trinitroanisol;\nML8.Note 1.i.  Trinitronaphthalene;\nML8.Note 1.j.  Trinitroxylene;\nML8.Note 1.k.  N-pyrrolidinone; 1-methyl-2-pyrrolidinone (CAS 872-50-4);\nML8.Note 1.l.  Dioctylmaleate (CAS 142-16-5);\nML8.Note 1.m.  Ethylhexylacrylate (CAS 103-11-7);\nML8.Note 1.n.  Triethylaluminium (TEA) (CAS 97-93-8), trimethylaluminium (TMA) (CAS 75-24-1), and other pyrophoric metal alkyls and aryls of lithium, sodium, magnesium, zinc or boron;\nML8.Note 1.o.  Nitrocellulose (CAS 9004-70-0);\nML8.Note 1.p.  Nitroglycerin (or glyceroltrinitrate, trinitroglycerine) (NG) (CAS 55-63-0);\nML8.Note 1.q.  2,4,6-trinitrotoluene (TNT) (CAS 118-96-7);\nML8.Note 1.r.  Ethylenediaminedinitrate (EDDN) (CAS 20829-66-7);\nML8.Note 1.s.  Pentaerythritoltetranitrate (PETN) (CAS 78-11-5);\nML8.Note 1.t.  Lead azide (CAS 13424-46-9), normal lead styphnate (CAS 15245-44-0) and basic lead styphnate (CAS 12403-82-6), and primary explosives or priming compositions containing azides or azide complexes;\nML8.Note 1.u.  Triethyleneglycoldinitrate (TEGDN) (CAS 111-22-8);\nML8.Note 1.v.  2,4,6-trinitroresorcinol (styphnic acid) (CAS 82-71-3);\nML8.Note 1.w.  Diethyldiphenylurea; (CAS 85-98-3); dimethyldiphenylurea;\nML8.Note 1.w.  (CAS 611-92-7), methylethyldiphenylurea; [Centralites]\nML8.Note 1.x.  N,N-diphenylurea (unsymmetrical diphenylurea) (CAS 603-54-3);\nML8.Note 1.y.  Methyl-N,N-diphenylurea (methyl unsymmetrical diphenylurea)\nML8.Note 1.y.  (CAS 13114-72-2);\nML8.Note 1.z.  Ethyl-N,N-diphenylurea (ethyl unsymmetrical diphenylurea)\nML8.Note 1.z.  (CAS 64544-71-4);\nML8.Note 1.aa.  2-Nitrodiphenylamine (2-NDPA) (CAS 119-75-5);\nML8.Note 1.bb.  4-Nitrodiphenylamine (4-NDPA) (CAS 836-30-6);\nML8.Note 1.cc.  2,2-dinitropropanol (CAS 918-52-5);\nML8.Note 1.dd.  Nitroguanidine (CAS 556-88-7) (see 1.C.11.d. on the Dual-Use List).\nML8.Note 2.  ML8. does not apply to ammonium perchlorate (ML8.d.2.), NTO (ML8.a.18.) or catocene (ML8.f.4.b.), and meeting all of the following:\nML8.Note 2.a.  Specially shaped and formulated for civil-use gas generation devices;\nML8.Note 2.b.  Compounded or mixed, with non-active thermoset binders or plasticizers, and having a mass of less than 250 g;\nML8.Note 2.c.  Having a maximum of 80% ammonium perchlorate (ML8.d.2.) in mass of active material;\nML8.Note 2.d.  Having less than or equal to 4 g of NTO (ML8.a.18.); and\nML8.Note 2.e.  Having less than or equal to 1 g of catocene (ML8.f.4.b.).\n'),
(39874,'','','','ML1.  Smooth-bore weapons with a calibre of less than 20 mm, other arms and automatic weapons with a calibre of 12.7 mm (calibre 0.50 inches) or less and accessories, as follows, and specially designed components therefor:\nML1.Note  ML1. does not apply to:\nML1.Note.a.  Firearms specially designed for dummy ammunition and which are incapable of discharging a projectile;\nML1.Note.b.  Firearms specially designed to launch tethered projectiles having no high explosive charge or communications link, to a range of less than or equal to 500 m.;\nML1.Note.c.  Weapons using non-centre fire cased ammunition and which are not of the fully automatic firing type;\nML1.Note.d.  Deactivated firearms.\nML1.d.  Accessories designed for arms specified by ML1.a., ML1.b. or ML1.c., as follows:\nML1.d.3.  Special gun-mountings;\n'),
(39875,'','','','ML12.  High velocity kinetic energy weapon systems and related equipment, as follows, and specially designed components therefor:\nML12.Note 1.  ML12. includes the following when specially designed for kinetic energy weapon systems:\nML12.Note 1.a.  Launch propulsion systems capable of accelerating masses larger than 0.1 g to velocities in excess of 1.6 km/s, in single or rapid fire modes;\nML12.Note 1.b.  Prime power generation, electric armour, energy storage (e.g., high energy storage capacitors), thermal management, conditioning, switching or fuel-handling equipment; and electrical interfaces between power supply, gun and other turret electric drive functions;\nML12.Note 1.b.N.B.  See also 3.A.1.e.2. on the Dual-Use List for high energy storage capacitors.\nML12.Note 1.c.  Target acquisition, tracking, fire control or damage assessment systems;\nML12.Note 1.d.  Homing seeker, guidance or divert propulsion (lateral acceleration) systems for projectiles.\nML12.Note 2.  ML12. applies to weapon systems using any of the following methods of propulsion:\nML12.Note 2.a.  Electromagnetic;\nML12.Note 2.b.  Electrothermal;\nML12.Note 2.c.  Plasma;\nML12.Note 2.d.  Light gas; or\nML12.Note 2.e.  Chemical (when used in combination with any of the above).\n'),
(39876,'','','','ML7.  Chemical agents, \"biological agents\", \"riot control agents\", radioactive materials, related equipment, components and materials, as follows:\nML7.a.  Biological agents or radioactive materials selected or modified to increase their effectiveness in producing casualties in humans or animals, degrading equipment or damaging crops or the environment;\nML7.Note 1.  ML7.b. and ML7.d. do not apply to the following:\nML7.Note 1.a.  Cyanogen chloride (CAS 506-77-4);\nML7.Note 1.b.  Hydrocyanic acid (CAS 74-90-8);\nML7.Note 1.c.  Chlorine (CAS 7782-50-5);\nML7.Note 1.d.  Carbonyl chloride (phosgene) (CAS 75-44-5);\nML7.Note 1.e.  Diphosgene (trichloromethyl-chloroformate) (CAS 503-38-8);\nML7.Note 1.f.  Not used since 2004\nML7.Note 1.g.  Xylyl bromide, ortho: (CAS 89-92-9), meta: (CAS 620-13-3), para: (CAS 104-81-4);\nML7.Note 1.h.  Benzyl bromide (CAS 100-39-0);\nML7.Note 1.i.  Benzyl iodide (CAS 620-05-3);\nML7.Note 1.j.  Bromo acetone (CAS 598-31-2);\nML7.Note 1.k.  Cyanogen bromide (CAS 506-68-3);\nML7.Note 1.l.  Bromo methylethylketone (CAS 816-40-0);\nML7.Note 1.m.  Chloro acetone (CAS 78-95-5);\nML7.Note 1.n.  Ethyl iodoacetate (CAS 623-48-3);\nML7.Note 1.o.  Iodo acetone (CAS 3019-04-3);\nML7.Note 1.p.  Chloropicrin (CAS 76-06-2).\nML7.Note 2  The cultures of cells and biological systems specified by ML7.h. and ML7.i.2. are exclusive and these sub-items do not apply to cells or biological systems for civil purposes, such as agricultural, pharmaceutical, medical, veterinary, environmental, waste management, or in the food industry.\n'),
(39877,'','','','ML7.  Chemical agents, \"biological agents\", \"riot control agents\", radioactive materials, related equipment, components and materials, as follows:\nML7.b.  Chemical warfare (CW) agents, including:\nML7.b.4.  CW defoliants, such as:\nML7.b.4.b.  2,4,5-trichlorophenoxyacetic acid (CAS 93-76-5) mixed with \nML7.b.4.b.  2,4-dichlorophenoxyacetic acid (CAS 94-75-7) \nML7.b.4.b.  (Agent Orange (CAS 39277-47-9));\nML7.Note 1.  ML7.b. and ML7.d. do not apply to the following:\nML7.Note 1.a.  Cyanogen chloride (CAS 506-77-4);\nML7.Note 1.b.  Hydrocyanic acid (CAS 74-90-8);\nML7.Note 1.c.  Chlorine (CAS 7782-50-5);\nML7.Note 1.d.  Carbonyl chloride (phosgene) (CAS 75-44-5);\nML7.Note 1.e.  Diphosgene (trichloromethyl-chloroformate) (CAS 503-38-8);\nML7.Note 1.f.  Not used since 2004\nML7.Note 1.g.  Xylyl bromide, ortho: (CAS 89-92-9), meta: (CAS 620-13-3), para: (CAS 104-81-4);\nML7.Note 1.h.  Benzyl bromide (CAS 100-39-0);\nML7.Note 1.i.  Benzyl iodide (CAS 620-05-3);\nML7.Note 1.j.  Bromo acetone (CAS 598-31-2);\nML7.Note 1.k.  Cyanogen bromide (CAS 506-68-3);\nML7.Note 1.l.  Bromo methylethylketone (CAS 816-40-0);\nML7.Note 1.m.  Chloro acetone (CAS 78-95-5);\nML7.Note 1.n.  Ethyl iodoacetate (CAS 623-48-3);\nML7.Note 1.o.  Iodo acetone (CAS 3019-04-3);\nML7.Note 1.p.  Chloropicrin (CAS 76-06-2).\nML7.Note 2  The cultures of cells and biological systems specified by ML7.h. and ML7.i.2. are exclusive and these sub-items do not apply to cells or biological systems for civil purposes, such as agricultural, pharmaceutical, medical, veterinary, environmental, waste management, or in the food industry.\n'),
(39878,'','','','ML15.  Imaging or countermeasure equipment, as follows, specially designed for military use, and specially designed components and accessories therefor:\nML15.b.  Cameras, photographic equipment and film processing equipment;\n'),
(39879,'','','','ML2.  Smooth-bore weapons with a calibre of 20 mm or more, other weapons or armament with a calibre greater than 12.7 mm (calibre 0.50 inches), projectors and accessories, as follows, and specially designed components therefor:\nML2.a.  Guns, howitzers, cannon, mortars, anti-tank weapons, projectile launchers, military flame throwers, rifles, recoilless rifles, smooth-bore weapons and signature reduction devices therefor;\nML2.a.Note 1  ML2.a. includes injectors, metering devices, storage tanks and other specially designed components for use with liquid propelling charges for any of the equipment specified by ML2.a.\nML2.a.Note 2  ML2.a. does not apply to weapons as follows:\nML2.a.Note 2.a.  Rifles, smooth-bore weapons and combination guns, manufactured earlier than 1938;\nML2.a.Note 2.b.  Reproductions of rifles, smooth-bore weapons and combination guns, the originals of which were manufactured earlier than 1890;\nML2.a.Note 2.c.  Guns, howitzers, cannons, mortars, manufactured earlier than 1890;\nML2.a.Note 2.d.  Smooth-bore weapons used for hunting or sporting purposes.  These weapons must not be specially designed for military use or of the fully automatic firing type;\nML2.a.Note 2.e.  Smooth-bore weapons specially designed for any of the following:\nML2.a.Note 2.e.1.  Slaughtering of domestic animals;\nML2.a.Note 2.e.2.  Tranquilizing of animals;\nML2.a.Note 2.e.3.  Seismic testing;\nML2.a.Note 2.e.4.  Firing of industrial projectiles; or\nML2.a.Note 2.e.5.  Disrupting Improvised Explosive Devices (IEDs);\nML2.a.Note 2.e.5.N.B.  For disruptors, see ML4. and 1.A.6. on the Dual-Use List.\nML2.a.Note 2.f.  Hand-held projectile  launchers specially designed to launch tethered projectiles having no high explosive charge or communications link, to a range of less than or equal to 500 m.\nML2.Note  ML2.b. does not apply to signal pistols.\n'),
(39880,'','','','ML8.  Energetic materials and related substances, as follows:\nML8.Technical Notes.1.  For the purposes of ML8., excluding ML8.c.11. or ML8.c.12., \'mixture\' refers to a composition of two or more substances with at least one substance being listed in the ML8 sub-items.\nML8.Technical Notes.2.  Any substance listed in the ML8 sub-items is subject to this list, even when utilised in an application other than that indicated.  (e.g., TAGN is predominantly used as an explosive but can also be used either as a fuel or an oxidizer.)\nML8.Technical Notes.3.  For the purposes of ML8., particle size is the mean particle diameter on a weight or volume basis.  International or equivalent national standards will be used in sampling and determining particle size.\nML8.a.  Explosives as follows, and \'mixtures\' thereof:\nML8.a.13.  HMX and derivatives (see also ML8.g.5. for its \"precursors\"), as follows:\nML8.a.13.c.  K-55 (2,4,6,8-tetranitro-2,4,6,8-tetraazabicyclo [3,3,0]-octanone-3, tetranitrosemiglycouril or keto-bicyclic HMX) (CAS 130256-72-3);\nML8.a.Note.  ML8.a. includes \'explosive co-crystals\'.\nML8.a.Note.Technical Note.  An \'explosive co-crystal\' is a solid material consisting of an ordered three dimensional arrangement of two or more explosive molecules, where at least one is specified in ML8.a.\nML8.Note 1.  ML8. does not apply to the following substances unless they are compounded or mixed with the \"energetic material\" specified by ML8.a. or powdered metals specified by ML8.c.:\nML8.Note 1.a.  Ammonium picrate (CAS 131-74-8);\nML8.Note 1.b.  Black powder;\nML8.Note 1.c.  Hexanitrodiphenylamine (CAS 131-73-7);\nML8.Note 1.d.  Difluoroamine (CAS 10405-27-3);\nML8.Note 1.e.  Nitrostarch (CAS 9056-38-6);\nML8.Note 1.f.  Potassium nitrate (CAS 7757-79-1);\nML8.Note 1.g.  Tetranitronaphthalene;\nML8.Note 1.h.  Trinitroanisol;\nML8.Note 1.i.  Trinitronaphthalene;\nML8.Note 1.j.  Trinitroxylene;\nML8.Note 1.k.  N-pyrrolidinone; 1-methyl-2-pyrrolidinone (CAS 872-50-4);\nML8.Note 1.l.  Dioctylmaleate (CAS 142-16-5);\nML8.Note 1.m.  Ethylhexylacrylate (CAS 103-11-7);\nML8.Note 1.n.  Triethylaluminium (TEA) (CAS 97-93-8), trimethylaluminium (TMA) (CAS 75-24-1), and other pyrophoric metal alkyls and aryls of lithium, sodium, magnesium, zinc or boron;\nML8.Note 1.o.  Nitrocellulose (CAS 9004-70-0);\nML8.Note 1.p.  Nitroglycerin (or glyceroltrinitrate, trinitroglycerine) (NG) (CAS 55-63-0);\nML8.Note 1.q.  2,4,6-trinitrotoluene (TNT) (CAS 118-96-7);\nML8.Note 1.r.  Ethylenediaminedinitrate (EDDN) (CAS 20829-66-7);\nML8.Note 1.s.  Pentaerythritoltetranitrate (PETN) (CAS 78-11-5);\nML8.Note 1.t.  Lead azide (CAS 13424-46-9), normal lead styphnate (CAS 15245-44-0) and basic lead styphnate (CAS 12403-82-6), and primary explosives or priming compositions containing azides or azide complexes;\nML8.Note 1.u.  Triethyleneglycoldinitrate (TEGDN) (CAS 111-22-8);\nML8.Note 1.v.  2,4,6-trinitroresorcinol (styphnic acid) (CAS 82-71-3);\nML8.Note 1.w.  Diethyldiphenylurea; (CAS 85-98-3); dimethyldiphenylurea;\nML8.Note 1.w.  (CAS 611-92-7), methylethyldiphenylurea; [Centralites]\nML8.Note 1.x.  N,N-diphenylurea (unsymmetrical diphenylurea) (CAS 603-54-3);\nML8.Note 1.y.  Methyl-N,N-diphenylurea (methyl unsymmetrical diphenylurea)\nML8.Note 1.y.  (CAS 13114-72-2);\nML8.Note 1.z.  Ethyl-N,N-diphenylurea (ethyl unsymmetrical diphenylurea)\nML8.Note 1.z.  (CAS 64544-71-4);\nML8.Note 1.aa.  2-Nitrodiphenylamine (2-NDPA) (CAS 119-75-5);\nML8.Note 1.bb.  4-Nitrodiphenylamine (4-NDPA) (CAS 836-30-6);\nML8.Note 1.cc.  2,2-dinitropropanol (CAS 918-52-5);\nML8.Note 1.dd.  Nitroguanidine (CAS 556-88-7) (see 1.C.11.d. on the Dual-Use List).\nML8.Note 2.  ML8. does not apply to ammonium perchlorate (ML8.d.2.), NTO (ML8.a.18.) or catocene (ML8.f.4.b.), and meeting all of the following:\nML8.Note 2.a.  Specially shaped and formulated for civil-use gas generation devices;\nML8.Note 2.b.  Compounded or mixed, with non-active thermoset binders or plasticizers, and having a mass of less than 250 g;\nML8.Note 2.c.  Having a maximum of 80% ammonium perchlorate (ML8.d.2.) in mass of active material;\nML8.Note 2.d.  Having less than or equal to 4 g of NTO (ML8.a.18.); and\nML8.Note 2.e.  Having less than or equal to 1 g of catocene (ML8.f.4.b.).\n'),
(39881,'','','','ML18.  \'Production\' equipment and components, as follows:\nML18.b.  Specially designed environmental test facilities and specially designed equipment therefor, for the certification, qualification or testing of products specified by the Munitions List.\nML18.Technical Note.  For the purposes of ML18., the term \'production\' includes design, examination, manufacture, testing and checking.\nML18.Note.  ML18.a. and ML18.b. include the following equipment:\nML18.Note.a.  Continuous nitrators;\nML18.Note.b.  Centrifugal testing apparatus or equipment, having any of the following:\nML18.Note.b.1.  Driven by a motor or motors having a total rated horsepower of more than 298 kW (400 hp);\nML18.Note.b.2.  Capable of carrying a payload of 113 kg or more; or\nML18.Note.b.3.  Capable of exerting a centrifugal acceleration of 8 g or more on a payload of 91 kg or more;\nML18.Note.c.  Dehydration presses;\nML18.Note.d.  Screw extruders specially designed or modified for military \"explosive\" extrusion;\nML18.Note.e.  Cutting machines for the sizing of extruded \"propellants\";\nML18.Note.f.  Sweetie barrels (tumblers) 1.85 m or more in diameter and having over 227 kg product capacity;\nML18.Note.g.  Continuous mixers for solid \"propellants\";\nML18.Note.h.  Fluid energy mills for grinding or milling the ingredients of military \"explosives\";\nML18.Note.i.  Equipment to achieve both sphericity and uniform particle size in metal powder listed in ML8.c.8.;\nML18.Note.j.  Convection current converters for the conversion of materials listed in ML8.c.3.\n'),
(39882,'','','','ML19.  Directed Energy Weapon (DEW) systems, related or countermeasure equipment and test models, as follows, and specially designed components therefor:\nML19.Note 1.  DEW systems specified by ML19. include systems whose capability is derived from the controlled application of:\nML19.Note 1.a.  Lasers of sufficient power to effect destruction similar to the manner of conventional ammunition;\nML19.Note 1.b.  Particle accelerators which project a charged or neutral particle beam with destructive power;\nML19.Note 1.c.  High pulsed power or high average power radio frequency beam transmitters, which produce fields sufficiently intense to disable electronic circuitry at a distant target.\nML19.Note 2.  ML19. includes the following when specially designed for DEW systems:\nML19.Note 2.a.  Prime power generation, energy storage, switching, power conditioning or fuel-handling equipment;\nML19.Note 2.b.  Target acquisition or tracking systems;\nML19.Note 2.c.  Systems capable of assessing target damage, destruction or mission-abort;\nML19.Note 2.d.  Beam-handling, propagation or pointing equipment;\nML19.Note 2.e.  Equipment with rapid beam slew capability for rapid multiple target operations;\nML19.Note 2.f.  Adaptive optics and phase conjugators;\nML19.Note 2.g.  Current injectors for negative hydrogen ion beams;\nML19.Note 2.h.  Space-qualified accelerator components;\nML19.Note 2.i.  Negative ion beam funnelling equipment;\nML19.Note 2.j.  Equipment for controlling and slewing a high energy ion beam;\nML19.Note 2.k.  Space-qualified foils for neutralising negative hydrogen isotope beams.\n'),
(39883,'','','','ML8.  Energetic materials and related substances, as follows:\nML8.Technical Notes.1.  For the purposes of ML8., excluding ML8.c.11. or ML8.c.12., \'mixture\' refers to a composition of two or more substances with at least one substance being listed in the ML8 sub-items.\nML8.Technical Notes.2.  Any substance listed in the ML8 sub-items is subject to this list, even when utilised in an application other than that indicated.  (e.g., TAGN is predominantly used as an explosive but can also be used either as a fuel or an oxidizer.)\nML8.Technical Notes.3.  For the purposes of ML8., particle size is the mean particle diameter on a weight or volume basis.  International or equivalent national standards will be used in sampling and determining particle size.\nML8.f.  Additives as follows:\nML8.f.1.  Basic copper salicylate (CAS 62320-94-9);\nML8.f.2.  BHEGA (bis-(2-hydroxyethyl) glycolamide) (CAS 17409-41-5);\nML8.f.3.  BNO (butadienenitrileoxide);\nML8.f.4.  Ferrocene derivatives as follows:\nML8.f.4.a.  Butacene (CAS 125856-62-4);\nML8.f.4.b.  Catocene (2,2-bis-ethylferrocenyl propane) (CAS 37206-42-1);\nML8.f.4.c.  Ferrocene carboxylic acids and ferrocene carboxylic acid esters;\nML8.f.4.d.  n-butyl-ferrocene (CAS 31904-29-7);\nML8.f.4.e.  Other adducted polymer ferrocene derivatives not specified elsewhere in ML8.f.4.;\nML8.f.4.f.  Ethyl ferrocene (CAS 1273-89-8);\nML8.f.4.g.  Propyl ferrocene;\nML8.f.4.h.  Pentyl ferrocene (CAS 1274-00-6);\nML8.f.4.i.  Dicyclopentyl ferrocene;\nML8.f.4.j.  Dicyclohexyl ferrocene;\nML8.f.4.k.  Diethyl ferrocene (CAS 1273-97-8);\nML8.f.4.l.  Dipropyl ferrocene;\nML8.f.4.m.  Dibutyl ferrocene (CAS 1274-08-4);\nML8.f.4.n.  Dihexyl ferrocene (CAS 93894-59-8);\nML8.f.4.o.  Acetyl ferrocene (CAS 1271-55-2)/1,1’-diacetyl ferrocene\nML8.f.4.o.  (CAS 1273-94-5);\nML8.f.5.  Lead beta-resorcylate (CAS 20936-32-7) or copper beta-resorcylate\nML8.f.5.  (CAS 70983-44-7);\nML8.f.6.  Lead citrate (CAS 14450-60-3);\nML8.f.7.  Lead-copper chelates of beta-resorcylate or salicylates (CAS 68411-07-4);\nML8.f.8.  Lead maleate (CAS 19136-34-6);\nML8.f.9.  Lead salicylate (CAS 15748-73-9);\nML8.f.10.  Lead stannate (CAS 12036-31-6);\nML8.f.11.  MAPO (tris-1-(2-methyl)aziridinyl phosphine oxide)\nML8.f.11.  (CAS 57-39-6); BOBBA 8 (bis(2-methyl aziridinyl) 2-(2-hydroxypropanoxy) propylamino phosphine oxide); and other MAPO derivatives;\nML8.f.12.  Methyl BAPO (bis(2-methyl aziridinyl) methylamino phosphine oxide) (CAS 85068-72-0);\nML8.f.13.  N-methyl-p-nitroaniline (CAS 100-15-2);\nML8.f.14.  3-Nitraza-1,5-pentane diisocyanate (CAS 7406-61-9);\nML8.f.15.  Organo-metallic coupling agents as follows:\nML8.f.15.a.  Neopentyl[diallyl]oxy, tri[dioctyl]phosphato-titanate (CAS 103850-22-2); also known as titanium IV, 2,2[bis 2-propenolato-methyl, butanolato, tris (dioctyl) phosphato] (CAS 110438-25-0); or LICA 12\nML8.f.15.a.  (CAS 103850-22-2);\nML8.f.15.b.  Titanium IV, [(2-propenolato-1) methyl, n-propanolatomethyl] butanolato-1, tris[dioctyl] pyrophosphate or KR3538;\nML8.f.15.c.  Titanium IV, [(2-propenolato-1)methyl, n-propanolatomethyl] butanolato-1, tris(dioctyl)phosphate;\nML8.f.16.  Polycyanodifluoroaminoethyleneoxide;\nML8.f.17.  Bonding agents as follows:\nML8.f.17.a.  1,1R,1S-trimesoyl-tris(2-ethylaziridine) (HX-868, BITA)\nML8.f.17.a.  (CAS 7722-73-8);\nML8.f.17.b.  Polyfunctional aziridine amides with isophthalic, trimesic, isocyanuric or trimethyladipic backbone also having a 2-methyl or 2-ethyl aziridine group;\nML8.f.17.b.Note.  Item ML.8.f.17.b. includes:\nML8.f.17.b.Note.a.  1,1H-Isophthaloyl-bis(2-methylaziridine)(HX-752)\nML8.f.17.b.Note.a.  (CAS 7652-64-4);\nML8.f.17.b.Note.b.  2,4,6-tris(2-ethyl-1-aziridinyl)-1,3,5-triazine (HX-874) (CAS 18924-91-9);\nML8.f.17.b.Note.c.  1,1\'-trimethyladipoyl-bis(2-ethylaziridine) (HX-877)\nML8.f.17.b.Note.c.  (CAS 71463-62-2).\nML8.f.18.  Propyleneimine (2-methylaziridine) (CAS 75-55-8);\nML8.f.19.  Superfine iron oxide (Fe2O3) (CAS 1317-60-8) with a specific surface area more than 250 m2/g and an average particle size of 3.0 nm or less;\nML8.f.20.  TEPAN (tetraethylenepentaamineacrylonitrile) (CAS 68412-45-3); cyanoethylated polyamines and their salts;\nML8.f.21.  TEPANOL (tetraethylenepentaamineacrylonitrileglycidol) (CAS 68412-46-4); cyanoethylated polyamines adducted with glycidol and their salts;\nML8.f.22.  TPB (triphenyl bismuth) (CAS 603-33-8);\nML8.f.23.  TEPB (Tris (ethoxyphenyl) bismuth) (CAS 90591-48-3);\nML8.Note 1.  ML8. does not apply to the following substances unless they are compounded or mixed with the \"energetic material\" specified by ML8.a. or powdered metals specified by ML8.c.:\nML8.Note 1.a.  Ammonium picrate (CAS 131-74-8);\nML8.Note 1.b.  Black powder;\nML8.Note 1.c.  Hexanitrodiphenylamine (CAS 131-73-7);\nML8.Note 1.d.  Difluoroamine (CAS 10405-27-3);\nML8.Note 1.e.  Nitrostarch (CAS 9056-38-6);\nML8.Note 1.f.  Potassium nitrate (CAS 7757-79-1);\nML8.Note 1.g.  Tetranitronaphthalene;\nML8.Note 1.h.  Trinitroanisol;\nML8.Note 1.i.  Trinitronaphthalene;\nML8.Note 1.j.  Trinitroxylene;\nML8.Note 1.k.  N-pyrrolidinone; 1-methyl-2-pyrrolidinone (CAS 872-50-4);\nML8.Note 1.l.  Dioctylmaleate (CAS 142-16-5);\nML8.Note 1.m.  Ethylhexylacrylate (CAS 103-11-7);\nML8.Note 1.n.  Triethylaluminium (TEA) (CAS 97-93-8), trimethylaluminium (TMA) (CAS 75-24-1), and other pyrophoric metal alkyls and aryls of lithium, sodium, magnesium, zinc or boron;\nML8.Note 1.o.  Nitrocellulose (CAS 9004-70-0);\nML8.Note 1.p.  Nitroglycerin (or glyceroltrinitrate, trinitroglycerine) (NG) (CAS 55-63-0);\nML8.Note 1.q.  2,4,6-trinitrotoluene (TNT) (CAS 118-96-7);\nML8.Note 1.r.  Ethylenediaminedinitrate (EDDN) (CAS 20829-66-7);\nML8.Note 1.s.  Pentaerythritoltetranitrate (PETN) (CAS 78-11-5);\nML8.Note 1.t.  Lead azide (CAS 13424-46-9), normal lead styphnate (CAS 15245-44-0) and basic lead styphnate (CAS 12403-82-6), and primary explosives or priming compositions containing azides or azide complexes;\nML8.Note 1.u.  Triethyleneglycoldinitrate (TEGDN) (CAS 111-22-8);\nML8.Note 1.v.  2,4,6-trinitroresorcinol (styphnic acid) (CAS 82-71-3);\nML8.Note 1.w.  Diethyldiphenylurea; (CAS 85-98-3); dimethyldiphenylurea;\nML8.Note 1.w.  (CAS 611-92-7), methylethyldiphenylurea; [Centralites]\nML8.Note 1.x.  N,N-diphenylurea (unsymmetrical diphenylurea) (CAS 603-54-3);\nML8.Note 1.y.  Methyl-N,N-diphenylurea (methyl unsymmetrical diphenylurea)\nML8.Note 1.y.  (CAS 13114-72-2);\nML8.Note 1.z.  Ethyl-N,N-diphenylurea (ethyl unsymmetrical diphenylurea)\nML8.Note 1.z.  (CAS 64544-71-4);\nML8.Note 1.aa.  2-Nitrodiphenylamine (2-NDPA) (CAS 119-75-5);\nML8.Note 1.bb.  4-Nitrodiphenylamine (4-NDPA) (CAS 836-30-6);\nML8.Note 1.cc.  2,2-dinitropropanol (CAS 918-52-5);\nML8.Note 1.dd.  Nitroguanidine (CAS 556-88-7) (see 1.C.11.d. on the Dual-Use List).\nML8.Note 2.  ML8. does not apply to ammonium perchlorate (ML8.d.2.), NTO (ML8.a.18.) or catocene (ML8.f.4.b.), and meeting all of the following:\nML8.Note 2.a.  Specially shaped and formulated for civil-use gas generation devices;\nML8.Note 2.b.  Compounded or mixed, with non-active thermoset binders or plasticizers, and having a mass of less than 250 g;\nML8.Note 2.c.  Having a maximum of 80% ammonium perchlorate (ML8.d.2.) in mass of active material;\nML8.Note 2.d.  Having less than or equal to 4 g of NTO (ML8.a.18.); and\nML8.Note 2.e.  Having less than or equal to 1 g of catocene (ML8.f.4.b.).\n'),
(39884,'','','','ML12.  High velocity kinetic energy weapon systems and related equipment, as follows, and specially designed components therefor:\nML12.Note 1.  ML12. includes the following when specially designed for kinetic energy weapon systems:\nML12.Note 1.a.  Launch propulsion systems capable of accelerating masses larger than 0.1 g to velocities in excess of 1.6 km/s, in single or rapid fire modes;\nML12.Note 1.b.  Prime power generation, electric armour, energy storage (e.g., high energy storage capacitors), thermal management, conditioning, switching or fuel-handling equipment; and electrical interfaces between power supply, gun and other turret electric drive functions;\nML12.Note 1.b.N.B.  See also 3.A.1.e.2. on the Dual-Use List for high energy storage capacitors.\nML12.Note 1.c.  Target acquisition, tracking, fire control or damage assessment systems;\nML12.Note 1.d.  Homing seeker, guidance or divert propulsion (lateral acceleration) systems for projectiles.\nML12.Note 2.  ML12. applies to weapon systems using any of the following methods of propulsion:\nML12.Note 2.a.  Electromagnetic;\nML12.Note 2.b.  Electrothermal;\nML12.Note 2.c.  Plasma;\nML12.Note 2.d.  Light gas; or\nML12.Note 2.e.  Chemical (when used in combination with any of the above).\n'),
(39885,'','','','ML17.  Miscellaneous equipment, materials and \"libraries\", as follows, and specially designed components therefor:\nML17.a.  Diving and underwater swimming apparatus, specially designed or modified for military use, as follows:\nML17.a.N.B.  See also 8.A.2.q. on the Dual-Use List.\nML17.Technical Note.1.  Not used since 2014\nML17.Technical Note.2.  For the purpose of ML17, \'modified\' means any structural, electrical, mechanical, or other change that provides a non-military item with military capabilities equivalent to an item which is specially designed for military use.\n'),
(39886,'','','','ML8.  Energetic materials and related substances, as follows:\nML8.Technical Notes.1.  For the purposes of ML8., excluding ML8.c.11. or ML8.c.12., \'mixture\' refers to a composition of two or more substances with at least one substance being listed in the ML8 sub-items.\nML8.Technical Notes.2.  Any substance listed in the ML8 sub-items is subject to this list, even when utilised in an application other than that indicated.  (e.g., TAGN is predominantly used as an explosive but can also be used either as a fuel or an oxidizer.)\nML8.Technical Notes.3.  For the purposes of ML8., particle size is the mean particle diameter on a weight or volume basis.  International or equivalent national standards will be used in sampling and determining particle size.\nML8.f.  Additives as follows:\nML8.f.2.  BHEGA (bis-(2-hydroxyethyl) glycolamide) (CAS 17409-41-5);\nML8.Note 1.  ML8. does not apply to the following substances unless they are compounded or mixed with the \"energetic material\" specified by ML8.a. or powdered metals specified by ML8.c.:\nML8.Note 1.a.  Ammonium picrate (CAS 131-74-8);\nML8.Note 1.b.  Black powder;\nML8.Note 1.c.  Hexanitrodiphenylamine (CAS 131-73-7);\nML8.Note 1.d.  Difluoroamine (CAS 10405-27-3);\nML8.Note 1.e.  Nitrostarch (CAS 9056-38-6);\nML8.Note 1.f.  Potassium nitrate (CAS 7757-79-1);\nML8.Note 1.g.  Tetranitronaphthalene;\nML8.Note 1.h.  Trinitroanisol;\nML8.Note 1.i.  Trinitronaphthalene;\nML8.Note 1.j.  Trinitroxylene;\nML8.Note 1.k.  N-pyrrolidinone; 1-methyl-2-pyrrolidinone (CAS 872-50-4);\nML8.Note 1.l.  Dioctylmaleate (CAS 142-16-5);\nML8.Note 1.m.  Ethylhexylacrylate (CAS 103-11-7);\nML8.Note 1.n.  Triethylaluminium (TEA) (CAS 97-93-8), trimethylaluminium (TMA) (CAS 75-24-1), and other pyrophoric metal alkyls and aryls of lithium, sodium, magnesium, zinc or boron;\nML8.Note 1.o.  Nitrocellulose (CAS 9004-70-0);\nML8.Note 1.p.  Nitroglycerin (or glyceroltrinitrate, trinitroglycerine) (NG) (CAS 55-63-0);\nML8.Note 1.q.  2,4,6-trinitrotoluene (TNT) (CAS 118-96-7);\nML8.Note 1.r.  Ethylenediaminedinitrate (EDDN) (CAS 20829-66-7);\nML8.Note 1.s.  Pentaerythritoltetranitrate (PETN) (CAS 78-11-5);\nML8.Note 1.t.  Lead azide (CAS 13424-46-9), normal lead styphnate (CAS 15245-44-0) and basic lead styphnate (CAS 12403-82-6), and primary explosives or priming compositions containing azides or azide complexes;\nML8.Note 1.u.  Triethyleneglycoldinitrate (TEGDN) (CAS 111-22-8);\nML8.Note 1.v.  2,4,6-trinitroresorcinol (styphnic acid) (CAS 82-71-3);\nML8.Note 1.w.  Diethyldiphenylurea; (CAS 85-98-3); dimethyldiphenylurea;\nML8.Note 1.w.  (CAS 611-92-7), methylethyldiphenylurea; [Centralites]\nML8.Note 1.x.  N,N-diphenylurea (unsymmetrical diphenylurea) (CAS 603-54-3);\nML8.Note 1.y.  Methyl-N,N-diphenylurea (methyl unsymmetrical diphenylurea)\nML8.Note 1.y.  (CAS 13114-72-2);\nML8.Note 1.z.  Ethyl-N,N-diphenylurea (ethyl unsymmetrical diphenylurea)\nML8.Note 1.z.  (CAS 64544-71-4);\nML8.Note 1.aa.  2-Nitrodiphenylamine (2-NDPA) (CAS 119-75-5);\nML8.Note 1.bb.  4-Nitrodiphenylamine (4-NDPA) (CAS 836-30-6);\nML8.Note 1.cc.  2,2-dinitropropanol (CAS 918-52-5);\nML8.Note 1.dd.  Nitroguanidine (CAS 556-88-7) (see 1.C.11.d. on the Dual-Use List).\nML8.Note 2.  ML8. does not apply to ammonium perchlorate (ML8.d.2.), NTO (ML8.a.18.) or catocene (ML8.f.4.b.), and meeting all of the following:\nML8.Note 2.a.  Specially shaped and formulated for civil-use gas generation devices;\nML8.Note 2.b.  Compounded or mixed, with non-active thermoset binders or plasticizers, and having a mass of less than 250 g;\nML8.Note 2.c.  Having a maximum of 80% ammonium perchlorate (ML8.d.2.) in mass of active material;\nML8.Note 2.d.  Having less than or equal to 4 g of NTO (ML8.a.18.); and\nML8.Note 2.e.  Having less than or equal to 1 g of catocene (ML8.f.4.b.).\n'),
(39887,'','','','ML3.  Ammunition and fuze setting devices, as follows, and specially designed components therefor:\nML3.a.  Ammunition for weapons specified by ML1., ML2. or ML12.;\nML3.Note 1.  Specially designed components specified by ML3. include:\nML3.Note 1.a.  Metal or plastic fabrications such as primer anvils, bullet cups, cartridge links, rotating bands and munitions metal parts;\nML3.Note 1.b.  Safing and arming devices, fuzes, sensors and initiation devices ;\nML3.Note 1.c.  Power supplies with high one-time operational output;\nML3.Note 1.d.  Combustible cases for charges;\nML3.Note 1.e.  Submunitions including bomblets, minelets and terminally guided projectiles.\nML3.a.Note 2.  ML3.a. does not apply to any of the following:\nML3.a.Note 2.a.  Ammunition crimped without a projectile (blank star);\nML3.a.Note 2.b.  Dummy ammunition with a pierced powder chamber;\nML3.a.Note 2.c.  Other blank and dummy ammunition, not incorporating components designed for live ammunition; or\nML3.a.Note 2.d.  Components specially designed for blank or dummy ammunition, specified in this Note 2.a., b. or c.\nML3.a.Note 3.  ML3.a. does not apply to cartridges specially designed for any of the following purposes:\nML3.a.Note 3.a.  Signalling;\nML3.a.Note 3.b.  Bird scaring; or\nML3.a.Note 3.c.  Lighting of gas flares at oil wells.\n'),
(39888,'','','','ML9.  Vessels of war (surface or underwater), special naval equipment, accessories, components and other surface vessels, as follows:\nML9.a.  Vessels and components, as follows:\nML9.a.2.  Surface vessels, not specified in ML9.a.1., having any of the following, fixed or integrated into the vessel:\nML9.a.2.a.  Automatic weapons specified in ML1., or weapons specified in ML2., ML4., ML12. or ML19., or \'mountings\' or hard points for weapons having a calibre of 12.7 mm or greater;\nML9.a.2.a.Technical Note.  \'Mountings\' refers to weapon mounts or structural strengthening for the purpose of installing weapons.\nML9.a.2.b.  Fire control systems specified in ML5.;\nML9.a.2.c.  Having all of the following:\nML9.a.2.c.1.  \'Chemical, Biological, Radiological and Nuclear (CBRN) protection\'; and\nML9.a.2.c.2.  \'Pre-wet or wash down system\' designed for decontamination purposes; or\nML9.a.2.c.Technical Notes.1.  \'CBRN protection\' is a self-contained interior space containing features such as over-pressurization, isolation of ventilation systems, limited ventilation openings with CBRN filters and limited personnel access points incorporating air-locks.\nML9.a.2.c.Technical Notes.2.  \'Pre-wet or wash down system\' is a seawater spray system capable of simultaneously wetting the exterior superstructure and decks of a vessel.\nML9.a.2.d.  Active weapon countermeasure systems specified in ML4.b., ML5.c. or ML11.a. and having any of the following:\nML9.a.2.d.1.  \'CBRN protection\';\nML9.a.2.d.2.  Hull and superstructure, specially designed to reduce the radar cross section;\nML9.a.2.d.3.  Thermal signature reduction devices, (e.g., an exhaust gas cooling system), excluding those specially designed to increase overall power plant efficiency or to reduce the environmental impact; or\nML9.a.2.d.4.  A degaussing system designed to reduce the magnetic signature of the whole vessel;\n'),
(39889,'','','','ML7.  Chemical agents, \"biological agents\", \"riot control agents\", radioactive materials, related equipment, components and materials, as follows:\nML7.Note 1.  ML7.b. and ML7.d. do not apply to the following:\nML7.Note 1.a.  Cyanogen chloride (CAS 506-77-4);\nML7.Note 1.b.  Hydrocyanic acid (CAS 74-90-8);\nML7.Note 1.c.  Chlorine (CAS 7782-50-5);\nML7.Note 1.d.  Carbonyl chloride (phosgene) (CAS 75-44-5);\nML7.Note 1.e.  Diphosgene (trichloromethyl-chloroformate) (CAS 503-38-8);\nML7.Note 1.f.  Not used since 2004\nML7.Note 1.g.  Xylyl bromide, ortho: (CAS 89-92-9), meta: (CAS 620-13-3), para: (CAS 104-81-4);\nML7.Note 1.h.  Benzyl bromide (CAS 100-39-0);\nML7.Note 1.i.  Benzyl iodide (CAS 620-05-3);\nML7.Note 1.j.  Bromo acetone (CAS 598-31-2);\nML7.Note 1.k.  Cyanogen bromide (CAS 506-68-3);\nML7.Note 1.l.  Bromo methylethylketone (CAS 816-40-0);\nML7.Note 1.m.  Chloro acetone (CAS 78-95-5);\nML7.Note 1.n.  Ethyl iodoacetate (CAS 623-48-3);\nML7.Note 1.o.  Iodo acetone (CAS 3019-04-3);\nML7.Note 1.p.  Chloropicrin (CAS 76-06-2).\nML7.Note 2  The cultures of cells and biological systems specified by ML7.h. and ML7.i.2. are exclusive and these sub-items do not apply to cells or biological systems for civil purposes, such as agricultural, pharmaceutical, medical, veterinary, environmental, waste management, or in the food industry.\n'),
(39890,'','','','ML9.  Vessels of war (surface or underwater), special naval equipment, accessories, components and other surface vessels, as follows:\nML9.b.  Engines and propulsion systems, as follows, specially designed for military use and components therefor specially designed for military use:\nML9.b.3.  Diesel engines having all of the following:\nML9.b.3.a.  Power output of 37.3 kW (50 hp) or more; and\nML9.b.3.b.  \'Non-magnetic\' content in excess of 75% of total mass;\nML9.b.3.b.Technical Note.  For the purposes of ML9.b.3., \'non-magnetic\' means the relative permeability is less than 2.\n'),
(39891,'','','','ML8.  Energetic materials and related substances, as follows:\nML8.Technical Notes.1.  For the purposes of ML8., excluding ML8.c.11. or ML8.c.12., \'mixture\' refers to a composition of two or more substances with at least one substance being listed in the ML8 sub-items.\nML8.Technical Notes.2.  Any substance listed in the ML8 sub-items is subject to this list, even when utilised in an application other than that indicated.  (e.g., TAGN is predominantly used as an explosive but can also be used either as a fuel or an oxidizer.)\nML8.Technical Notes.3.  For the purposes of ML8., particle size is the mean particle diameter on a weight or volume basis.  International or equivalent national standards will be used in sampling and determining particle size.\nML8.d.  Oxidizers as follows, and \'mixtures\' thereof:\nML8.d.10.  Liquid oxidisers comprised of or containing inhibited red fuming nitric acid (IRFNA) (CAS 8007-58-7);\nML8.d.10.Note.  ML8.d.10. does not apply to non-inhibited fuming nitric acid.\nML8.Note 1.  ML8. does not apply to the following substances unless they are compounded or mixed with the \"energetic material\" specified by ML8.a. or powdered metals specified by ML8.c.:\nML8.Note 1.a.  Ammonium picrate (CAS 131-74-8);\nML8.Note 1.b.  Black powder;\nML8.Note 1.c.  Hexanitrodiphenylamine (CAS 131-73-7);\nML8.Note 1.d.  Difluoroamine (CAS 10405-27-3);\nML8.Note 1.e.  Nitrostarch (CAS 9056-38-6);\nML8.Note 1.f.  Potassium nitrate (CAS 7757-79-1);\nML8.Note 1.g.  Tetranitronaphthalene;\nML8.Note 1.h.  Trinitroanisol;\nML8.Note 1.i.  Trinitronaphthalene;\nML8.Note 1.j.  Trinitroxylene;\nML8.Note 1.k.  N-pyrrolidinone; 1-methyl-2-pyrrolidinone (CAS 872-50-4);\nML8.Note 1.l.  Dioctylmaleate (CAS 142-16-5);\nML8.Note 1.m.  Ethylhexylacrylate (CAS 103-11-7);\nML8.Note 1.n.  Triethylaluminium (TEA) (CAS 97-93-8), trimethylaluminium (TMA) (CAS 75-24-1), and other pyrophoric metal alkyls and aryls of lithium, sodium, magnesium, zinc or boron;\nML8.Note 1.o.  Nitrocellulose (CAS 9004-70-0);\nML8.Note 1.p.  Nitroglycerin (or glyceroltrinitrate, trinitroglycerine) (NG) (CAS 55-63-0);\nML8.Note 1.q.  2,4,6-trinitrotoluene (TNT) (CAS 118-96-7);\nML8.Note 1.r.  Ethylenediaminedinitrate (EDDN) (CAS 20829-66-7);\nML8.Note 1.s.  Pentaerythritoltetranitrate (PETN) (CAS 78-11-5);\nML8.Note 1.t.  Lead azide (CAS 13424-46-9), normal lead styphnate (CAS 15245-44-0) and basic lead styphnate (CAS 12403-82-6), and primary explosives or priming compositions containing azides or azide complexes;\nML8.Note 1.u.  Triethyleneglycoldinitrate (TEGDN) (CAS 111-22-8);\nML8.Note 1.v.  2,4,6-trinitroresorcinol (styphnic acid) (CAS 82-71-3);\nML8.Note 1.w.  Diethyldiphenylurea; (CAS 85-98-3); dimethyldiphenylurea;\nML8.Note 1.w.  (CAS 611-92-7), methylethyldiphenylurea; [Centralites]\nML8.Note 1.x.  N,N-diphenylurea (unsymmetrical diphenylurea) (CAS 603-54-3);\nML8.Note 1.y.  Methyl-N,N-diphenylurea (methyl unsymmetrical diphenylurea)\nML8.Note 1.y.  (CAS 13114-72-2);\nML8.Note 1.z.  Ethyl-N,N-diphenylurea (ethyl unsymmetrical diphenylurea)\nML8.Note 1.z.  (CAS 64544-71-4);\nML8.Note 1.aa.  2-Nitrodiphenylamine (2-NDPA) (CAS 119-75-5);\nML8.Note 1.bb.  4-Nitrodiphenylamine (4-NDPA) (CAS 836-30-6);\nML8.Note 1.cc.  2,2-dinitropropanol (CAS 918-52-5);\nML8.Note 1.dd.  Nitroguanidine (CAS 556-88-7) (see 1.C.11.d. on the Dual-Use List).\nML8.Note 2.  ML8. does not apply to ammonium perchlorate (ML8.d.2.), NTO (ML8.a.18.) or catocene (ML8.f.4.b.), and meeting all of the following:\nML8.Note 2.a.  Specially shaped and formulated for civil-use gas generation devices;\nML8.Note 2.b.  Compounded or mixed, with non-active thermoset binders or plasticizers, and having a mass of less than 250 g;\nML8.Note 2.c.  Having a maximum of 80% ammonium perchlorate (ML8.d.2.) in mass of active material;\nML8.Note 2.d.  Having less than or equal to 4 g of NTO (ML8.a.18.); and\nML8.Note 2.e.  Having less than or equal to 1 g of catocene (ML8.f.4.b.).\n'),
(39892,'','','','ML7.  Chemical agents, \"biological agents\", \"riot control agents\", radioactive materials, related equipment, components and materials, as follows:\nML7.Note 1.  ML7.b. and ML7.d. do not apply to the following:\nML7.Note 1.a.  Cyanogen chloride (CAS 506-77-4);\nML7.Note 1.b.  Hydrocyanic acid (CAS 74-90-8);\nML7.Note 1.c.  Chlorine (CAS 7782-50-5);\nML7.Note 1.d.  Carbonyl chloride (phosgene) (CAS 75-44-5);\nML7.Note 1.e.  Diphosgene (trichloromethyl-chloroformate) (CAS 503-38-8);\nML7.Note 1.f.  Not used since 2004\nML7.Note 1.g.  Xylyl bromide, ortho: (CAS 89-92-9), meta: (CAS 620-13-3), para: (CAS 104-81-4);\nML7.Note 1.h.  Benzyl bromide (CAS 100-39-0);\nML7.Note 1.i.  Benzyl iodide (CAS 620-05-3);\nML7.Note 1.j.  Bromo acetone (CAS 598-31-2);\nML7.Note 1.k.  Cyanogen bromide (CAS 506-68-3);\nML7.Note 1.l.  Bromo methylethylketone (CAS 816-40-0);\nML7.Note 1.m.  Chloro acetone (CAS 78-95-5);\nML7.Note 1.n.  Ethyl iodoacetate (CAS 623-48-3);\nML7.Note 1.o.  Iodo acetone (CAS 3019-04-3);\nML7.Note 1.p.  Chloropicrin (CAS 76-06-2).\nML7.Note 2  The cultures of cells and biological systems specified by ML7.h. and ML7.i.2. are exclusive and these sub-items do not apply to cells or biological systems for civil purposes, such as agricultural, pharmaceutical, medical, veterinary, environmental, waste management, or in the food industry.\n'),
(39893,'','','','ML1.  Smooth-bore weapons with a calibre of less than 20 mm, other arms and automatic weapons with a calibre of 12.7 mm (calibre 0.50 inches) or less and accessories, as follows, and specially designed components therefor:\nML1.Note  ML1. does not apply to:\nML1.Note.a.  Firearms specially designed for dummy ammunition and which are incapable of discharging a projectile;\nML1.Note.b.  Firearms specially designed to launch tethered projectiles having no high explosive charge or communications link, to a range of less than or equal to 500 m.;\nML1.Note.c.  Weapons using non-centre fire cased ammunition and which are not of the fully automatic firing type;\nML1.Note.d.  Deactivated firearms.\nML1.d.  Accessories designed for arms specified by ML1.a., ML1.b. or ML1.c., as follows:\nML1.d.4.  Flash suppressors;\n'),
(39894,'','','','ML8.  Energetic materials and related substances, as follows:\nML8.Technical Notes.1.  For the purposes of ML8., excluding ML8.c.11. or ML8.c.12., \'mixture\' refers to a composition of two or more substances with at least one substance being listed in the ML8 sub-items.\nML8.Technical Notes.2.  Any substance listed in the ML8 sub-items is subject to this list, even when utilised in an application other than that indicated.  (e.g., TAGN is predominantly used as an explosive but can also be used either as a fuel or an oxidizer.)\nML8.Technical Notes.3.  For the purposes of ML8., particle size is the mean particle diameter on a weight or volume basis.  International or equivalent national standards will be used in sampling and determining particle size.\nML8.h.  \'Reactive material\' powders and shapes, as follows:\nML8.h.Technical Notes.1.  \'Reactive materials\' are designed to produce an exothermic reaction only at high shear rates and for use as liners or casings in warheads.\nML8.h.Technical Notes.2.  \'Reactive material\' powders are produced by, for example, a high energy ball milling process.\nML8.h.Technical Notes.3.  \'Reactive material\' shapes are produced by, for example, selective laser sintering.\nML8.Note 1.  ML8. does not apply to the following substances unless they are compounded or mixed with the \"energetic material\" specified by ML8.a. or powdered metals specified by ML8.c.:\nML8.Note 1.a.  Ammonium picrate (CAS 131-74-8);\nML8.Note 1.b.  Black powder;\nML8.Note 1.c.  Hexanitrodiphenylamine (CAS 131-73-7);\nML8.Note 1.d.  Difluoroamine (CAS 10405-27-3);\nML8.Note 1.e.  Nitrostarch (CAS 9056-38-6);\nML8.Note 1.f.  Potassium nitrate (CAS 7757-79-1);\nML8.Note 1.g.  Tetranitronaphthalene;\nML8.Note 1.h.  Trinitroanisol;\nML8.Note 1.i.  Trinitronaphthalene;\nML8.Note 1.j.  Trinitroxylene;\nML8.Note 1.k.  N-pyrrolidinone; 1-methyl-2-pyrrolidinone (CAS 872-50-4);\nML8.Note 1.l.  Dioctylmaleate (CAS 142-16-5);\nML8.Note 1.m.  Ethylhexylacrylate (CAS 103-11-7);\nML8.Note 1.n.  Triethylaluminium (TEA) (CAS 97-93-8), trimethylaluminium (TMA) (CAS 75-24-1), and other pyrophoric metal alkyls and aryls of lithium, sodium, magnesium, zinc or boron;\nML8.Note 1.o.  Nitrocellulose (CAS 9004-70-0);\nML8.Note 1.p.  Nitroglycerin (or glyceroltrinitrate, trinitroglycerine) (NG) (CAS 55-63-0);\nML8.Note 1.q.  2,4,6-trinitrotoluene (TNT) (CAS 118-96-7);\nML8.Note 1.r.  Ethylenediaminedinitrate (EDDN) (CAS 20829-66-7);\nML8.Note 1.s.  Pentaerythritoltetranitrate (PETN) (CAS 78-11-5);\nML8.Note 1.t.  Lead azide (CAS 13424-46-9), normal lead styphnate (CAS 15245-44-0) and basic lead styphnate (CAS 12403-82-6), and primary explosives or priming compositions containing azides or azide complexes;\nML8.Note 1.u.  Triethyleneglycoldinitrate (TEGDN) (CAS 111-22-8);\nML8.Note 1.v.  2,4,6-trinitroresorcinol (styphnic acid) (CAS 82-71-3);\nML8.Note 1.w.  Diethyldiphenylurea; (CAS 85-98-3); dimethyldiphenylurea;\nML8.Note 1.w.  (CAS 611-92-7), methylethyldiphenylurea; [Centralites]\nML8.Note 1.x.  N,N-diphenylurea (unsymmetrical diphenylurea) (CAS 603-54-3);\nML8.Note 1.y.  Methyl-N,N-diphenylurea (methyl unsymmetrical diphenylurea)\nML8.Note 1.y.  (CAS 13114-72-2);\nML8.Note 1.z.  Ethyl-N,N-diphenylurea (ethyl unsymmetrical diphenylurea)\nML8.Note 1.z.  (CAS 64544-71-4);\nML8.Note 1.aa.  2-Nitrodiphenylamine (2-NDPA) (CAS 119-75-5);\nML8.Note 1.bb.  4-Nitrodiphenylamine (4-NDPA) (CAS 836-30-6);\nML8.Note 1.cc.  2,2-dinitropropanol (CAS 918-52-5);\nML8.Note 1.dd.  Nitroguanidine (CAS 556-88-7) (see 1.C.11.d. on the Dual-Use List).\nML8.Note 2.  ML8. does not apply to ammonium perchlorate (ML8.d.2.), NTO (ML8.a.18.) or catocene (ML8.f.4.b.), and meeting all of the following:\nML8.Note 2.a.  Specially shaped and formulated for civil-use gas generation devices;\nML8.Note 2.b.  Compounded or mixed, with non-active thermoset binders or plasticizers, and having a mass of less than 250 g;\nML8.Note 2.c.  Having a maximum of 80% ammonium perchlorate (ML8.d.2.) in mass of active material;\nML8.Note 2.d.  Having less than or equal to 4 g of NTO (ML8.a.18.); and\nML8.Note 2.e.  Having less than or equal to 1 g of catocene (ML8.f.4.b.).\n'),
(39895,'','','','ML21.  Software as follows:\nML21.b.  Specific \"software\", other than that specified by ML21.a., as follows:\nML21.b.1.  Software specially designed for military use and specially designed for modelling, simulating or evaluating military weapon systems;\nML21.b.2.  Software specially designed for military use and specially designed for modelling or simulating military operational scenarios;\nML21.b.3.  Software for determining the effects of conventional, nuclear, chemical or biological weapons;\nML21.b.4.  Software specially designed for military use and specially designed for Command, Communications, Control and Intelligence (C3I) or Command, Communications, Control, Computer and Intelligence (C4I) applications;\n'),
(39896,'','','','ML1.  Smooth-bore weapons with a calibre of less than 20 mm, other arms and automatic weapons with a calibre of 12.7 mm (calibre 0.50 inches) or less and accessories, as follows, and specially designed components therefor:\nML1.Note  ML1. does not apply to:\nML1.Note.a.  Firearms specially designed for dummy ammunition and which are incapable of discharging a projectile;\nML1.Note.b.  Firearms specially designed to launch tethered projectiles having no high explosive charge or communications link, to a range of less than or equal to 500 m.;\nML1.Note.c.  Weapons using non-centre fire cased ammunition and which are not of the fully automatic firing type;\nML1.Note.d.  Deactivated firearms.\nML1.b.  Smooth-bore weapons as follows:\nML1.b.Note  ML1.b. does not apply to the following:\nML1.b.Note.a.  Smooth-bore weapons manufactured earlier than 1938;\nML1.b.Note.b.  Reproductions of smooth-bore weapons, the originals of which were manufactured earlier than 1890.\nML1.b.Note.c.  Smooth-bore weapons used for hunting or sporting purposes. These weapons must not be specially designed for military use or of the fully automatic firing type;\nML1.b.Note.d.  Smooth-bore weapons specially designed for any of the following:\nML1.b.Note.d.1.  Slaughtering of domestic animals;\nML1.b.Note.d.2.  Tranquilizing of animals;\nML1.b.Note.d.3.  Seismic testing;\nML1.b.Note.d.4.  Firing of industrial projectiles; or\nML1.b.Note.d.5.  Disrupting Improvised Explosive Devices (IEDs).\nML1.b.Note.d.5.N.B.  For disruptors, see ML4. and 1.A.6. on the Dual-Use List.\n'),
(39897,'','','','ML8.  Energetic materials and related substances, as follows:\nML8.Technical Notes.1.  For the purposes of ML8., excluding ML8.c.11. or ML8.c.12., \'mixture\' refers to a composition of two or more substances with at least one substance being listed in the ML8 sub-items.\nML8.Technical Notes.2.  Any substance listed in the ML8 sub-items is subject to this list, even when utilised in an application other than that indicated.  (e.g., TAGN is predominantly used as an explosive but can also be used either as a fuel or an oxidizer.)\nML8.Technical Notes.3.  For the purposes of ML8., particle size is the mean particle diameter on a weight or volume basis.  International or equivalent national standards will be used in sampling and determining particle size.\nML8.c.  Pyrotechnics, fuels and related substances, as follows, and \'mixtures\' thereof:\nML8.c.5.  Metal fuels, fuel \'mixtures\' or \"pyrotechnic\" \'mixtures\', in particle form whether spherical, atomized, spheroidal, flaked or ground, manufactured from material consisting of 99 % or more of any of the following:\nML8.c.5.b.  \'Mixtures\' containing any of the following:\nML8.c.5.b.1.  Zirconium (CAS 7440-67-7), magnesium (CAS 7439-95-4) or alloys of these in particle sizes of less than 60 µm; or\nML8.c.5.b.2.  Boron (CAS 7440-42-8) or boron carbide (CAS 12069-32-8) fuels of 85% purity or higher and particle sizes of less than 60 µm;\nML8.c.5.Note 1.  ML8.c.5 applies to \"explosives\" and fuels, whether or not the metals or alloys are encapsulated in aluminium, magnesium, zirconium, or beryllium.\nML8.c.5.b.Note 2.  ML8.c.5.b. only applies to metal fuels in particle form when they are mixed with other substances to form a \'mixture\' formulated for military purposes such as liquid \"propellant\" slurries, solid \"propellants\", or \"pyrotechnic\" \'mixtures\'.\nML8.c.5.b.2.Note 3.  ML8.c.5.b.2. does not apply to boron and boron carbide enriched with boron-10 (20% or more of total boron-10 content).\nML8.Note 1.  ML8. does not apply to the following substances unless they are compounded or mixed with the \"energetic material\" specified by ML8.a. or powdered metals specified by ML8.c.:\nML8.Note 1.a.  Ammonium picrate (CAS 131-74-8);\nML8.Note 1.b.  Black powder;\nML8.Note 1.c.  Hexanitrodiphenylamine (CAS 131-73-7);\nML8.Note 1.d.  Difluoroamine (CAS 10405-27-3);\nML8.Note 1.e.  Nitrostarch (CAS 9056-38-6);\nML8.Note 1.f.  Potassium nitrate (CAS 7757-79-1);\nML8.Note 1.g.  Tetranitronaphthalene;\nML8.Note 1.h.  Trinitroanisol;\nML8.Note 1.i.  Trinitronaphthalene;\nML8.Note 1.j.  Trinitroxylene;\nML8.Note 1.k.  N-pyrrolidinone; 1-methyl-2-pyrrolidinone (CAS 872-50-4);\nML8.Note 1.l.  Dioctylmaleate (CAS 142-16-5);\nML8.Note 1.m.  Ethylhexylacrylate (CAS 103-11-7);\nML8.Note 1.n.  Triethylaluminium (TEA) (CAS 97-93-8), trimethylaluminium (TMA) (CAS 75-24-1), and other pyrophoric metal alkyls and aryls of lithium, sodium, magnesium, zinc or boron;\nML8.Note 1.o.  Nitrocellulose (CAS 9004-70-0);\nML8.Note 1.p.  Nitroglycerin (or glyceroltrinitrate, trinitroglycerine) (NG) (CAS 55-63-0);\nML8.Note 1.q.  2,4,6-trinitrotoluene (TNT) (CAS 118-96-7);\nML8.Note 1.r.  Ethylenediaminedinitrate (EDDN) (CAS 20829-66-7);\nML8.Note 1.s.  Pentaerythritoltetranitrate (PETN) (CAS 78-11-5);\nML8.Note 1.t.  Lead azide (CAS 13424-46-9), normal lead styphnate (CAS 15245-44-0) and basic lead styphnate (CAS 12403-82-6), and primary explosives or priming compositions containing azides or azide complexes;\nML8.Note 1.u.  Triethyleneglycoldinitrate (TEGDN) (CAS 111-22-8);\nML8.Note 1.v.  2,4,6-trinitroresorcinol (styphnic acid) (CAS 82-71-3);\nML8.Note 1.w.  Diethyldiphenylurea; (CAS 85-98-3); dimethyldiphenylurea;\nML8.Note 1.w.  (CAS 611-92-7), methylethyldiphenylurea; [Centralites]\nML8.Note 1.x.  N,N-diphenylurea (unsymmetrical diphenylurea) (CAS 603-54-3);\nML8.Note 1.y.  Methyl-N,N-diphenylurea (methyl unsymmetrical diphenylurea)\nML8.Note 1.y.  (CAS 13114-72-2);\nML8.Note 1.z.  Ethyl-N,N-diphenylurea (ethyl unsymmetrical diphenylurea)\nML8.Note 1.z.  (CAS 64544-71-4);\nML8.Note 1.aa.  2-Nitrodiphenylamine (2-NDPA) (CAS 119-75-5);\nML8.Note 1.bb.  4-Nitrodiphenylamine (4-NDPA) (CAS 836-30-6);\nML8.Note 1.cc.  2,2-dinitropropanol (CAS 918-52-5);\nML8.Note 1.dd.  Nitroguanidine (CAS 556-88-7) (see 1.C.11.d. on the Dual-Use List).\nML8.Note 2.  ML8. does not apply to ammonium perchlorate (ML8.d.2.), NTO (ML8.a.18.) or catocene (ML8.f.4.b.), and meeting all of the following:\nML8.Note 2.a.  Specially shaped and formulated for civil-use gas generation devices;\nML8.Note 2.b.  Compounded or mixed, with non-active thermoset binders or plasticizers, and having a mass of less than 250 g;\nML8.Note 2.c.  Having a maximum of 80% ammonium perchlorate (ML8.d.2.) in mass of active material;\nML8.Note 2.d.  Having less than or equal to 4 g of NTO (ML8.a.18.); and\nML8.Note 2.e.  Having less than or equal to 1 g of catocene (ML8.f.4.b.).\n'),
(39898,'','','','ML8.  Energetic materials and related substances, as follows:\nML8.Technical Notes.1.  For the purposes of ML8., excluding ML8.c.11. or ML8.c.12., \'mixture\' refers to a composition of two or more substances with at least one substance being listed in the ML8 sub-items.\nML8.Technical Notes.2.  Any substance listed in the ML8 sub-items is subject to this list, even when utilised in an application other than that indicated.  (e.g., TAGN is predominantly used as an explosive but can also be used either as a fuel or an oxidizer.)\nML8.Technical Notes.3.  For the purposes of ML8., particle size is the mean particle diameter on a weight or volume basis.  International or equivalent national standards will be used in sampling and determining particle size.\nML8.c.  Pyrotechnics, fuels and related substances, as follows, and \'mixtures\' thereof:\nML8.c.11.  Pyrotechnic and pyrophoric materials as follows:\nML8.c.11.a.  Pyrotechnic or pyrophoric materials specifically formulated to enhance or control the production of radiated energy in any part of the IR spectrum;\nML8.Note 1.  ML8. does not apply to the following substances unless they are compounded or mixed with the \"energetic material\" specified by ML8.a. or powdered metals specified by ML8.c.:\nML8.Note 1.a.  Ammonium picrate (CAS 131-74-8);\nML8.Note 1.b.  Black powder;\nML8.Note 1.c.  Hexanitrodiphenylamine (CAS 131-73-7);\nML8.Note 1.d.  Difluoroamine (CAS 10405-27-3);\nML8.Note 1.e.  Nitrostarch (CAS 9056-38-6);\nML8.Note 1.f.  Potassium nitrate (CAS 7757-79-1);\nML8.Note 1.g.  Tetranitronaphthalene;\nML8.Note 1.h.  Trinitroanisol;\nML8.Note 1.i.  Trinitronaphthalene;\nML8.Note 1.j.  Trinitroxylene;\nML8.Note 1.k.  N-pyrrolidinone; 1-methyl-2-pyrrolidinone (CAS 872-50-4);\nML8.Note 1.l.  Dioctylmaleate (CAS 142-16-5);\nML8.Note 1.m.  Ethylhexylacrylate (CAS 103-11-7);\nML8.Note 1.n.  Triethylaluminium (TEA) (CAS 97-93-8), trimethylaluminium (TMA) (CAS 75-24-1), and other pyrophoric metal alkyls and aryls of lithium, sodium, magnesium, zinc or boron;\nML8.Note 1.o.  Nitrocellulose (CAS 9004-70-0);\nML8.Note 1.p.  Nitroglycerin (or glyceroltrinitrate, trinitroglycerine) (NG) (CAS 55-63-0);\nML8.Note 1.q.  2,4,6-trinitrotoluene (TNT) (CAS 118-96-7);\nML8.Note 1.r.  Ethylenediaminedinitrate (EDDN) (CAS 20829-66-7);\nML8.Note 1.s.  Pentaerythritoltetranitrate (PETN) (CAS 78-11-5);\nML8.Note 1.t.  Lead azide (CAS 13424-46-9), normal lead styphnate (CAS 15245-44-0) and basic lead styphnate (CAS 12403-82-6), and primary explosives or priming compositions containing azides or azide complexes;\nML8.Note 1.u.  Triethyleneglycoldinitrate (TEGDN) (CAS 111-22-8);\nML8.Note 1.v.  2,4,6-trinitroresorcinol (styphnic acid) (CAS 82-71-3);\nML8.Note 1.w.  Diethyldiphenylurea; (CAS 85-98-3); dimethyldiphenylurea;\nML8.Note 1.w.  (CAS 611-92-7), methylethyldiphenylurea; [Centralites]\nML8.Note 1.x.  N,N-diphenylurea (unsymmetrical diphenylurea) (CAS 603-54-3);\nML8.Note 1.y.  Methyl-N,N-diphenylurea (methyl unsymmetrical diphenylurea)\nML8.Note 1.y.  (CAS 13114-72-2);\nML8.Note 1.z.  Ethyl-N,N-diphenylurea (ethyl unsymmetrical diphenylurea)\nML8.Note 1.z.  (CAS 64544-71-4);\nML8.Note 1.aa.  2-Nitrodiphenylamine (2-NDPA) (CAS 119-75-5);\nML8.Note 1.bb.  4-Nitrodiphenylamine (4-NDPA) (CAS 836-30-6);\nML8.Note 1.cc.  2,2-dinitropropanol (CAS 918-52-5);\nML8.Note 1.dd.  Nitroguanidine (CAS 556-88-7) (see 1.C.11.d. on the Dual-Use List).\nML8.Note 2.  ML8. does not apply to ammonium perchlorate (ML8.d.2.), NTO (ML8.a.18.) or catocene (ML8.f.4.b.), and meeting all of the following:\nML8.Note 2.a.  Specially shaped and formulated for civil-use gas generation devices;\nML8.Note 2.b.  Compounded or mixed, with non-active thermoset binders or plasticizers, and having a mass of less than 250 g;\nML8.Note 2.c.  Having a maximum of 80% ammonium perchlorate (ML8.d.2.) in mass of active material;\nML8.Note 2.d.  Having less than or equal to 4 g of NTO (ML8.a.18.); and\nML8.Note 2.e.  Having less than or equal to 1 g of catocene (ML8.f.4.b.).\n'),
