(39915,'','','','ML2.  Smooth-bore weapons with a calibre of 20 mm or more, other weapons or armament with a calibre greater than 12.7 mm (calibre 0.50 inches), projectors and accessories, as follows, and specially designed components therefor:\nML2.b.  Smoke, gas and pyrotechnic projectors or generators, specially designed or modified for military use;\nML2.Note  ML2.b. does not apply to signal pistols.\n'),
(39916,'','','','ML6.  Ground vehicles and components, as follows:\nML6.b.  Other ground vehicles and components, as follows:\nML6.b.2.  Components having all of the following:\nML6.b.2.b.  Providing ballistic protection equal to or better than level III (NIJ 0108.01, September 1985, or comparable national standard).\nML6.b.2.b.N.B.  See also ML13.a.\nML6.Note 1.  ML6. does not apply to civil vehicles designed or modified for transporting money or valuables.\nML6.Note 2.  ML6. does not apply to vehicles that meet all of the following;\nML6.Note 2.a.  Were manufactured before 1946;\nML6.Note 2.b.  Do not have items specified by the Munitions List and manufactured after 1945, except for reproductions of original components or accessories for the vehicle; and\nML6.Note 2.c.  Do not incorporate weapons specified in ML1., ML2. or ML4. unless they are inoperable and incapable of discharging a projectile.\n'),
