(39934,'','','','ML6.  Ground vehicles and components, as follows:\nML6.Note 1.  ML6. does not apply to civil vehicles designed or modified for transporting money or valuables.\nML6.Note 2.  ML6. does not apply to vehicles that meet all of the following;\nML6.Note 2.a.  Were manufactured before 1946;\nML6.Note 2.b.  Do not have items specified by the Munitions List and manufactured after 1945, except for reproductions of original components or accessories for the vehicle; and\nML6.Note 2.c.  Do not incorporate weapons specified in ML1., ML2. or ML4. unless they are inoperable and incapable of discharging a projectile.\n'),
(39935,'','','','ML8.  Energetic materials and related substances, as follows:\nML8.N.B.1.  See also 1.C.11. on the Dual-Use List.\nML8.N.B.2.  For charges and devices, see ML4 and 1.A.8. on the Dual-Use List.\nML8.Technical Notes.1.  For the purposes of ML8., excluding ML8.c.11. or ML8.c.12., \'mixture\' refers to a composition of two or more substances with at least one substance being listed in the ML8 sub-items.\nML8.Technical Notes.2.  Any substance listed in the ML8 sub-items is subject to this list, even when utilised in an application other than that indicated.  (e.g., TAGN is predominantly used as an explosive but can also be used either as a fuel or an oxidizer.)\nML8.Technical Notes.3.  For the purposes of ML8., particle size is the mean particle diameter on a weight or volume basis.  International or equivalent national standards will be used in sampling and determining particle size.\nML8.a.  Explosives as follows, and \'mixtures\' thereof:\nML8.a.1.  ADNBF (aminodinitrobenzofuroxan or 7-amino-4,6-dinitrobenzofurazane-1-oxide) (CAS 97096-78-1);\nML8.a.2.  BNCP (cis-bis (5-nitrotetrazolato) tetra amine-cobalt (III) perchlorate)\nML8.a.2.   (CAS 117412-28-9);\nML8.a.3.  CL-14 (diamino dinitrobenzofuroxan or 5,7-diamino-4,6-dinitrobenzofurazane-1-oxide ) (CAS 117907-74-1);\nML8.a.4.  CL-20 (HNIW or Hexanitrohexaazaisowurtzitane) (CAS 135285-90-4); chlathrates of CL-20 (see also ML8.g.3. and g.4. for its \"precursors\");\nML8.a.5.  CP (2-(5-cyanotetrazolato) penta amine-cobalt (III) perchlorate)\nML8.a.5.   (CAS 70247-32-4);\nML8.a.6.  DADE (1,1-diamino-2,2-dinitroethylene, FOX-7) (CAS 145250-81-3);\nML8.a.7.  DATB (diaminotrinitrobenzene) (CAS 1630-08-6);\nML8.a.8.  DDFP (1,4-dinitrodifurazanopiperazine);\nML8.a.9.  DDPO (2,6-diamino-3,5-dinitropyrazine-1-oxide, PZO) (CAS 194486-77-6);\nML8.a.10.  DIPAM (3,3-diamino-2,2,4,4,6,6-hexanitrobiphenyl or dipicramide)\nML8.a.10.   (CAS 17215-44-0);\nML8.a.11.  DNGU (DINGU or dinitroglycoluril) (CAS 55510-04-8);\nML8.a.12.  Furazans as follows:\nML8.a.12.a.  DAAOF (DAAF, DAAFox, or diaminoazoxyfurazan);\nML8.a.12.b.  DAAzF (diaminoazofurazan) (CAS 78644-90-3);\nML8.a.13.  HMX and derivatives (see also ML8.g.5. for its \"precursors\"), as follows:\nML8.a.13.a.  HMX (Cyclotetramethylenetetranitramine, octahydro-1,3,5,7-tetranitro-1,3,5,7-tetrazine, 1,3,5,7-tetranitro-1,3,5,7-tetraza-cyclooctane, octogen or octogene) (CAS 2691-41-0);\nML8.a.13.b.  difluoroaminated analogs of HMX;\nML8.a.13.c.  K-55 (2,4,6,8-tetranitro-2,4,6,8-tetraazabicyclo [3,3,0]-octanone-3, tetranitrosemiglycouril or keto-bicyclic HMX) (CAS 130256-72-3);\nML8.a.14.  HNAD (hexanitroadamantane) (CAS 143850-71-9);\nML8.a.15.  HNS (hexanitrostilbene) (CAS 20062-22-0);\nML8.a.16.  Imidazoles as follows:\nML8.a.16.a.  BNNII (Octahydro-2,5-bis(nitroimino)imidazo [4,5-d]imidazole);\nML8.a.16.b.  DNI (2,4-dinitroimidazole) (CAS 5213-49-0);\nML8.a.16.c.  FDIA (1-fluoro-2,4-dinitroimidazole);\nML8.a.16.d.  NTDNIA (N-(2-nitrotriazolo)-2,4-dinitroimidazole);\nML8.a.16.e.  PTIA (1-picryl-2,4,5-trinitroimidazole);\nML8.a.17.  NTNMH (1-(2-nitrotriazolo)-2-dinitromethylene hydrazine);\nML8.a.18.  NTO (ONTA or 3-nitro-1,2,4-triazol-5-one) (CAS 932-64-9);\nML8.a.19.  Polynitrocubanes with more than four nitro groups;\nML8.a.20.  PYX (2,6-Bis(picrylamino)-3,5-dinitropyridine) (CAS 38082-89-2);\nML8.a.21.  RDX and derivatives, as follows:\nML8.a.21.a.  RDX (cyclotrimethylenetrinitramine, cyclonite, T4, hexahydro-1,3,5-trinitro-1,3,5-triazine, 1,3,5-trinitro-1,3,5-triaza-cyclohexane, hexogen or hexogene) (CAS 121-82-4);\nML8.a.21.b.  Keto-RDX (K-6 or 2,4,6-trinitro-2,4,6-triazacyclohexanone)\nML8.a.21.b.  (CAS 115029-35-1);\nML8.a.22.  TAGN (triaminoguanidinenitrate) (CAS 4000-16-2);\nML8.a.23.  TATB (triaminotrinitrobenzene) (CAS 3058-38-6) (see also ML8.g.7 for its \"precursors\");\nML8.a.24.  TEDDZ (3,3,7,7-tetrabis(difluoroamine) octahydro-1,5-dinitro-1,5-diazocine);\nML8.a.25.  Tetrazoles as follows:\nML8.a.25.a.  NTAT (nitrotriazol aminotetrazole);\nML8.a.25.b.  NTNT (1-N-(2-nitrotriazolo)-4-nitrotetrazole);\nML8.a.26.  Tetryl (trinitrophenylmethylnitramine) (CAS 479-45-8);\nML8.a.27.  TNAD (1,4,5,8-tetranitro-1,4,5,8-tetraazadecalin) (CAS 135877-16-6)\nML8.a.27.  (see also ML8.g.6. for its \"precursors\");\nML8.a.28.  TNAZ (1,3,3-trinitroazetidine) (CAS 97645-24-4)\nML8.a.28.  (see also ML8.g.2. for its \"precursors\");\nML8.a.29.  TNGU (SORGUYL or tetranitroglycoluril) (CAS 55510-03-7);\nML8.a.30.  TNP (1,4,5,8-tetranitro-pyridazino[4,5-d]pyridazine) (CAS 229176-04-9);\nML8.a.31.  Triazines as follows:\nML8.a.31.a.  DNAM (2-oxy-4,6-dinitroamino-s-triazine) (CAS 19899-80-0);\nML8.a.31.b.  NNHT (2-nitroimino-5-nitro-hexahydro-1,3,5-triazine)\nML8.a.31.b.  (CAS 130400-13-4);\nML8.a.32.  Triazoles as follows:\nML8.a.32.a.  5-azido-2-nitrotriazole;\nML8.a.32.b.  ADHTDN (4-amino-3,5-dihydrazino-1,2,4-triazole dinitramide)\nML8.a.32.b.  (CAS 1614-08-0);\nML8.a.32.c.  ADNT (1-amino-3,5-dinitro-1,2,4-triazole);\nML8.a.32.d.  BDNTA ((bis-dinitrotriazole)amine);\nML8.a.32.e.  DBT (3,3-dinitro-5,5-bi-1,2,4-triazole) (CAS 30003-46-4);\nML8.a.32.f.  DNBT (dinitrobistriazole) (CAS 70890-46-9);\nML8.a.32.g.  Not used since 2010\nML8.a.32.h.  NTDNT (1-N-(2-nitrotriazolo) 3,5-dinitrotriazole);\nML8.a.32.i.  PDNT (1-picryl-3,5-dinitrotriazole);\nML8.a.32.j.  TACOT (tetranitrobenzotriazolobenzotriazole) (CAS 25243-36-1);\nML8.a.33.  Explosives not listed elsewhere in ML8.a. and having any of the following:\nML8.a.33.a.  Detonation velocity exceeding 8,700 m/s, at maximum density, or\nML8.a.33.b.  Detonation pressure exceeding 34 GPa (340 kbar);\nML8.a.34.  Not used since 2013\nML8.a.35.  DNAN (2,4-dinitroanisole) (CAS 119-27-7);\nML8.a.36.  TEX (4,10-Dinitro-2,6,8,12-tetraoxa-4,10-diazaisowurtzitane);\nML8.a.37.  GUDN (Guanylurea dinitramide) FOX-12 (CAS 217464-38-5);\nML8.a.38.  Tetrazines as follows:\nML8.a.38.a.  BTAT (Bis(2,2,2-trinitroethyl)-3,6-diaminotetrazine);\nML8.a.38.b.  LAX-112 (3,6-diamino-1,2,4,5-tetrazine-1,4-dioxide);\nML8.a.39.  Energetic ionic materials melting between 343 K (70°C) and 373 K (100°C) and with detonation velocity exceeding 6,800 m/s or detonation pressure exceeding 18 GPa (180 kbar);\nML8.a.40.  BTNEN (Bis(2,2,2-trinitroethyl)-nitramine) (CAS 19836-28-3);\nML8.a.41.  FTDO (5,6-(3\',4\'-furazano)- 1,2,3,4-tetrazine-1,3-dioxide);\nML8.a.42.  EDNA (Ethylenedinitramine) (CAS 505-71-5);\nML8.a.43.  TKX-50 (Dihydroxylammonium 5,5\'-bistetrazole-1,1\'-diolate);\nML8.a.Note.  ML8.a. includes \'explosive co-crystals\'.\nML8.a.Note.Technical Note.  An \'explosive co-crystal\' is a solid material consisting of an ordered three dimensional arrangement of two or more explosive molecules, where at least one is specified in ML8.a.\nML8.b.  Propellants as follows:\nML8.b.1.  Any solid \"propellant\" with a theoretical specific impulse (under standard conditions) of more than:\nML8.b.1.a.  240 seconds for non-metallized, non-halogenized \"propellant\";\nML8.b.1.b.  250 seconds for non-metallized, halogenized \"propellant\"; or\nML8.b.1.c.  260 seconds for metallized \"propellant\";\nML8.b.2.  Not used since 2013\nML8.b.3.  Propellants having a force constant of more than 1,200 kJ/kg;\nML8.b.4.  Propellants that can sustain a steady-state linear burning rate of more than 38 mm/s under standard conditions (as measured in the form of an inhibited single strand) of 6.89 MPa (68.9 bar) pressure and 294K (21oC);\nML8.b.5.  Elastomer Modified Cast Double Base (EMCDB) \"propellants\" with extensibility at maximum stress of more than 5% at 233K (-40oC);\nML8.b.6.  Any \"propellant\" containing substances specified by ML8.a.;\nML8.b.7.  Propellants, not specified elsewhere in the Munitions List, specially designed for military use;\nML8.c.  Pyrotechnics, fuels and related substances, as follows, and \'mixtures\' thereof:\nML8.c.1.  Aircraft fuels specially formulated for military purposes;\nML8.c.1.Note 1.  ML8.c.1. does not apply to the following \"aircraft\" fuels: JP-4, \nML8.c.1.Note 1.  JP-5, and JP-8.\nML8.c.1.Note 2.  Aircraft fuels specified by ML8.c.1. are finished products, not their constituents.\nML8.c.2.  Alane (aluminium hydride) (CAS 7784-21-6);\nML8.c.3.  Boranes, as follows, and their derivatives:\nML8.c.3.a.  Carboranes;\nML8.c.3.b.  Borane homologues, as follows:\nML8.c.3.b.1.  Decaborane (14) (CAS 17702-41-9);\nML8.c.3.b.2.  Pentaborane (9) (CAS 19624-22-7);\nML8.c.3.b.3.  Pentaborane (11) (CAS 18433-84-6);\nML8.c.3.b.4.  Hydrazine and derivatives, as follows (see also ML8.d.8. and d.9. for oxidising hydrazine derivatives):\nML8.c.3.b.4.a.  Hydrazine (CAS 302-01-2) in concentrations of 70% or more;\nML8.c.3.b.4.b.  Monomethyl hydrazine (CAS 60-34-4);\nML8.c.3.b.4.c.  Symmetrical dimethyl hydrazine (CAS 540-73-8);\nML8.c.3.b.4.d.  Unsymmetrical dimethyl hydrazine (CAS 57-14-7);\nML8.c.4.a.Note.  ML8.c.4.a. does not apply to hydrazine \'mixtures\' specially formulated for corrosion control.\nML8.c.5.  Metal fuels, fuel \'mixtures\' or \"pyrotechnic\" \'mixtures\', in particle form whether spherical, atomized, spheroidal, flaked or ground, manufactured from material consisting of 99 % or more of any of the following:\nML8.c.5.a.  Metals as follows and \'mixtures\' thereof:\nML8.c.5.a.1.  Beryllium (CAS 7440-41-7) in particle sizes of less than 60 µm;\nML8.c.5.a.2.  Iron powder (CAS 7439-89-6) with particle size of 3 µm or less produced by reduction of iron oxide with hydrogen;\nML8.c.5.b.  \'Mixtures\' containing any of the following:\nML8.c.5.b.1.  Zirconium (CAS 7440-67-7), magnesium (CAS 7439-95-4) or alloys of these in particle sizes of less than 60 µm; or\nML8.c.5.b.2.  Boron (CAS 7440-42-8) or boron carbide (CAS 12069-32-8) fuels of 85% purity or higher and particle sizes of less than 60 µm;\nML8.c.5.Note 1.  ML8.c.5 applies to \"explosives\" and fuels, whether or not the metals or alloys are encapsulated in aluminium, magnesium, zirconium, or beryllium.\nML8.c.5.b.Note 2.  ML8.c.5.b. only applies to metal fuels in particle form when they are mixed with other substances to form a \'mixture\' formulated for military purposes such as liquid \"propellant\" slurries, solid \"propellants\", or \"pyrotechnic\" \'mixtures\'.\nML8.c.5.b.2.Note 3.  ML8.c.5.b.2. does not apply to boron and boron carbide enriched with boron-10 (20% or more of total boron-10 content).\nML8.c.6.  Military materials, containing thickeners for hydrocarbon fuels, specially formulated for use in flame throwers or incendiary munitions, such as metal stearates (e.g., octal (CAS 637-12-7)) or palmitates;\nML8.c.7.  Perchlorates, chlorates and chromates, composited with powdered metal or other high energy fuel components;\nML8.c.8.  Spherical or spheroidal aluminium powder (CAS 7429-90-5) with a particle size of 60 µm or less and manufactured from material with an aluminium content of 99% or more;\nML8.c.9.  Titanium subhydride (TiHn) of stoichiometry equivalent to n= 0.65-1.68;\nML8.c.10.  Liquid high energy density fuels not specified in ML8.c.1., as follows:\nML8.c.10.a.  Mixed fuels, that incorporate both solid and liquid fuels (e.g., boron slurry), having a mass-based energy density of 40 MJ/kg or greater;\nML8.c.10.b.  Other high energy density fuels and fuel additives (e.g., cubane, ionic solutions, JP-7, JP-10), having a volume-based energy density of 37.5 GJ per cubic meter or greater, measured at 293 K (20⁰C) and one atmosphere (101.325 kPa) pressure;\nML8.c.10.b.Note.  ML8.c.10.b. does not apply to fossil refined fuels or biofuels, or fuels for engines certified for use in civil aviation.\nML8.c.11.  Pyrotechnic and pyrophoric materials as follows:\nML8.c.11.a.  Pyrotechnic or pyrophoric materials specifically formulated to enhance or control the production of radiated energy in any part of the IR spectrum;\nML8.c.11.b.  Mixtures of magnesium, polytetrafluoroethylene (PTFE) and a vinylidene difluoride-hexafluoropropylene copolymer (e.g., MTV);\nML8.c.12.  Fuel mixtures, \"pyrotechnic\" mixtures or \"energetic materials\", not specified elsewhere in ML8, having all of the following:\nML8.c.12.a.  Containing greater than 0.5% of particles of any of the following:\nML8.c.12.a.1.  Aluminium;\nML8.c.12.a.2.  Beryllium;\nML8.c.12.a.3.  Boron;\nML8.c.12.a.4.  Zirconium;\nML8.c.12.a.5.  Magnesium; or\nML8.c.12.a.6.  Titanium;\nML8.c.12.b.  Particles specified by ML8.c.12.a. with a size less than 200 nm in any direction; and\nML8.c.12.c.  Particles specified by ML8.c.12.a. with a metal content of 60% or greater;\nML8.c.12.Note.  ML8.c.12. includes thermites.\nML8.d.  Oxidizers as follows, and \'mixtures\' thereof:\nML8.d.1.  ADN (ammonium dinitramide or SR 12) (CAS 140456-78-6);\nML8.d.2.  AP (ammonium perchlorate) (CAS 7790-98-9);\nML8.d.3.  Compounds composed of fluorine and any of the following:\nML8.d.3.a.  Other halogens;\nML8.d.3.b.  Oxygen; or\nML8.d.3.c.  Nitrogen;\nML8.d.3.Note 1.  ML8.d.3. does not apply to chlorine trifluoride (CAS 7790-91-2).\nML8.d.3.Note 2.  ML8.d.3. does not apply to nitrogen trifluoride (CAS 7783-54-2) in its gaseous state.\nML8.d.4.  DNAD (1,3-dinitro-1,3-diazetidine) (CAS 78246-06-7);\nML8.d.5.  HAN (hydroxylammonium nitrate) (CAS 13465-08-2);\nML8.d.6.  HAP (hydroxylammonium perchlorate) (CAS 15588-62-2);\nML8.d.7.  HNF (hydrazinium nitroformate) (CAS 20773-28-8);\nML8.d.8.  Hydrazine nitrate (CAS 37836-27-4);\nML8.d.9.  Hydrazine perchlorate (CAS 27978-54-7);\nML8.d.10.  Liquid oxidisers comprised of or containing inhibited red fuming nitric acid (IRFNA) (CAS 8007-58-7);\nML8.d.10.Note.  ML8.d.10. does not apply to non-inhibited fuming nitric acid.\nML8.e.  Binders, plasticizers, monomers and polymers, as follows:\nML8.e.1.  AMMO (azidomethylmethyloxetane and its polymers) (CAS 90683-29-7)\nML8.e.1.  (see also ML8.g.1. for its \"precursors\");\nML8.e.2.  BAMO (3,3-bis(azidomethyl)oxetane and its polymers)\nML8.e.2.  (CAS 17607-20-4) (see also ML8.g.1. for its \"precursors\");\nML8.e.3.  BDNPA (bis (2,2-dinitropropyl)acetal) (CAS 5108-69-0);\nML8.e.4.  BDNPF (bis (2,2-dinitropropyl)formal) (CAS 5917-61-3);\nML8.e.5.  BTTN (butanetrioltrinitrate) (CAS 6659-60-5)\nML8.e.5.  (see also ML8.g.8. for its \"precursors\");\nML8.e.6.  Energetic monomers, plasticizers or polymers, specially formulated for military use and containing any of the following:\nML8.e.6.a.  Nitro groups;\nML8.e.6.b.  Azido groups;\nML8.e.6.c.  Nitrate groups;\nML8.e.6.d.  Nitraza groups; or\nML8.e.6.e.  Difluoroamino groups;\nML8.e.7.  FAMAO (3-difluoroaminomethyl-3-azidomethyl oxetane) and its polymers;\nML8.e.8.  FEFO (bis-(2-fluoro-2,2-dinitroethyl) formal) (CAS 17003-79-1);\nML8.e.9.  FPF-1 (poly-2,2,3,3,4,4-hexafluoropentane-1,5-diol formal) (CAS 376-90-9);\nML8.e.10.  FPF-3 (poly-2,4,4,5,5,6,6-heptafluoro-2-tri-fluoromethyl-3-oxaheptane-1,7-diol formal);\nML8.e.11.  GAP (glycidylazide polymer) (CAS 143178-24-9) and its derivatives;\nML8.e.12.  HTPB (hydroxyl terminated polybutadiene) with a hydroxyl functionality equal to or greater than 2.2 and less than or equal to 2.4, a hydroxyl value of less than 0.77 meq/g, and a viscosity at 30°C of less than 47 poise\nML8.e.12.  (CAS 69102-90-5);\nML8.e.13.  Alcohol functionalised poly(epichlorohydrin) with a molecular weight less than 10,000, as follows:\nML8.e.13.a.  Poly(epichlorohydrindiol);\nML8.e.13.b.  Polsy(epichlorohydrintriol).\nML8.e.14.  NENAs (nitratoethylnitramine compounds) (CAS 17096-47-8, 85068-73-1, 82486-83-7, 82486-82-6 and 85954-06-9);\nML8.e.15.  PGN (poly-GLYN, polyglycidylnitrate or poly(nitratomethyl oxirane)) (CAS 27814-48-8);\nML8.e.16.  Poly-NIMMO (poly (nitratomethylmethyloxetane), poly-NMMO or poly(3-Nitratomethyl-3-methyloxetane)) (CAS 84051-81-0);\nML8.e.17.  Polynitroorthocarbonates;\nML8.e.18.  TVOPA (1,2,3-tris[1,2-bis(difluoroamino)ethoxy] propane or tris vinoxy propane adduct) (CAS 53159-39-0);\nML8.e.19.  4,5 diazidomethyl-2-methyl-1,2,3-triazole (iso- DAMTR);\nML8.e.20.  PNO (Poly(3-nitrato oxetane));\nML8.e.21.  TMETN (Trimethylolethane trinitrate) (CAS 3032-55-1);\nML8.f.  Additives as follows:\nML8.f.1.  Basic copper salicylate (CAS 62320-94-9);\nML8.f.2.  BHEGA (bis-(2-hydroxyethyl) glycolamide) (CAS 17409-41-5);\nML8.f.3.  BNO (butadienenitrileoxide);\nML8.f.4.  Ferrocene derivatives as follows:\nML8.f.4.a.  Butacene (CAS 125856-62-4);\nML8.f.4.b.  Catocene (2,2-bis-ethylferrocenyl propane) (CAS 37206-42-1);\nML8.f.4.c.  Ferrocene carboxylic acids and ferrocene carboxylic acid esters;\nML8.f.4.d.  n-butyl-ferrocene (CAS 31904-29-7);\nML8.f.4.e.  Other adducted polymer ferrocene derivatives not specified elsewhere in ML8.f.4.;\nML8.f.4.f.  Ethyl ferrocene (CAS 1273-89-8);\nML8.f.4.g.  Propyl ferrocene;\nML8.f.4.h.  Pentyl ferrocene (CAS 1274-00-6);\nML8.f.4.i.  Dicyclopentyl ferrocene;\nML8.f.4.j.  Dicyclohexyl ferrocene;\nML8.f.4.k.  Diethyl ferrocene (CAS 1273-97-8);\nML8.f.4.l.  Dipropyl ferrocene;\nML8.f.4.m.  Dibutyl ferrocene (CAS 1274-08-4);\nML8.f.4.n.  Dihexyl ferrocene (CAS 93894-59-8);\nML8.f.4.o.  Acetyl ferrocene (CAS 1271-55-2)/1,1’-diacetyl ferrocene\nML8.f.4.o.  (CAS 1273-94-5);\nML8.f.5.  Lead beta-resorcylate (CAS 20936-32-7) or copper beta-resorcylate\nML8.f.5.  (CAS 70983-44-7);\nML8.f.6.  Lead citrate (CAS 14450-60-3);\nML8.f.7.  Lead-copper chelates of beta-resorcylate or salicylates (CAS 68411-07-4);\nML8.f.8.  Lead maleate (CAS 19136-34-6);\nML8.f.9.  Lead salicylate (CAS 15748-73-9);\nML8.f.10.  Lead stannate (CAS 12036-31-6);\nML8.f.11.  MAPO (tris-1-(2-methyl)aziridinyl phosphine oxide)\nML8.f.11.  (CAS 57-39-6); BOBBA 8 (bis(2-methyl aziridinyl) 2-(2-hydroxypropanoxy) propylamino phosphine oxide); and other MAPO derivatives;\nML8.f.12.  Methyl BAPO (bis(2-methyl aziridinyl) methylamino phosphine oxide) (CAS 85068-72-0);\nML8.f.13.  N-methyl-p-nitroaniline (CAS 100-15-2);\nML8.f.14.  3-Nitraza-1,5-pentane diisocyanate (CAS 7406-61-9);\nML8.f.15.  Organo-metallic coupling agents as follows:\nML8.f.15.a.  Neopentyl[diallyl]oxy, tri[dioctyl]phosphato-t