(40052,'','','','ML5.  Fire control, surveillance and warning equipment, and related systems, test and alignment and countermeasure equipment, as follows, specially designed for military use, and specially designed components and accessories therefor:\nML5.a.  Weapon sights, bombing computers, gun laying equipment and weapon control systems;\nML5.b.  Other fire control, surveillance and warning equipment, and related systems, as follows:\nML5.b.1.  Target acquisition, designation, range-finding, surveillance or tracking systems;\nML5.b.2.  Detection, recognition or identification equipment;\nML5.b.3.  Data fusion or sensor integration equipment;\nML5.c.  Countermeasure equipment for items specified by ML5.a. or ML5.b.;\nML5.c.Note.  For the purposes of ML5.c., countermeasure equipment includes detection equipment.\nML5.d.  Field test or alignment equipment, specially designed for items specified by ML5.a., ML5.b. or ML5.c.\n'),
