(40286,'','','','ML21.  Software as follows:\nML21.b.  Specific \"software\", other than that specified by ML21.a., as follows:\nML21.b.2.  Software specially designed for military use and specially designed for modelling or simulating military operational scenarios;\n'),
(40287,'','','','ML4.  Bombs, torpedoes, rockets, missiles, other explosive devices and charges and related equipment and accessories, as follows, and specially designed components therefor:\nML4.N.B.2.  For Aircraft Missile Protection Systems (AMPS), see ML4.c.\n'),
(40288,'','','','ML9.  Vessels of war (surface or underwater), special naval equipment, accessories, components and other surface vessels, as follows:\nML9.b.  Engines and propulsion systems, as follows, specially designed for military use and components therefor specially designed for military use:\nML9.b.3.  Diesel engines having all of the following:\nML9.b.3.b.  \'Non-magnetic\' content in excess of 75% of total mass;\nML9.b.3.b.Technical Note.  For the purposes of ML9.b.3., \'non-magnetic\' means the relative permeability is less than 2.\n'),
(40289,'','','','ML8.  Energetic materials and related substances, as follows:\nML8.Technical Notes.1.  For the purposes of ML8., excluding ML8.c.11. or ML8.c.12., \'mixture\' refers to a composition of two or more substances with at least one substance being listed in the ML8 sub-items.\nML8.Technical Notes.2.  Any substance listed in the ML8 sub-items is subject to this list, even when utilised in an application other than that indicated.  (e.g., TAGN is predominantly used as an explosive but can also be used either as a fuel or an oxidizer.)\nML8.Technical Notes.3.  For the purposes of ML8., particle size is the mean particle diameter on a weight or volume basis.  International or equivalent national standards will be used in sampling and determining particle size.\nML8.f.  Additives as follows:\nML8.f.4.  Ferrocene derivatives as follows:\nML8.f.4.j.  Dicyclohexyl ferrocene;\nML8.Note 1.  ML8. does not apply to the following substances unless they are compounded or mixed with the \"energetic material\" specified by ML8.a. or powdered metals specified by ML8.c.:\nML8.Note 1.a.  Ammonium picrate (CAS 131-74-8);\nML8.Note 1.b.  Black powder;\nML8.Note 1.c.  Hexanitrodiphenylamine (CAS 131-73-7);\nML8.Note 1.d.  Difluoroamine (CAS 10405-27-3);\nML8.Note 1.e.  Nitrostarch (CAS 9056-38-6);\nML8.Note 1.f.  Potassium nitrate (CAS 7757-79-1);\nML8.Note 1.g.  Tetranitronaphthalene;\nML8.Note 1.h.  Trinitroanisol;\nML8.Note 1.i.  Trinitronaphthalene;\nML8.Note 1.j.  Trinitroxylene;\nML8.Note 1.k.  N-pyrrolidinone; 1-methyl-2-pyrrolidinone (CAS 872-50-4);\nML8.Note 1.l.  Dioctylmaleate (CAS 142-16-5);\nML8.Note 1.m.  Ethylhexylacrylate (CAS 103-11-7);\nML8.Note 1.n.  Triethylaluminium (TEA) (CAS 97-93-8), trimethylaluminium (TMA) (CAS 75-24-1), and other pyrophoric metal alkyls and aryls of lithium, sodium, magnesium, zinc or boron;\nML8.Note 1.o.  Nitrocellulose (CAS 9004-70-0);\nML8.Note 1.p.  Nitroglycerin (or glyceroltrinitrate, trinitroglycerine) (NG) (CAS 55-63-0);\nML8.Note 1.q.  2,4,6-trinitrotoluene (TNT) (CAS 118-96-7);\nML8.Note 1.r.  Ethylenediaminedinitrate (EDDN) (CAS 20829-66-7);\nML8.Note 1.s.  Pentaerythritoltetranitrate (PETN) (CAS 78-11-5);\nML8.Note 1.t.  Lead azide (CAS 13424-46-9), normal lead styphnate (CAS 15245-44-0) and basic lead styphnate (CAS 12403-82-6), and primary explosives or priming compositions containing azides or azide complexes;\nML8.Note 1.u.  Triethyleneglycoldinitrate (TEGDN) (CAS 111-22-8);\nML8.Note 1.v.  2,4,6-trinitroresorcinol (styphnic acid) (CAS 82-71-3);\nML8.Note 1.w.  Diethyldiphenylurea; (CAS 85-98-3); dimethyldiphenylurea;\nML8.Note 1.w.  (CAS 611-92-7), methylethyldiphenylurea; [Centralites]\nML8.Note 1.x.  N,N-diphenylurea (unsymmetrical diphenylurea) (CAS 603-54-3);\nML8.Note 1.y.  Methyl-N,N-diphenylurea (methyl unsymmetrical diphenylurea)\nML8.Note 1.y.  (CAS 13114-72-2);\nML8.Note 1.z.  Ethyl-N,N-diphenylurea (ethyl unsymmetrical diphenylurea)\nML8.Note 1.z.  (CAS 64544-71-4);\nML8.Note 1.aa.  2-Nitrodiphenylamine (2-NDPA) (CAS 119-75-5);\nML8.Note 1.bb.  4-Nitrodiphenylamine (4-NDPA) (CAS 836-30-6);\nML8.Note 1.cc.  2,2-dinitropropanol (CAS 918-52-5);\nML8.Note 1.dd.  Nitroguanidine (CAS 556-88-7) (see 1.C.11.d. on the Dual-Use List).\nML8.Note 2.  ML8. does not apply to ammonium perchlorate (ML8.d.2.), NTO (ML8.a.18.) or catocene (ML8.f.4.b.), and meeting all of the following:\nML8.Note 2.a.  Specially shaped and formulated for civil-use gas generation devices;\nML8.Note 2.b.  Compounded or mixed, with non-active thermoset binders or plasticizers, and having a mass of less than 250 g;\nML8.Note 2.c.  Having a maximum of 80% ammonium perchlorate (ML8.d.2.) in mass of active material;\nML8.Note 2.d.  Having less than or equal to 4 g of NTO (ML8.a.18.); and\nML8.Note 2.e.  Having less than or equal to 1 g of catocene (ML8.f.4.b.).\n'),
(40290,'','','','ML4.  Bombs, torpedoes, rockets, missiles, other explosive devices and charges and related equipment and accessories, as follows, and specially designed components therefor:\nML4.b.  Equipment having all of the following:\nML4.b.1.  Specially designed for military use; and\nML4.b.Note 1.  ML4.b. includes:\nML4.b.Note 1.a.  Mobile gas liquefying equipment capable of producing 1,000 kg or more per day of gas in liquid form;\nML4.b.Note 1.b.  Buoyant electric conducting cable suitable for sweeping magnetic mines.\nML4.b.Note 2.  ML4.b. does not apply to hand-held devices limited by design solely to the detection of metal objects and incapable of distinguishing between mines and other metal objects.\n'),
