(40295,'','','','ML19.  Directed Energy Weapon (DEW) systems, related or countermeasure equipment and test models, as follows, and specially designed components therefor:\nML19.e.  Physical test models for the systems, equipment and components, specified by ML19.\nML19.Note 1.  DEW systems specified by ML19. include systems whose capability is derived from the controlled application of:\nML19.Note 1.a.  Lasers of sufficient power to effect destruction similar to the manner of conventional ammunition;\nML19.Note 1.b.  Particle accelerators which project a charged or neutral particle beam with destructive power;\nML19.Note 1.c.  High pulsed power or high average power radio frequency beam transmitters, which produce fields sufficiently intense to disable electronic circuitry at a distant target.\nML19.Note 2.  ML19. includes the following when specially designed for DEW systems:\nML19.Note 2.a.  Prime power generation, energy storage, switching, power conditioning or fuel-handling equipment;\nML19.Note 2.b.  Target acquisition or tracking systems;\nML19.Note 2.c.  Systems capable of assessing target damage, destruction or mission-abort;\nML19.Note 2.d.  Beam-handling, propagation or pointing equipment;\nML19.Note 2.e.  Equipment with rapid beam slew capability for rapid multiple target operations;\nML19.Note 2.f.  Adaptive optics and phase conjugators;\nML19.Note 2.g.  Current injectors for negative hydrogen ion beams;\nML19.Note 2.h.  Space-qualified accelerator components;\nML19.Note 2.i.  Negative ion beam funnelling equipment;\nML19.Note 2.j.  Equipment for controlling and slewing a high energy ion beam;\nML19.Note 2.k.  Space-qualified foils for neutralising negative hydrogen isotope beams.\n'),
(40296,'','','','ML8.  Energetic materials and related substances, as follows:\nML8.Technical Notes.1.  For the purposes of ML8., excluding ML8.c.11. or ML8.c.12., \'mixture\' refers to a composition of two or more substances with at least one substance being listed in the ML8 sub-items.\nML8.Technical Notes.2.  Any substance listed in the ML8 sub-items is subject to this list, even when utilised in an application other than that indicated.  (e.g., TAGN is predominantly used as an explosive but can also be used either as a fuel or an oxidizer.)\nML8.Technical Notes.3.  For the purposes of ML8., particle size is the mean particle diameter on a weight or volume basis.  International or equivalent national standards will be used in sampling and determining particle size.\nML8.a.  Explosives as follows, and \'mixtures\' thereof:\nML8.a.32.  Triazoles as follows:\nML8.a.32.h.  NTDNT (1-N-(2-nitrotriazolo) 3,5-dinitrotriazole);\nML8.a.Note.  ML8.a. includes \'explosive co-crystals\'.\nML8.a.Note.Technical Note.  An \'explosive co-crystal\' is a solid material consisting of an ordered three dimensional arrangement of two or more explosive molecules, where at least one is specified in ML8.a.\nML8.Note 1.  ML8. does not apply to the following substances unless they are compounded or mixed with the \"energetic material\" specified by ML8.a. or powdered metals specified by ML8.c.:\nML8.Note 1.a.  Ammonium picrate (CAS 131-74-8);\nML8.Note 1.b.  Black powder;\nML8.Note 1.c.  Hexanitrodiphenylamine (CAS 131-73-7);\nML8.Note 1.d.  Difluoroamine (CAS 10405-27-3);\nML8.Note 1.e.  Nitrostarch (CAS 9056-38-6);\nML8.Note 1.f.  Potassium nitrate (CAS 7757-79-1);\nML8.Note 1.g.  Tetranitronaphthalene;\nML8.Note 1.h.  Trinitroanisol;\nML8.Note 1.i.  Trinitronaphthalene;\nML8.Note 1.j.  Trinitroxylene;\nML8.Note 1.k.  N-pyrrolidinone; 1-methyl-2-pyrrolidinone (CAS 872-50-4);\nML8.Note 1.l.  Dioctylmaleate (CAS 142-16-5);\nML8.Note 1.m.  Ethylhexylacrylate (CAS 103-11-7);\nML8.Note 1.n.  Triethylaluminium (TEA) (CAS 97-93-8), trimethylaluminium (TMA) (CAS 75-24-1), and other pyrophoric metal alkyls and aryls of lithium, sodium, magnesium, zinc or boron;\nML8.Note 1.o.  Nitrocellulose (CAS 9004-70-0);\nML8.Note 1.p.  Nitroglycerin (or glyceroltrinitrate, trinitroglycerine) (NG) (CAS 55-63-0);\nML8.Note 1.q.  2,4,6-trinitrotoluene (TNT) (CAS 118-96-7);\nML8.Note 1.r.  Ethylenediaminedinitrate (EDDN) (CAS 20829-66-7);\nML8.Note 1.s.  Pentaerythritoltetranitrate (PETN) (CAS 78-11-5);\nML8.Note 1.t.  Lead azide (CAS 13424-46-9), normal lead styphnate (CAS 15245-44-0) and basic lead styphnate (CAS 12403-82-6), and primary explosives or priming compositions containing azides or azide complexes;\nML8.Note 1.u.  Triethyleneglycoldinitrate (TEGDN) (CAS 111-22-8);\nML8.Note 1.v.  2,4,6-trinitroresorcinol (styphnic acid) (CAS 82-71-3);\nML8.Note 1.w.  Diethyldiphenylurea; (CAS 85-98-3); dimethyldiphenylurea;\nML8.Note 1.w.  (CAS 611-92-7), methylethyldiphenylurea; [Centralites]\nML8.Note 1.x.  N,N-diphenylurea (unsymmetrical diphenylurea) (CAS 603-54-3);\nML8.Note 1.y.  Methyl-N,N-diphenylurea (methyl unsymmetrical diphenylurea)\nML8.Note 1.y.  (CAS 13114-72-2);\nML8.Note 1.z.  Ethyl-N,N-diphenylurea (ethyl unsymmetrical diphenylurea)\nML8.Note 1.z.  (CAS 64544-71-4);\nML8.Note 1.aa.  2-Nitrodiphenylamine (2-NDPA) (CAS 119-75-5);\nML8.Note 1.bb.  4-Nitrodiphenylamine (4-NDPA) (CAS 836-30-6);\nML8.Note 1.cc.  2,2-dinitropropanol (CAS 918-52-5);\nML8.Note 1.dd.  Nitroguanidine (CAS 556-88-7) (see 1.C.11.d. on the Dual-Use List).\nML8.Note 2.  ML8. does not apply to ammonium perchlorate (ML8.d.2.), NTO (ML8.a.18.) or catocene (ML8.f.4.b.), and meeting all of the following:\nML8.Note 2.a.  Specially shaped and formulated for civil-use gas generation devices;\nML8.Note 2.b.  Compounded or mixed, with non-active thermoset binders or plasticizers, and having a mass of less than 250 g;\nML8.Note 2.c.  Having a maximum of 80% ammonium perchlorate (ML8.d.2.) in mass of active material;\nML8.Note 2.d.  Having less than or equal to 4 g of NTO (ML8.a.18.); and\nML8.Note 2.e.  Having less than or equal to 1 g of catocene (ML8.f.4.b.).\n'),
(40297,'','','','ML7.  Chemical agents, \"biological agents\", \"riot control agents\", radioactive materials, related equipment, components and materials, as follows:\nML7.b.  Chemical warfare (CW) agents, including:\nML7.b.3.  CW incapacitating agents, such as:\nML7.b.3.a.  3-Quinuclidinyl benzilate (BZ) (CAS 6581-06-2);\nML7.Note 1.  ML7.b. and ML7.d. do not apply to the following:\nML7.Note 1.a.  Cyanogen chloride (CAS 506-77-4);\nML7.Note 1.b.  Hydrocyanic acid (CAS 74-90-8);\nML7.Note 1.c.  Chlorine (CAS 7782-50-5);\nML7.Note 1.d.  Carbonyl chloride (phosgene) (CAS 75-44-5);\nML7.Note 1.e.  Diphosgene (trichloromethyl-chloroformate) (CAS 503-38-8);\nML7.Note 1.f.  Not used since 2004\nML7.Note 1.g.  Xylyl bromide, ortho: (CAS 89-92-9), meta: (CAS 620-13-3), para: (CAS 104-81-4);\nML7.Note 1.h.  Benzyl bromide (CAS 100-39-0);\nML7.Note 1.i.  Benzyl iodide (CAS 620-05-3);\nML7.Note 1.j.  Bromo acetone (CAS 598-31-2);\nML7.Note 1.k.  Cyanogen bromide (CAS 506-68-3);\nML7.Note 1.l.  Bromo methylethylketone (CAS 816-40-0);\nML7.Note 1.m.  Chloro acetone (CAS 78-95-5);\nML7.Note 1.n.  Ethyl iodoacetate (CAS 623-48-3);\nML7.Note 1.o.  Iodo acetone (CAS 3019-04-3);\nML7.Note 1.p.  Chloropicrin (CAS 76-06-2).\nML7.Note 2  The cultures of cells and biological systems specified by ML7.h. and ML7.i.2. are exclusive and these sub-items do not apply to cells or biological systems for civil purposes, such as agricultural, pharmaceutical, medical, veterinary, environmental, waste management, or in the food industry.\n'),
(40298,'','','','ML8.  Energetic materials and related substances, as follows:\nML8.Technical Notes.1.  For the purposes of ML8., excluding ML8.c.11. or ML8.c.12., \'mixture\' refers to a composition of two or more substances with at least one substance being listed in the ML8 sub-items.\nML8.Technical Notes.2.  Any substance listed in the ML8 sub-items is subject to this list, even when utilised in an application other than that indicated.  (e.g., TAGN is predominantly used as an explosive but can also be used either as a fuel or an oxidizer.)\nML8.Technical Notes.3.  For the purposes of ML8., particle size is the mean particle diameter on a weight or volume basis.  International or equivalent national standards will be used in sampling and determining particle size.\nML8.e.  Binders, plasticizers, monomers and polymers, as follows:\nML8.e.5.  BTTN (butanetrioltrinitrate) (CAS 6659-60-5)\nML8.e.5.  (see also ML8.g.8. for its \"precursors\");\nML8.Note 1.  ML8. does not apply to the following substances unless they are compounded or mixed with the \"energetic material\" specified by ML8.a. or powdered metals specified by ML8.c.:\nML8.Note 1.a.  Ammonium picrate (CAS 131-74-8);\nML8.Note 1.b.  Black powder;\nML8.Note 1.c.  Hexanitrodiphenylamine (CAS 131-73-7);\nML8.Note 1.d.  Difluoroamine (CAS 10405-27-3);\nML8.Note 1.e.  Nitrostarch (CAS 9056-38-6);\nML8.Note 1.f.  Potassium nitrate (CAS 7757-79-1);\nML8.Note 1.g.  Tetranitronaphthalene;\nML8.Note 1.h.  Trinitroanisol;\nML8.Note 1.i.  Trinitronaphthalene;\nML8.Note 1.j.  Trinitroxylene;\nML8.Note 1.k.  N-pyrrolidinone; 1-methyl-2-pyrrolidinone (CAS 872-50-4);\nML8.Note 1.l.  Dioctylmaleate (CAS 142-16-5);\nML8.Note 1.m.  Ethylhexylacrylate (CAS 103-11-7);\nML8.Note 1.n.  Triethylaluminium (TEA) (CAS 97-93-8), trimethylaluminium (TMA) (CAS 75-24-1), and other pyrophoric metal alkyls and aryls of lithium, sodium, magnesium, zinc or boron;\nML8.Note 1.o.  Nitrocellulose (CAS 9004-70-0);\nML8.Note 1.p.  Nitroglycerin (or glyceroltrinitrate, trinitroglycerine) (NG) (CAS 55-63-0);\nML8.Note 1.q.  2,4,6-trinitrotoluene (TNT) (CAS 118-96-7);\nML8.Note 1.r.  Ethylenediaminedinitrate (EDDN) (CAS 20829-66-7);\nML8.Note 1.s.  Pentaerythritoltetranitrate (PETN) (CAS 78-11-5);\nML8.Note 1.t.  Lead azide (CAS 13424-46-9), normal lead styphnate (CAS 15245-44-0) and basic lead styphnate (CAS 12403-82-6), and primary explosives or priming compositions containing azides or azide complexes;\nML8.Note 1.u.  Triethyleneglycoldinitrate (TEGDN) (CAS 111-22-8);\nML8.Note 1.v.  2,4,6-trinitroresorcinol (styphnic acid) (CAS 82-71-3);\nML8.Note 1.w.  Diethyldiphenylurea; (CAS 85-98-3); dimethyldiphenylurea;\nML8.Note 1.w.  (CAS 611-92-7), methylethyldiphenylurea; [Centralites]\nML8.Note 1.x.  N,N-diphenylurea (unsymmetrical diphenylurea) (CAS 603-54-3);\nML8.Note 1.y.  Methyl-N,N-diphenylurea (methyl unsymmetrical diphenylurea)\nML8.Note 1.y.  (CAS 13114-72-2);\nML8.Note 1.z.  Ethyl-N,N-diphenylurea (ethyl unsymmetrical diphenylurea)\nML8.Note 1.z.  (CAS 64544-71-4);\nML8.Note 1.aa.  2-Nitrodiphenylamine (2-NDPA) (CAS 119-75-5);\nML8.Note 1.bb.  4-Nitrodiphenylamine (4-NDPA) (CAS 836-30-6);\nML8.Note 1.cc.  2,2-dinitropropanol (CAS 918-52-5);\nML8.Note 1.dd.  Nitroguanidine (CAS 556-88-7) (see 1.C.11.d. on the Dual-Use List).\nML8.Note 2.  ML8. does not apply to ammonium perchlorate (ML8.d.2.), NTO (ML8.a.18.) or catocene (ML8.f.4.b.), and meeting all of the following:\nML8.Note 2.a.  Specially shaped and formulated for civil-use gas generation devices;\nML8.Note 2.b.  Compounded or mixed, with non-active thermoset binders or plasticizers, and having a mass of less than 250 g;\nML8.Note 2.c.  Having a maximum of 80% ammonium perchlorate (ML8.d.2.) in mass of active material;\nML8.Note 2.d.  Having less than or equal to 4 g of NTO (ML8.a.18.); and\nML8.Note 2.e.  Having less than or equal to 1 g of catocene (ML8.f.4.b.).\n'),
(40299,'','','','ML8.  Energetic materials and related substances, as follows:\nML8.Technical Notes.1.  For the purposes of ML8., excluding ML8.c.11. or ML8.c.12., \'mixture\' refers to a composition of two or more substances with at least one substance being listed in the ML8 sub-items.\nML8.Technical Notes.2.  Any substance listed in the ML8 sub-items is subject to this list, even when utilised in an application other than that indicated.  (e.g., TAGN is predominantly used as an explosive but can also be used either as a fuel or an oxidizer.)\nML8.Technical Notes.3.  For the purposes of ML8., particle size is the mean particle diameter on a weight or volume basis.  International or equivalent national standards will be used in sampling and determining particle size.\nML8.e.  Binders, plasticizers, monomers and polymers, as follows:\nML8.e.6.  Energetic monomers, plasticizers or polymers, specially formulated for military use and containing any of the following:\nML8.e.6.a.  Nitro groups;\nML8.e.6.b.  Azido groups;\nML8.e.6.c.  Nitrate groups;\nML8.e.6.d.  Nitraza groups; or\nML8.e.6.e.  Difluoroamino groups;\nML8.Note 1.  ML8. does not apply to the following substances unless they are compounded or mixed with the \"energetic material\" specified by ML8.a. or powdered metals specified by ML8.c.:\nML8.Note 1.a.  Ammonium picrate (CAS 131-74-8);\nML8.Note 1.b.  Black powder;\nML8.Note 1.c.  Hexanitrodiphenylamine (CAS 131-73-7);\nML8.Note 1.d.  Difluoroamine (CAS 10405-27-3);\nML8.Note 1.e.  Nitrostarch (CAS 9056-38-6);\nML8.Note 1.f.  Potassium nitrate (CAS 7757-79-1);\nML8.Note 1.g.  Tetranitronaphthalene;\nML8.Note 1.h.  Trinitroanisol;\nML8.Note 1.i.  Trinitronaphthalene;\nML8.Note 1.j.  Trinitroxylene;\nML8.Note 1.k.  N-pyrrolidinone; 1-methyl-2-pyrrolidinone (CAS 872-50-4);\nML8.Note 1.l.  Dioctylmaleate (CAS 142-16-5);\nML8.Note 1.m.  Ethylhexylacrylate (CAS 103-11-7);\nML8.Note 1.n.  Triethylaluminium (TEA) (CAS 97-93-8), trimethylaluminium (TMA) (CAS 75-24-1), and other pyrophoric metal alkyls and aryls of lithium, sodium, magnesium, zinc or boron;\nML8.Note 1.o.  Nitrocellulose (CAS 9004-70-0);\nML8.Note 1.p.  Nitroglycerin (or glyceroltrinitrate, trinitroglycerine) (NG) (CAS 55-63-0);\nML8.Note 1.q.  2,4,6-trinitrotoluene (TNT) (CAS 118-96-7);\nML8.Note 1.r.  Ethylenediaminedinitrate (EDDN) (CAS 20829-66-7);\nML8.Note 1.s.  Pentaerythritoltetranitrate (PETN) (CAS 78-11-5);\nML8.Note 1.t.  Lead azide (CAS 13424-46-9), normal lead styphnate (CAS 15245-44-0) and basic lead styphnate (CAS 12403-82-6), and primary explosives or priming compositions containing azides or azide complexes;\nML8.Note 1.u.  Triethyleneglycoldinitrate (TEGDN) (CAS 111-22-8);\nML8.Note 1.v.  2,4,6-trinitroresorcinol (styphnic acid) (CAS 82-71-3);\nML8.Note 1.w.  Diethyldiphenylurea; (CAS 85-98-3); dimethyldiphenylurea;\nML8.Note 1.w.  (CAS 611-92-7), methylethyldiphenylurea; [Centralites]\nML8.Note 1.x.  N,N-diphenylurea (unsymmetrical diphenylurea) (CAS 603-54-3);\nML8.Note 1.y.  Methyl-N,N-diphenylurea (methyl unsymmetrical diphenylurea)\nML8.Note 1.y.  (CAS 13114-72-2);\nML8.Note 1.z.  Ethyl-N,N-diphenylurea (ethyl unsymmetrical diphenylurea)\nML8.Note 1.z.  (CAS 64544-71-4);\nML8.Note 1.aa.  2-Nitrodiphenylamine (2-NDPA) (CAS 119-75-5);\nML8.Note 1.bb.  4-Nitrodiphenylamine (4-NDPA) (CAS 836-30-6);\nML8.Note 1.cc.  2,2-dinitropropanol (CAS 918-52-5);\nML8.Note 1.dd.  Nitroguanidine (CAS 556-88-7) (see 1.C.11.d. on the Dual-Use List).\nML8.Note 2.  ML8. does not apply to ammonium perchlorate (ML8.d.2.), NTO (ML8.a.18.) or catocene (ML8.f.4.b.), and meeting all of the following:\nML8.Note 2.a.  Specially shaped and formulated for civil-use gas generation devices;\nML8.Note 2.b.  Compounded or mixed, with non-active thermoset binders or plasticizers, and having a mass of less than 250 g;\nML8.Note 2.c.  Having a maximum of 80% ammonium perchlorate (ML8.d.2.) in mass of active material;\nML8.Note 2.d.  Having less than or equal to 4 g of NTO (ML8.a.18.); and\nML8.Note 2.e.  Having less than or equal to 1 g of catocene (ML8.f.4.b.).\n'),
(40300,'','','','ML22.  Technology as follows:\nML22.Note 1.  Technology \"required\" for the \"development\", \"production\", operation, installation, maintenance (checking), repair, overhaul or refurbishing of items specified by the Munitions List remains under control even when applicable to any item not specified by the Munitions List.\nML22.Note 2.  ML22 does not apply to:\nML22.Note 2.a.  Technology that is the minimum necessary for the installation, operation, maintenance (checking) or repair, of those items which are not controlled or whose export has been authorised;\nML22.Note 2.b.  Technology that is \"in the public domain\", \"basic scientific research\" or the minimum necessary information for patent applications;\nML22.Note 2.c.  Technology for magnetic induction for continuous propulsion of civil transport devices.\n'),
(40301,'SR 514.511 Anhang 1 (KMV) 2022-01-01','','',''),
(40302,'KM8.  Militärische Explosivstoffe und Brennstoffe, einschliesslich Treibstoffe:\nKM8.Anmerkung.  Luftfahrzeug-Treibstoffe, die von KM 8.c.1. erfasst werden, sind Fertigprodukte und nicht deren Einzelkomponenten\n','','',''),
(40303,'KM17.  Verschiedene Ausrüstungsgegenstände, Materialien und Bibliotheken wie folgt sowie besonders konstruierte Bestandteile hierfür:\nKM17.c.  Nukleare Energieerzeugungs- oder Antriebsausrüstung, einschliesslich Kernreaktoren, besonders konstruiert für Kampf- oder Gefechtszwecke, sowie besonders für Kampf- oder Gefechtszwecke konstruierte oder geänderte Bestandteile.\n','','',''),
(40304,'KM1.  Hand- und Faustfeuerwaffen jeglichen Kalibers und Zubehör sowie besonders konstruierte Bestandteile hierfür, jedoch ohne:\nKM1.a.  eindeutig erkennbare Jagd- und Sportwaffen (z. B. nach ISSF-Norm), die in derselben Ausführung nicht auch Kampfwaffen sind;\nKM1.b.  Einzellader und Vorderlader;\nKM1.c.  Faustfeuerwaffen und Repetiergewehre für Randfeuermunition;\nKM1.d.  alte Waffen, für die keine verwendbare Munition mehr herge­stellt wird oder im öffentlichen Handel erhältlich ist.\nKM1.d.Anmerkung.  KM 1.d. erfasst auch folgende Waffen:\nKM1.d.Anmerkung.1.  Musketen, Gewehre und Karabiner, die vor 1890 hergestellt wur­den, und ihre Nachbildungen;\nKM1.d.Anmerkung.2.  Revolver, Pistolen und Maschinenwaffen, die vor 1890 hergestellt wurden, und ihre Nachbildungen.\nKM1.  KM1.a. bis KM 1.d. erfassen auch für Exerziermunition besonders konstruierte Waffen, die keine von Nummer KM 3 erfasste Munition verschiessen können.\n','','',''),
(40305,'KM2.  Bewaffnung oder Waffen jeglichen Kalibers (jedoch ohne Hand und Faustfeuerwaffen der KM 1), Werfer und Zubehör wie folgt sowie besonders konstruierte Bestandteile hierfür:\nKM2.b.  militärische Nebel- und Gaswerfer, militärische pyrotechnische Werfer oder Generatoren.\nKM2.b.Anmerkung.  KM 2.b. erfasst nicht Signalpistolen.\n','','',''),
(40306,'KM9.  Kriegsschiffe und Zubehör wie folgt sowie Bestandteile hierfür, besonders konstruiert für Kampf- und Gefechtszwecke:\nKM9.a.  Kampfschiffe oder Schiffe, besonders konstruiert oder beson­ders geändert für Angriffs- oder Verteidigungshandlungen (über oder unter Wasser), auch wenn für nicht-militärische Zwecke umgebaut, und ungeachtet ihres derzeitigen Reparaturzustands oder ihrer Be­triebsfähigkeit oder ob sie Waffeneinsatzsysteme oder Panzerun­gen enthalten, sowie Schiffskörper oder Teile von Schiffskörpern für solche Schiffe;\n','','',''),
(40307,'KM13.  Spezialpanzer- oder Schutzausrüstung und Konstruktionen sowie Bestandteile wie folgt:\nKM13.a.  Panzerplatten wie folgt:\nKM13.a.1.  hergestellt, um einen militärischen Standard oder eine militä­rische Spezifikation zu erfüllen; oder\nKM13.a.2.  geeignet für Kampf- oder Gefechtszwecke;\nKM13.b.  Konstruktionen aus metallischen und nicht-metallischen Werkstoffen oder Kombinationen hieraus, besonders konstruiert, um militärische Systeme beschussfest zu machen.\nKM13.Anmerkung.  KM 13.b. schliesst Werkstoffe ein, besonders konstruiert zur Bildung einer explosionsreaktiven Panzerung oder zum Bau militärischer Unterstände (shelters).\n','','',''),
(40308,'KM6.  Panzer- und andere Landfahrzeuge und Bestandteile hierfür, besonders konstruiert oder geändert für Kampf- und Gefechtszwecke\nKM6.Technische Anmerkung.  «Landfahrzeuge» im Sinne der KM 6 schliessen auch entsprechend ausgerüstete Anhänger ein.\n','','',''),
(40309,'KM12.  Waffensysteme mit hoher kinetischer Energie (high velocity kinetic energy weapon systems) wie folgt sowie besonders konstruierte Bestandteile hierfür:\nKM12.  Waffensysteme mit hoher kinetischer Energie (kinetic energy weapon systems), besonders konstruiert für die Vernichtung oder Abwehr (Unterbrechung des Einsatzes) eines gegnerischen Objekts.\nKM12.Anmerkungen.2.  KM 12 erfasst Systeme, die eine der folgenden Antriebsarten verwen­den:\nKM12.Anmerkungen.2.d.  Leichtgasantrieb; oder\n','','',''),
(40310,'KM7.  Tränengase und andere Reizstoffe zur Bekämpfung von Unruhen:\nKM7.Anmerkungen.1.  Nicht erfasst sind:\nKM7.Anmerkungen.1.f.  Bromcyan;\n','','',''),
(40311,'KM7.  Tränengase und andere Reizstoffe zur Bekämpfung von Unruhen:\nKM7.3.  CN: -Chloracetophenon (CAS-Nr. 532-27-4);\n','','',''),
(40312,'KM10.  Luftfahrzeuge, unbemannte Luftfahrzeuge, Triebwerke, Luftfahr­zeug-Ausrüstung, Zusatzausrüstung und Bestandteile, besonders konstruiert oder geändert für Kampf- oder Gefechts­zwecke, wie folgt:\nKM10.b.  andere Luftfahrzeuge, besonders konstruiert oder geändert für mi­litärischen Angriff;\n','','',''),
(40313,'KM7.  Tränengase und andere Reizstoffe zur Bekämpfung von Unruhen:\nKM7.2.  CS: o-Chlorbenzylidenmalodinitril (CAS-Nr. 2698-41-1);\n','','',''),
(40314,'KM8.  Militärische Explosivstoffe und Brennstoffe, einschliesslich Treibstoffe:\nKM8.c.  andere Stoffe wie folgt:\nKM8.c.3.  flüssige Oxidationsmittel, die aus inhibierter rauchender Salpetersäure (IRFNA) oder Sauerstoffdifluorid bestehen oder diese Stoffe enthalten.\n','','',''),
(40315,'KM10.  Luftfahrzeuge, unbemannte Luftfahrzeuge, Triebwerke, Luftfahr­zeug-Ausrüstung, Zusatzausrüstung und Bestandteile, besonders konstruiert oder geändert für Kampf- oder Gefechts­zwecke, wie folgt:\nKM10.Anmerkungen.2.  KM 10.c. erfasst nicht:\nKM10.Anmerkungen.2.a.  Triebwerke, konstruiert oder geändert für Kampf- oder Gefechts­zwecke, die von einer Zivilluftfahrtbehörde eines Teilnehmerstaates für die Verwendung in zivilen Luftfahrzeugen zugelassen sind, sowie deren besonders konstruierte Bestandteile;\nKM10.Anmerkungen.2.b.  Kolbentriebwerke oder deren besonders konstruierte Bestandteile.\n','','',''),
(40316,'KM9.  Kriegsschiffe und Zubehör wie folgt sowie Bestandteile hierfür, besonders konstruiert für Kampf- und Gefechtszwecke:\nKM9.b.  Motoren wie folgt:\nKM9.b.3.  nicht-magnetische Dieselmotoren mit einer Leistung grösser/gleich 37,3 kW (50 PS) und mit einem nicht-magnetischem Anteil von mehr als 75 % des Gesamtgewichts.\n','','',''),
(40317,'KM10.  Luftfahrzeuge, unbemannte Luftfahrzeuge, Triebwerke, Luftfahr­zeug-Ausrüstung, Zusatzausrüstung und Bestandteile, besonders konstruiert oder geändert für Kampf- oder Gefechts­zwecke, wie folgt:\nKM10.Anmerkungen.1.  KM 10.b. erfasst nicht Luftfahrzeuge oder Varianten dieser Luftfahr­zeuge, besonders konstruiert für militärische Zwecke, die:\nKM10.Anmerkungen.1.b.  von einer Zivilluftfahrtbehörde eines Teilnehmerstaates für die zivile Verwendung zugelassen sind.\n','','',''),
(40318,'KM8.  Militärische Explosivstoffe und Brennstoffe, einschliesslich Treibstoffe:\nKM8.a.  Explosivstoffe und Treibstoffe, welche die folgenden Leistungsparameter erfüllen:\nKM8.a.5.  Schiesspulver mit einer Kraftkonstante grösser als 1200 kJ/kg;\n','','',''),
(40319,'KM6.  Panzer- und andere Landfahrzeuge und Bestandteile hierfür, besonders konstruiert oder geändert für Kampf- und Gefechtszwecke\nKM6.Anmerkungen.1.  KM 6 schliesst ein:\nKM6.Anmerkungen.1.a.  Panzerfahrzeuge mit oder ohne Bewaffnung, die spezifisch für Kampf- und Gefechtszwecke konzipiert oder abgeändert sind (umfasst auch Entpannungs- und Bergungspanzer)\nKM6.Anmerkungen.1.b.  andere Fahrzeuge aller Art, die spezifisch für den Einsatz von Waf­fen konzipiert oder abgeändert worden sind (wie z.B. Kampf- und Ge­fechtsfahrzeuge, bewaffnet oder unbewaffnet, ausgestattet mit Lafetten oder Ausrüstung zum Minenlegen oder zum Starten der von KM 4 er­fassten Waffen);\nKM6.Anmerkungen.1.c.  Raupenfahrzeuge, die spezifisch für Kampf- und Gefechtszwecke kon­zipiert oder abgeändert sind.\n','','',''),
(40320,'KM11.  Elektronische Ausrüstung, soweit nicht anderweitig von dieser Liste erfasst, besonders konstruiert für Kampf- und Gefechtszwecke, und besonders konstruierte Bestandteile hierfür\nKM11.Anmerkung.  KM 11 schliesst folgende Ausrüstung ein:\nKM11.Anmerkung.a.  Ausrüstung für elektronische Gegenmassnahmen (ECM) und elektronische Schutzmassnahmen (ECCM), einschliesslich elektronischer Ausrüstung zum Stören und Gegenstören, d.h. Geräte, konstruiert, um in Radar- oder Funkgeräten Störsignale oder verfälschende Signale zu erzeugen oder auf andere Weise den Empfang, den Betrieb oder die Wirksamkeit gegnerischer Empfänger einschliesslich der Geräte für Gegenmassnahmen zu stören;\nKM11.Anmerkung.b.  Ausrüstung für Unterwassergegenmassnahmen einschliesslich akustischer und magnetischer Störung und Täuschung, die in Sonarempfängern Störsi­gnale oder verfälschende Signale erzeugen.\n','','',''),
(40321,'KM3.  Munition für die von den Positionen KM 1, KM 2 oder KM 12 er­fassten Waffen sowie besonders konstruierte Bestandteile hierfür\nKM3.Anmerkungen.1.  Besonders konstruierte Bestandteile schliessen ein:\nKM3.Anmerkungen.1.d.  abbrennbare Hülsen für Treibladungen;\n','','',''),
(40322,'KM20.  Kryogenische (Tieftemperatur-) und supraleitende Ausrüstung wie folgt sowie besonders konstruierte Bestandteile und besonders konstruiertes Zubehör hierfür:\nKM20.a.  Ausrüstung, besonders konstruiert oder ausgelegt für den Ein­bau in ein Land-, See-, Luft- oder Raumfahrzeug für Kampf- oder Gefechtszwecke nach dieser Liste, und fähig, während der Fahrt eine Temperatur kleiner als –170 °C (103 K) zu erzeugen oder aufrechtzuerhalten; \nKM20.a.Anmerkung.  KM 20.a. schliesst mobile Systeme ein, die Zubehör und Bestandteile enthalten oder verwenden, die aus nicht-metallischen oder nicht elektrisch leitenden Werkstoffen, z.B. aus Kunststoffen oder epoxidharzimprägnierten Werkstoffen, hergestellt sind. \n','','',''),
(40323,'KM19.  Strahlenwaffen-Systeme wie folgt und besonders konstruierte Bestandteile hierfür:\nKM19.Anmerkungen.2.  KM 19 schliesst folgende Ausrüstung ein, sofern sie besonders kon­struiert ist für Strahlenwaffensysteme:\nKM19.Anmerkungen.2.h.  weltraumgeeignete Beschleuniger-Bestandteile (accelerator components);\n','','',''),
(40324,'KM3.  Munition für die von den Positionen KM 1, KM 2 oder KM 12 er­fassten Waffen sowie besonders konstruierte Bestandteile hierfür\nKM3.Anmerkungen.1.  Besonders konstruierte Bestandteile schliessen ein:\nKM3.Anmerkungen.1.a.  Metall- oder Kunststoffbestandteile, z.B. Ambosse in Zündhüt­chen, Geschossmäntel, Patronengurtglieder, Führungsringe und andere Mu­nitionsbestandteile aus Metall;\n','','',''),
(40325,'KM20.  Kryogenische (Tieftemperatur-) und supraleitende Ausrüstung wie folgt sowie besonders konstruierte Bestandteile und besonders konstruiertes Zubehör hierfür:\nKM20.a.  Ausrüstung, besonders konstruiert oder ausgelegt für den Ein­bau in ein Land-, See-, Luft- oder Raumfahrzeug für Kampf- oder Gefechtszwecke nach dieser Liste, und fähig, während der Fahrt eine Temperatur kleiner als –170 °C (103 K) zu erzeugen oder aufrechtzuerhalten; \nKM20.a.Anmerkung.  KM 20.a. schliesst mobile Systeme ein, die Zubehör und Bestandteile enthalten oder verwenden, die aus nicht-metallischen oder nicht elektrisch leitenden Werkstoffen, z.B. aus Kunststoffen oder epoxidharzimprägnierten Werkstoffen, hergestellt sind. \n','','',''),
(40326,'KM7.  Tränengase und andere Reizstoffe zur Bekämpfung von Unruhen:\nKM7.1.  CA: Brombenzylcyanid (CAS-Nr. 5798-79-8);\n','','',''),
(40327,'KM1.  Hand- und Faustfeuerwaffen jeglichen Kalibers und Zubehör sowie besonders konstruierte Bestandteile hierfür, jedoch ohne:\nKM1.d.  alte Waffen, für die keine verwendbare Munition mehr herge­stellt wird oder im öffentlichen Handel erhältlich ist.\nKM1.d.Anmerkung.  KM 1.d. erfasst auch folgende Waffen:\nKM1.d.Anmerkung.1.  Musketen, Gewehre und Karabiner, die vor 1890 hergestellt wur­den, und ihre Nachbildungen;\nKM1.d.Anmerkung.2.  Revolver, Pistolen und Maschinenwaffen, die vor 1890 hergestellt wurden, und ihre Nachbildungen.\nKM1.  KM1.a. bis KM 1.d. erfassen auch für Exerziermunition besonders konstruierte Waffen, die keine von Nummer KM 3 erfasste Munition verschiessen können.\n','','',''),
(40328,'KM5.  Feuerleiteinrichtungen, besonders konstruiert für Kampf- und Gefechtszwecke, wie folgt, sowie besonders konstruierte Bestandteile und besonders konstruiertes Zubehör hierfür\nKM5.a.  Waffenzielgeräte, Bombenzielrechner, Rohrwaffenrichtgeräte und Waffensteuersysteme;\nKM5.b.  Zielerfassungs-, Zielzuordnungs-, Zielentfernungsmess- oder Zielverfol­gungs­systeme; Ortungs- oder Datenverknüpfungsvorrichtungen (data fusion) und Ausrüstung zur Sensorintegration (sensor integration equipment).\n','','',''),
(40329,'KM9.  Kriegsschiffe und Zubehör wie folgt sowie Bestandteile hierfür, besonders konstruiert für Kampf- und Gefechtszwecke:\nKM9.b.  Motoren wie folgt:\nKM9.b.1.  Dieselmotoren, besonders konstruiert für U-Boote, mit allen folgenden Eigenschaften:\nKM9.b.1.a.  Leistung grösser/gleich 1,12 MW (1500 PS); und\nKM9.b.1.b.  Drehzahl grösser/gleich 700 U/min;\nKM9.b.2  Elektromotoren, besonders konstruiert für U-Boote, mit allen folgenden Eigenschaften:\nKM9.b.2.a.  Leistung grösser als 0,75 MW (1000 PS);\nKM9.b.2.b.  schnell umsteuerbar;\nKM9.b.2.c.  flüssigkeitsgekühlt; und \nKM9.b.2.d.  vollständig gekapselt;\nKM9.b.3.  nicht-magnetische Dieselmotoren mit einer Leistung grösser/gleich 37,3 kW (50 PS) und mit einem nicht-magnetischem Anteil von mehr als 75 % des Gesamtgewichts.\n','','',''),
(40330,'KM13.  Spezialpanzer- oder Schutzausrüstung und Konstruktionen sowie Bestandteile wie folgt:\nKM13.a.  Panzerplatten wie folgt:\nKM13.a.1.  hergestellt, um einen militärischen Standard oder eine militä­rische Spezifikation zu erfüllen; oder\n','','',''),
(40331,'KM19.  Strahlenwaffen-Systeme wie folgt und besonders konstruierte Bestandteile hierfür:\nKM19.c.  energiereiche Hochfrequenzsysteme, geeignet für die Vernichtung oder Abwehr (Unterbrechung des Einsatzes) eines gegnerischen Objekts.\n','','',''),
(40332,'KM17.  Verschiedene Ausrüstungsgegenstände, Materialien und Bibliotheken wie folgt sowie besonders konstruierte Bestandteile hierfür:\nKM17.a.  Roboter, Robotersteuerungen und Roboter-Endeffektoren, beson­ders konstruiert für Kampf- oder Gefechtszwecke;\nKM17.b.  Bibliotheken (parametrische technische Datenbanken), besonders entwickelt für Kampf- oder Gefechtszwecke in Verbindung mit Ausrüstung, die von dieser Liste erfasst wird;\nKM17.c.  Nukleare Energieerzeugungs- oder Antriebsausrüstung, einschliesslich Kernreaktoren, besonders konstruiert für Kampf- oder Gefechtszwecke, sowie besonders für Kampf- oder Gefechtszwecke konstruierte oder geänderte Bestandteile.\nKM17.Technische Anmerkung.  «Bibliothek» (parametrische technische Datenbank) im Sinne von KM 17 ist eine Sammlung technischer Informationen militärischer Natur, deren Ausnutzung die Leistungsfähigkeit militärischer Ausrüstung oder Systeme erhöhen kann.\n','','',''),
(40333,'KM19.  Strahlenwaffen-Systeme wie folgt und besonders konstruierte Bestandteile hierfür:\nKM19.a.  Laser-Systeme, besonders konstruiert für die Vernichtung oder Abwehr (Unterbrechung des Einsatzes) eines gegnerischen Objekts;\n','','',''),
(40334,'KM10.  Luftfahrzeuge, unbemannte Luftfahrzeuge, Triebwerke, Luftfahr­zeug-Ausrüstung, Zusatzausrüstung und Bestandteile, besonders konstruiert oder geändert für Kampf- oder Gefechts­zwecke, wie folgt:\nKM10.Anmerkungen.1.  KM 10.b. erfasst nicht Luftfahrzeuge oder Varianten dieser Luftfahr­zeuge, besonders konstruiert für militärische Zwecke, die:\nKM10.Anmerkungen.1.a.  nicht für eine militärische Verwendung konfiguriert sind und die nicht mit technischen Ausrüstungen oder Zusatzeinrichtungen ver­sehen sind, die für Kampf- oder Gefechtszwecke besonders kon­struiert oder geändert sind; und\n','','',''),
(40335,'KM1.  Hand- und Faustfeuerwaffen jeglichen Kalibers und Zubehör sowie besonders konstruierte Bestandteile hierfür, jedoch ohne:\nKM1.d.  alte Waffen, für die keine verwendbare Munition mehr herge­stellt wird oder im öffentlichen Handel erhältlich ist.\nKM1.d.Anmerkung.  KM 1.d. erfasst auch folgende Waffen:\nKM1.d.Anmerkung.1.  Musketen, Gewehre und Karabiner, die vor 1890 hergestellt wur­den, und ihre Nachbildungen;\nKM1.d.Anmerkung.2.  Revolver, Pistolen und Maschinenwaffen, die vor 1890 hergestellt wurden, und ihre Nachbildungen.\nKM1.  KM1.a. bis KM 1.d. erfassen auch für Exerziermunition besonders konstruierte Waffen, die keine von Nummer KM 3 erfasste Munition verschiessen können.\n','','',''),
(40336,'KM19.  Strahlenwaffen-Systeme wie folgt und besonders konstruierte Bestandteile hierfür:\nKM19.Anmerkungen.1.  Von KM 19 erfasste Strahlenwaffen schliessen Systeme ein, deren Lei­s­tungsfähigkeit bestimmt wird durch den kontrollierten Einsatz von: \nKM19.Anmerkungen.1.c.  Hochfrequenzsendern mit hoher Impulsenergie oder hoher Durchschnittsenergie, die ein ausreichend starkes Feld erzeugen, um elektronische Schaltungen in einem entfernt liegenden Ziel ausser Betrieb zu setzen.\n','','',''),
(40337,'KM7.  Tränengase und andere Reizstoffe zur Bekämpfung von Unruhen:\nKM7.Anmerkungen.1.  Nicht erfasst sind:\nKM7.Anmerkungen.1.g.  Brommethylethylketon;\n','','',''),
(40338,'KM19.  Strahlenwaffen-Systeme wie folgt und besonders konstruierte Bestandteile hierfür:\nKM19.Anmerkungen.2.  KM 19 schliesst folgende Ausrüstung ein, sofern sie besonders kon­struiert ist für Strahlenwaffensysteme:\nKM19.Anmerkungen.2.a.  Geräte für die Erzeugung von Primärenergie, Energiespeicher, Schalt­vorrichtungen, Geräte für die Energiekonditionierung und Geräte für die Handhabung von Treibstoffen;\n','','',''),
(40339,'KM8.  Militärische Explosivstoffe und Brennstoffe, einschliesslich Treibstoffe:\nKM8.c.  andere Stoffe wie folgt:\nKM8.c.1.  Luftfahrzeug-Treibstoffe, besonders konstruiert für militärische Zwecke;\nKM8.c.2.  militärische Materialien, die für die Verwendung in Flammenwerfern oder Brandbomben besonders entwickelte Verdicker für Kohlenwasserstoff-Brennstoffe enthalten, wie Metallstearate oder Palmitate (Oktal) (CAS-Nr. 637-12-7) und M1, M2, M3-Verdicker;\nKM8.c.3.  flüssige Oxidationsmittel, die aus inhibierter rauchender Salpetersäure (IRFNA) oder Sauerstoffdifluorid bestehen oder diese Stoffe enthalten.\n','','',''),
(40340,'KM20.  Kryogenische (Tieftemperatur-) und supraleitende Ausrüstung wie folgt sowie besonders konstruierte Bestandteile und besonders konstruiertes Zubehör hierfür:\nKM20.b.  supraleitende elektrische Ausrüstung (rotierende Maschinen und Transformatoren), besonders konstruiert oder besonders ausgelegt für den Einbau in ein Land-, See-, Luft- oder Raumfahrzeug für Kampf- oder Gefechtszwecke nach dieser Liste, und betriebsfähig während der Fahrt.\nKM20.b.Anmerkung.  KM 20.b. erfasst nicht hybride, homopolare Gleichstromgeneratoren mit einem einpoligen, normal ausgelegten Metallanker, der in einem Magnetfeld rotiert, das mit Hilfe supraleitender Wicklungen erzeugt wird, vorausgesetzt, dass diese Wicklungen die einzige supraleitende Baugruppe im Generator sind.\n','','',''),
(40341,'KM9.  Kriegsschiffe und Zubehör wie folgt sowie Bestandteile hierfür, besonders konstruiert für Kampf- und Gefechtszwecke:\nKM9.b.  Motoren wie folgt:\nKM9.b.2  Elektromotoren, besonders konstruiert für U-Boote, mit allen folgenden Eigenschaften:\nKM9.b.2.d.  vollständig gekapselt;\n','','',''),
(40342,'KM12.  Waffensysteme mit hoher kinetischer Energie (high velocity kinetic energy weapon systems) wie folgt sowie besonders konstruierte Bestandteile hierfür:\nKM12.  Waffensysteme mit hoher kinetischer Energie (kinetic energy weapon systems), besonders konstruiert für die Vernichtung oder Abwehr (Unterbrechung des Einsatzes) eines gegnerischen Objekts.\nKM12.Anmerkungen.2.  KM 12 erfasst Systeme, die eine der folgenden Antriebsarten verwen­den:\nKM12.Anmerkungen.2.c.  Plasmaantrieb;\n','','',''),
(40343,'KM9.  Kriegsschiffe und Zubehör wie folgt sowie Bestandteile hierfür, besonders konstruiert für Kampf- und Gefechtszwecke:\nKM9.a.  Kampfschiffe oder Schiffe, besonders konstruiert oder beson­ders geändert für Angriffs- oder Verteidigungshandlungen (über oder unter Wasser), auch wenn für nicht-militärische Zwecke umgebaut, und ungeachtet ihres derzeitigen Reparaturzustands oder ihrer Be­triebsfähigkeit oder ob sie Waffeneinsatzsysteme oder Panzerun­gen enthalten, sowie Schiffskörper oder Teile von Schiffskörpern für solche Schiffe;\nKM9.b.  Motoren wie folgt:\nKM9.b.1.  Dieselmotoren, besonders konstruiert für U-Boote, mit allen folgenden Eigenschaften:\nKM9.b.1.a.  Leistung grösser/gleich 1,12 MW (1500 PS); und\nKM9.b.1.b.  Drehzahl grösser/gleich 700 U/min;\nKM9.b.2  Elektromotoren, besonders konstruiert für U-Boote, mit allen folgenden Eigenschaften:\nKM9.b.2.a.  Leistung grösser als 0,75 MW (1000 PS);\nKM9.b.2.b.  schnell umsteuerbar;\nKM9.b.2.c.  flüssigkeitsgekühlt; und \nKM9.b.2.d.  vollständig gekapselt;\nKM9.b.3.  nicht-magnetische Dieselmotoren mit einer Leistung grösser/gleich 37,3 kW (50 PS) und mit einem nicht-magnetischem Anteil von mehr als 75 % des Gesamtgewichts.\n','','',''),
(40344,'KM3.  Munition für die von den Positionen KM 1, KM 2 oder KM 12 er­fassten Waffen sowie besonders konstruierte Bestandteile hierfür\nKM3.Anmerkungen.1.  Besonders konstruierte Bestandteile schliessen ein:\nKM3.Anmerkungen.1.c.  Stromquellen für die einmalige Abgabe einer hohen Leistung;\n','','',''),
(40345,'KM10.  Luftfahrzeuge, unbemannte Luftfahrzeuge, Triebwerke, Luftfahr­zeug-Ausrüstung, Zusatzausrüstung und Bestandteile, besonders konstruiert oder geändert für Kampf- oder Gefechts­zwecke, wie folgt:\nKM10.a.  Kampfflugzeuge und -hubschrauber und besonders konstruierte Bestandteile hierfür;\nKM10.b.  andere Luftfahrzeuge, besonders konstruiert oder geändert für mi­litärischen Angriff;\nKM10.c.  Triebwerke für Luftfahrzeuge der Buchstaben a und b hievor und besonders konstruierte Bestandteile hierfür;\nKM10.d.  unbemannte Luftfahrzeuge einschliesslich ferngelenkter Flugkörper (remotely piloted air vehicles – RPVs –) und autonome, programmierbare Fahrzeuge, besonders konstruiert oder besonders geändert für Kampf- oder Gefechtszwecke, sowie deren Startgeräte, unterstützende Bodengeräte und zugehörige Ausrüstung für die Steuerung.\nKM10.Anmerkungen.1.  KM 10.b. erfasst nicht Luftfahrzeuge oder Varianten dieser Luftfahr­zeuge, besonders konstruiert für militärische Zwecke, die:\nKM10.Anmerkungen.1.a.  nicht für eine militärische Verwendung konfiguriert sind und die nicht mit technischen Ausrüstungen oder Zusatzeinrichtungen ver­sehen sind, die für Kampf- oder Gefechtszwecke besonders kon­struiert oder geändert sind; und\nKM10.Anmerkungen.1.b.  von einer Zivilluftfahrtbehörde eines Teilnehmerstaates für die zivile Verwendung zugelassen sind.\nKM10.Anmerkungen.2.  KM 10.c. erfasst nicht:\nKM10.Anmerkungen.2.a.  Triebwerke, konstruiert oder geändert für Kampf- oder Gefechts­zwecke, die von einer Zivilluftfahrtbehörde eines Teilnehmerstaates für die Verwendung in zivilen Luftfahrzeugen zugelassen sind, sowie deren besonders konstruierte Bestandteile;\nKM10.Anmerkungen.2.b.  Kolbentriebwerke oder deren besonders konstruierte Bestandteile.\nKM10.Anmerkungen.3.  Die Erfassung in KM 10.b. und KM 10.c. von besonders konstruierten Bestandteilen und zugehöriger Ausrüstung für nicht-militärische Luftfahrzeuge oder Triebwerke, die für Kampf- und Gefechtszwecke geändert sind, erstreckt sich nur auf solche militärischen Bestandteile und zugehörige militärische Ausrüstung, die für die Änderung für Kampf- oder Gefechtszwecke nötig sind.\nKM10.Anmerkungen.4.  KM 10.d umfasst keine Aufklärungsdrohnen.\n','','',''),
(40346,'KM7.  Tränengase und andere Reizstoffe zur Bekämpfung von Unruhen:\nKM7.Anmerkungen.1.  Nicht erfasst sind:\nKM7.Anmerkungen.1.d.  Benzyljodid;\n','','',''),
(40347,'KM1.  Hand- und Faustfeuerwaffen jeglichen Kalibers und Zubehör sowie besonders konstruierte Bestandteile hierfür, jedoch ohne:\nKM1.c.  Faustfeuerwaffen und Repetiergewehre für Randfeuermunition;\nKM1.  KM1.a. bis KM 1.d. erfassen auch für Exerziermunition besonders konstruierte Waffen, die keine von Nummer KM 3 erfasste Munition verschiessen können.\n','','',''),
(40348,'KM17.  Verschiedene Ausrüstungsgegenstände, Materialien und Bibliotheken wie folgt sowie besonders konstruierte Bestandteile hierfür:\nKM17.a.  Roboter, Robotersteuerungen und Roboter-Endeffektoren, beson­ders konstruiert für Kampf- oder Gefechtszwecke;\n','','',''),
(40349,'KM2.  Bewaffnung oder Waffen jeglichen Kalibers (jedoch ohne Hand und Faustfeuerwaffen der KM 1), Werfer und Zubehör wie folgt sowie besonders konstruierte Bestandteile hierfür:\nKM2.a.  Geschütze, Haubitzen, Kanonen, Mörser, Panzerabwehrwaffen, Einrichtungen zum Abfeuern von Geschossen und Raketen, militä­rische Flammenwerfer und rückstossfreie Waffen;\nKM2.a.Anmerkung.  KM 2.a. schliesst Injektoren, Messgeräte, Speichertanks und besonders konstruierte Bestandteile für den Einsatz von flüssigen Treibladungen für einen der von KM 2.a. erfassten Ausrüstungsgegenstände ein.\nKM2.b.  militärische Nebel- und Gaswerfer, militärische pyrotechnische Werfer oder Generatoren.\nKM2.b.Anmerkung.  KM 2.b. erfasst nicht Signalpistolen.\n','','',''),
(40350,'KM8.  Militärische Explosivstoffe und Brennstoffe, einschliesslich Treibstoffe:\nKM8.a.  Explosivstoffe und Treibstoffe, welche die folgenden Leistungsparameter erfüllen:\nKM8.a.4.  Feststofftreibmittel der UN-Klasse 1.3 mit einem theoretisch erreichbaren spezifischen Impuls von mehr als 230 s bei halogenfreien, 250 s bei metallfreien und 266 s bei metallhaltigen Mischungen;\n','','',''),
(40351,'KM13.  Spezialpanzer- oder Schutzausrüstung und Konstruktionen sowie Bestandteile wie folgt:\nKM13.b.  Konstruktionen aus metallischen und nicht-metallischen Werkstoffen oder Kombinationen hieraus, besonders konstruiert, um militärische Systeme beschussfest zu machen.\n','','',''),
(40352,'KM2.  Bewaffnung oder Waffen jeglichen Kalibers (jedoch ohne Hand und Faustfeuerwaffen der KM 1), Werfer und Zubehör wie folgt sowie besonders konstruierte Bestandteile hierfür:\nKM2.a.  Geschütze, Haubitzen, Kanonen, Mörser, Panzerabwehrwaffen, Einrichtungen zum Abfeuern von Geschossen und Raketen, militä­rische Flammenwerfer und rückstossfreie Waffen;\nKM2.a.Anmerkung.  KM 2.a. schliesst Injektoren, Messgeräte, Speichertanks und besonders konstruierte Bestandteile für den Einsatz von flüssigen Treibladungen für einen der von KM 2.a. erfassten Ausrüstungsgegenstände ein.\n','','',''),
(40353,'KM19.  Strahlenwaffen-Systeme wie folgt und besonders konstruierte Bestandteile hierfür:\nKM19.a.  Laser-Systeme, besonders konstruiert für die Vernichtung oder Abwehr (Unterbrechung des Einsatzes) eines gegnerischen Objekts;\nKM19.b.  Teilchenstrahl-Systeme, geeignet für die Vernichtung oder Abwehr (Unterbrechung des Einsatzes) eines gegnerischen Objekts;\nKM19.c.  energiereiche Hochfrequenzsysteme, geeignet für die Vernichtung oder Abwehr (Unterbrechung des Einsatzes) eines gegnerischen Objekts.\nKM19.Anmerkungen.1.  Von KM 19 erfasste Strahlenwaffen schliessen Systeme ein, deren Lei­s­tungsfähigkeit bestimmt wird durch den kontrollierten Einsatz von: \nKM19.Anmerkungen.1.a.  Lasern mit einer Dauerstrich- oder Impulsenergie, die eine mit herkömmlicher Munition vergleichbare Vernichtungswirkung errei­chen;\nKM19.Anmerkungen.1.b.  Teilchenbeschleunigern, die einen geladenen oder ungeladenen Strahl mit Vernichtungswirkung aussenden;\nKM19.Anmerkungen.1.c.  Hochfrequenzsendern mit hoher Impulsenergie oder hoher Durchschnittsenergie, die ein ausreichend starkes Feld erzeugen, um elektronische Schaltungen in einem entfernt liegenden Ziel ausser Betrieb zu setzen.\nKM19.Anmerkungen.2.  KM 19 schliesst folgende Ausrüstung ein, sofern sie besonders kon­struiert ist für Strahlenwaffensysteme:\nKM19.Anmerkungen.2.a.  Geräte für die Erzeugung von Primärenergie, Energiespeicher, Schalt­vorrichtungen, Geräte für die Energiekonditionierung und Geräte für die Handhabung von Treibstoffen;\nKM19.Anmerkungen.2.b.  Zielerfassungs- und Zielverfolgungssysteme;\nKM19.Anmerkungen.2.c.  Systeme für die Auswertung der Schadenswirkung, Zerstörung oder Einsatzunterbrechung;\nKM19.Anmerkungen.2.d.  Geräte für die Strahllenkung, -ausbreitung und -ausrichtung;\nKM19.Anmerkungen.2.e.  Geräte für die rasche Strahlschwenkung zur schnellen Bekämpfung von Mehrfachzielen;\nKM19.Anmerkungen.2.f.  anpassungsfähige Optiken oder Phasenkonjugatoren (phase conjugators);\nKM19.Anmerkungen.2.g.  Strominjektoren für negative Wasserstoffionenstrahlen; \nKM19.Anmerkungen.2.h.  weltraumgeeignete Beschleuniger-Bestandteile (accelerator components);\nKM19.Anmerkungen.2.i.  negative Ionenstrahl-Ausweitungs-Ausrüstung (negative ion beam funnelling equipment);\nKM19.Anmerkungen.2.j.  Ausrüstung zur Steuerung und Schwenkung eines energiereichen Ionenstrahls;\nKM19.Anmerkungen.2.k.  weltraumgeeignete Folien zur Neutralisierung von negativen Wasserstoffisotopenstrahlen.\n','','',''),
(40354,'KM1.  Hand- und Faustfeuerwaffen jeglichen Kalibers und Zubehör sowie besonders konstruierte Bestandteile hierfür, jedoch ohne:\nKM1.d.  alte Waffen, für die keine verwendbare Munition mehr herge­stellt wird oder im öffentlichen Handel erhältlich ist.\nKM1.d.Anmerkung.  KM 1.d. erfasst auch folgende Waffen:\nKM1.d.Anmerkung.1.  Musketen, Gewehre und Karabiner, die vor 1890 hergestellt wur­den, und ihre Nachbildungen;\nKM1.  KM1.a. bis KM 1.d. erfassen auch für Exerziermunition besonders konstruierte Waffen, die keine von Nummer KM 3 erfasste Munition verschiessen können.\n','','',''),
(40355,'KM12.  Waffensysteme mit hoher kinetischer Energie (high velocity kinetic energy weapon systems) wie folgt sowie besonders konstruierte Bestandteile hierfür:\nKM12.  Waffensysteme mit hoher kinetischer Energie (kinetic energy weapon systems), besonders konstruiert für die Vernichtung oder Abwehr (Unterbrechung des Einsatzes) eines gegnerischen Objekts.\nKM12.Anmerkungen.1.  KM 12 schliesst folgende Ausrüstung ein, sofern sie besonders konstruiert ist für Waffensysteme mit hoher kinetischer Energie:\nKM12.Anmerkungen.1.a.  Startantriebssysteme, die Massen grösser als 0,1 g auf Geschwin­dig­keiten über 1,6 km/s in den Betriebsarten Einzelfeuer oder Schnell­feuer beschleunigen können;\n','','',''),
(40356,'KM6.  Panzer- und andere Landfahrzeuge und Bestandteile hierfür, besonders konstruiert oder geändert für Kampf- und Gefechtszwecke\nKM6.Anmerkungen.1.  KM 6 schliesst ein:\nKM6.Anmerkungen.1.a.  Panzerfahrzeuge mit oder ohne Bewaffnung, die spezifisch für Kampf- und Gefechtszwecke konzipiert oder abgeändert sind (umfasst auch Entpannungs- und Bergungspanzer)\n','','',''),
(40357,'KM8.  Militärische Explosivstoffe und Brennstoffe, einschliesslich Treibstoffe:\nKM8.a.  Explosivstoffe und Treibstoffe, welche die folgenden Leistungsparameter erfüllen:\nKM8.a.2.  organische Explosivstoffe, die einen Detonationsdruck grösser/gleich 25 GPa (250 kbar) ergeben und bei Tempe­raturen grösser/gleich 250°C (523 K) für die Dauer von 5 min oder länger stabil bleiben;\n','','',''),
(40358,'KM5.  Feuerleiteinrichtungen, besonders konstruiert für Kampf- und Gefechtszwecke, wie folgt, sowie besonders konstruierte Bestandteile und besonders konstruiertes Zubehör hierfür\nKM5.a.  Waffenzielgeräte, Bombenzielrechner, Rohrwaffenrichtgeräte und Waffensteuersysteme;\n','','',''),
(40359,'KM19.  Strahlenwaffen-Systeme wie folgt und besonders konstruierte Bestandteile hierfür:\nKM19.Anmerkungen.2.  KM 19 schliesst folgende Ausrüstung ein, sofern sie besonders kon­struiert ist für Strahlenwaffensysteme:\nKM19.Anmerkungen.2.i.  negative Ionenstrahl-Ausweitungs-Ausrüstung (negative ion beam funnelling equipment);\n','','',''),
(40360,'KM6.  Panzer- und andere Landfahrzeuge und Bestandteile hierfür, besonders konstruiert oder geändert für Kampf- und Gefechtszwecke\nKM6.Anmerkungen.3.  KM 6 erfasst keine zivilen Sonderschutzlimousinen und Werttransporter mit Schutzpanzerung.\n','','',''),
(40361,'KM19.  Strahlenwaffen-Systeme wie folgt und besonders konstruierte Bestandteile hierfür:\nKM19.Anmerkungen.2.  KM 19 schliesst folgende Ausrüstung ein, sofern sie besonders kon­struiert ist für Strahlenwaffensysteme:\nKM19.Anmerkungen.2.j.  Ausrüstung zur Steuerung und Schwenkung eines energiereichen Ionenstrahls;\n','','',''),
(40362,'KM9.  Kriegsschiffe und Zubehör wie folgt sowie Bestandteile hierfür, besonders konstruiert für Kampf- und Gefechtszwecke:\nKM9.b.  Motoren wie folgt:\nKM9.b.2  Elektromotoren, besonders konstruiert für U-Boote, mit allen folgenden Eigenschaften:\nKM9.b.2.b.  schnell umsteuerbar;\n','','',''),
(40363,'KM9.  Kriegsschiffe und Zubehör wie folgt sowie Bestandteile hierfür, besonders konstruiert für Kampf- und Gefechtszwecke:\nKM9.b.  Motoren wie folgt:\nKM9.b.1.  Dieselmotoren, besonders konstruiert für U-Boote, mit allen folgenden Eigenschaften:\nKM9.b.1.a.  Leistung grösser/gleich 1,12 MW (1500 PS); und\nKM9.b.1.b.  Drehzahl grösser/gleich 700 U/min;\n','','',''),
(40364,'KM10.  Luftfahrzeuge, unbemannte Luftfahrzeuge, Triebwerke, Luftfahr­zeug-Ausrüstung, Zusatzausrüstung und Bestandteile, besonders konstruiert oder geändert für Kampf- oder Gefechts­zwecke, wie folgt:\nKM10.Anmerkungen.4.  KM 10.d umfasst keine Aufklärungsdrohnen.\n','','',''),
(40365,'KM19.  Strahlenwaffen-Systeme wie folgt und besonders konstruierte Bestandteile hierfür:\nKM19.Anmerkungen.2.  KM 19 schliesst folgende Ausrüstung ein, sofern sie besonders kon­struiert ist für Strahlenwaffensysteme:\nKM19.Anmerkungen.2.d.  Geräte für die Strahllenkung, -ausbreitung und -ausrichtung;\n','','',''),
(40366,'KM7.  Tränengase und andere Reizstoffe zur Bekämpfung von Unruhen:\nKM7.4.  CR: Dibenz(b,f)-1,4-oxazepin (CAS-Nr. 257-07-8).\n','','',''),
(40367,'KM12.  Waffensysteme mit hoher kinetischer Energie (high velocity kinetic energy weapon systems) wie folgt sowie besonders konstruierte Bestandteile hierfür:\nKM12.  Waffensysteme mit hoher kinetischer Energie (kinetic energy weapon systems), besonders konstruiert für die Vernichtung oder Abwehr (Unterbrechung des Einsatzes) eines gegnerischen Objekts.\nKM12.Anmerkungen.2.  KM 12 erfasst Systeme, die eine der folgenden Antriebsarten verwen­den:\nKM12.Anmerkungen.2.e.  chemisch (sofern in Kombination mit den zu a bis d aufgeführten An­triebsarten verwendet).\n','','',''),
(40368,'KM12.  Waffensysteme mit hoher kinetischer Energie (high velocity kinetic energy weapon systems) wie folgt sowie besonders konstruierte Bestandteile hierfür:\nKM12.  Waffensysteme mit hoher kinetischer Energie (kinetic energy weapon systems), besonders konstruiert für die Vernichtung oder Abwehr (Unterbrechung des Einsatzes) eines gegnerischen Objekts.\nKM12.Anmerkungen.1.  KM 12 schliesst folgende Ausrüstung ein, sofern sie besonders konstruiert ist für Waffensysteme mit hoher kinetischer Energie:\nKM12.Anmerkungen.1.b.  Ausrüstung für die Erzeugung von Primärenergie, Elektroschutz (electric armour), Energiespeicherung, Kontrolle des Wärmehaus­halts und Klimatisierung, Schaltvorrichtungen und Ausrüstung für die Handhabung von Treibstoffen, elektrische Schnittstellen zwi­schen Stromversorgung, Geschütz und anderen elektrischen Richt­funktionen des Turms;\n','','',''),
(40369,'KM19.  Strahlenwaffen-Systeme wie folgt und besonders konstruierte Bestandteile hierfür:\nKM19.Anmerkungen.2.  KM 19 schliesst folgende Ausrüstung ein, sofern sie besonders kon­struiert ist für Strahlenwaffensysteme:\nKM19.Anmerkungen.2.f.  anpassungsfähige Optiken oder Phasenkonjugatoren (phase conjugators);\n','','',''),
(40370,'KM10.  Luftfahrzeuge, unbemannte Luftfahrzeuge, Triebwerke, Luftfahr­zeug-Ausrüstung, Zusatzausrüstung und Bestandteile, besonders konstruiert oder geändert für Kampf- oder Gefechts­zwecke, wie folgt:\nKM10.a.  Kampfflugzeuge und -hubschrauber und besonders konstruierte Bestandteile hierfür;\n','','',''),
(40371,'KM8.  Militärische Explosivstoffe und Brennstoffe, einschliesslich Treibstoffe:\nKM8.a.  Explosivstoffe und Treibstoffe, welche die folgenden Leistungsparameter erfüllen:\nKM8.a.1.  Explosivstoffe mit einer Detonationsgeschwindigkeit grösser als 8700 m/s oder einem Detonationsdruck grösser als 34 GPa (340 kbar);\n','','',''),
(40372,'KM9.  Kriegsschiffe und Zubehör wie folgt sowie Bestandteile hierfür, besonders konstruiert für Kampf- und Gefechtszwecke:\nKM9.b.  Motoren wie folgt:\nKM9.b.2  Elektromotoren, besonders konstruiert für U-Boote, mit allen folgenden Eigenschaften:\nKM9.b.2.c.  flüssigkeitsgekühlt; und \n','','',''),
(40373,'KM6.  Panzer- und andere Landfahrzeuge und Bestandteile hierfür, besonders konstruiert oder geändert für Kampf- und Gefechtszwecke\nKM6.Anmerkungen.2.  Die Konzipierung oder Änderung eines der erwähnten Landfahrzeuge spe­zifisch für Kampf- und Gefechtszwecke kann eine bauliche, elektri­sche oder mechanische Änderung bedeuten, die ein oder mehrere ent­sprechend konstruierte Bestandteile betrifft. Solche Bestandteile schlie­ssen ein:\nKM6.Anmerkungen.2.b.  Reifendruck-Regelvorrichtungen, die aus dem Inneren des fahren­den Fahrzeugs bedient werden können;\n','','',''),
(40374,'KM6.  Panzer- und andere Landfahrzeuge und Bestandteile hierfür, besonders konstruiert oder geändert für Kampf- und Gefechtszwecke\nKM6.Anmerkungen.2.  Die Konzipierung oder Änderung eines der erwähnten Landfahrzeuge spe­zifisch für Kampf- und Gefechtszwecke kann eine bauliche, elektri­sche oder mechanische Änderung bedeuten, die ein oder mehrere ent­sprechend konstruierte Bestandteile betrifft. Solche Bestandteile schlie­ssen ein:\nKM6.Anmerkungen.2.c.  Panzerschutz von wichtigen Teilen (z.B. Kraftstofftanks oder Fahr­zeugkabinen);\n','','',''),
(40375,'KM3.  Munition für die von den Positionen KM 1, KM 2 oder KM 12 er­fassten Waffen sowie besonders konstruierte Bestandteile hierfür\nKM3.Anmerkungen.1.  Besonders konstruierte Bestandteile schliessen ein:\nKM3.Anmerkungen.1.a.  Metall- oder Kunststoffbestandteile, z.B. Ambosse in Zündhüt­chen, Geschossmäntel, Patronengurtglieder, Führungsringe und andere Mu­nitionsbestandteile aus Metall;\nKM3.Anmerkungen.1.b.  Sicherungseinrichtungen, Zünder, Sensoren und Anzündvorrich­tun­gen;\nKM3.Anmerkungen.1.c.  Stromquellen für die einmalige Abgabe einer hohen Leistung;\nKM3.Anmerkungen.1.d.  abbrennbare Hülsen für Treibladungen;\nKM3.Anmerkungen.1.e.  Submunition einschliesslich Bomblets, Minelets und endphasen­gelenkter Geschosse.\n','','',''),
(40376,'KM19.  Strahlenwaffen-Systeme wie folgt und besonders konstruierte Bestandteile hierfür:\nKM19.Anmerkungen.1.  Von KM 19 erfasste Strahlenwaffen schliessen Systeme ein, deren Lei­s­tungsfähigkeit bestimmt wird durch den kontrollierten Einsatz von: \nKM19.Anmerkungen.1.b.  Teilchenbeschleunigern, die einen geladenen oder ungeladenen Strahl mit Vernichtungswirkung aussenden;\n','','',''),
(40377,'KM8.  Militärische Explosivstoffe und Brennstoffe, einschliesslich Treibstoffe:\nKM8.c.  andere Stoffe wie folgt:\nKM8.c.2.  militärische Materialien, die für die Verwendung in Flammenwerfern oder Brandbomben besonders entwickelte Verdicker für Kohlenwasserstoff-Brennstoffe enthalten, wie Metallstearate oder Palmitate (Oktal) (CAS-Nr. 637-12-7) und M1, M2, M3-Verdicker;\n','','',''),
(40378,'KM11.  Elektronische Ausrüstung, soweit nicht anderweitig von dieser Liste erfasst, besonders konstruiert für Kampf- und Gefechtszwecke, und besonders konstruierte Bestandteile hierfür\nKM11.Anmerkung.  KM 11 schliesst folgende Ausrüstung ein:\nKM11.Anmerkung.b.  Ausrüstung für Unterwassergegenmassnahmen einschliesslich akustischer und magnetischer Störung und Täuschung, die in Sonarempfängern Störsi­gnale oder verfälschende Signale erzeugen.\n','','',''),
(40379,'KM8.  Militärische Explosivstoffe und Brennstoffe, einschliesslich Treibstoffe:\nKM8.a.  Explosivstoffe und Treibstoffe, welche die folgenden Leistungsparameter erfüllen:\nKM8.a.7.  elastomermodifizierte gegossene zweibasige Treibmittel (EMCDB), die bei -40 °C (233 K) eine Dehnungsfähigkeit von mehr als 5 % bei grösster Beanspruchung aufweisen;\n','','',''),
(40380,'KM7.  Tränengase und andere Reizstoffe zur Bekämpfung von Unruhen:\nKM7.Anmerkungen.2.  Nicht erfasst sind einzeln abgepackte Tränengase oder andere Reizstoffe für persönliche Selbstverteidigungszwecke.\n','','',''),
(40381,'KM19.  Strahlenwaffen-Systeme wie folgt und besonders konstruierte Bestandteile hierfür:\nKM19.Anmerkungen.2.  KM 19 schliesst folgende Ausrüstung ein, sofern sie besonders kon­struiert ist für Strahlenwaffensysteme:\nKM19.Anmerkungen.2.e.  Geräte für die rasche Strahlschwenkung zur schnellen Bekämpfung von Mehrfachzielen;\n','','',''),
(40382,'KM19.  Strahlenwaffen-Systeme wie folgt und besonders konstruierte Bestandteile hierfür:\nKM19.Anmerkungen.2.  KM 19 schliesst folgende Ausrüstung ein, sofern sie besonders kon­struiert ist für Strahlenwaffensysteme:\nKM19.Anmerkungen.2.b.  Zielerfassungs- und Zielverfolgungssysteme;\n','','',''),
(40383,'KM7.  Tränengase und andere Reizstoffe zur Bekämpfung von Unruhen:\nKM7.Anmerkungen.1.  Nicht erfasst sind:\nKM7.Anmerkungen.1.c.  Benzylbromid;\n','','',''),
(40384,'KM8.  Militärische Explosivstoffe und Brennstoffe, einschliesslich Treibstoffe:\nKM8.a.  Explosivstoffe und Treibstoffe, welche die folgenden Leistungsparameter erfüllen:\nKM8.a.6.  Explosivstoffe, Treibstoffe oder pyrotechnische Stoffe, die eine stabile gleichförmige Abbrandgeschwindigkeit von mehr als 38 mm/s bei 6,89 MPa (68,9 bar) und 21°C (294 K) aufweisen; oder\n','','',''),
(40385,'KM19.  Strahlenwaffen-Systeme wie folgt und besonders konstruierte Bestandteile hierfür:\nKM19.Anmerkungen.2.  KM 19 schliesst folgende Ausrüstung ein, sofern sie besonders kon­struiert ist für Strahlenwaffensysteme:\nKM19.Anmerkungen.2.c.  Systeme für die Auswertung der Schadenswirkung, Zerstörung oder Einsatzunterbrechung;\n','','',''),
(40386,'KM20.  Kryogenische (Tieftemperatur-) und supraleitende Ausrüstung wie folgt sowie besonders konstruierte Bestandteile und besonders konstruiertes Zubehör hierfür:\nKM20.b.  supraleitende elektrische Ausrüstung (rotierende Maschinen und Transformatoren), besonders konstruiert oder besonders ausgelegt für den Einbau in ein Land-, See-, Luft- oder Raumfahrzeug für Kampf- oder Gefechtszwecke nach dieser Liste, und betriebsfähig während der Fahrt.\nKM20.b.Anmerkung.  KM 20.b. erfasst nicht hybride, homopolare Gleichstromgeneratoren mit einem einpoligen, normal ausgelegten Metallanker, der in einem Magnetfeld rotiert, das mit Hilfe supraleitender Wicklungen erzeugt wird, vorausgesetzt, dass diese Wicklungen die einzige supraleitende Baugruppe im Generator sind.\n','','',''),
(40387,'KM12.  Waffensysteme mit hoher kinetischer Energie (high velocity kinetic energy weapon systems) wie folgt sowie besonders konstruierte Bestandteile hierfür:\nKM12.  Waffensysteme mit hoher kinetischer Energie (kinetic energy weapon systems), besonders konstruiert für die Vernichtung oder Abwehr (Unterbrechung des Einsatzes) eines gegnerischen Objekts.\nKM12.Anmerkungen.2.  KM 12 erfasst Systeme, die eine der folgenden Antriebsarten verwen­den:\nKM12.Anmerkungen.2.a.  elektromagnetisch;\n','','',''),
(40388,'KM17.  Verschiedene Ausrüstungsgegenstände, Materialien und Bibliotheken wie folgt sowie besonders konstruierte Bestandteile hierfür:\nKM17.Technische Anmerkung.  «Bibliothek» (parametrische technische Datenbank) im Sinne von KM 17 ist eine Sammlung technischer Informationen militärischer Natur, deren Ausnutzung die Leistungsfähigkeit militärischer Ausrüstung oder Systeme erhöhen kann.\n','','',''),
(40389,'KM2.  Bewaffnung oder Waffen jeglichen Kalibers (jedoch ohne Hand und Faustfeuerwaffen der KM 1), Werfer und Zubehör wie folgt sowie besonders konstruierte Bestandteile hierfür:\nKM2.a.  Geschütze, Haubitzen, Kanonen, Mörser, Panzerabwehrwaffen, Einrichtungen zum Abfeuern von Geschossen und Raketen, militä­rische Flammenwerfer und rückstossfreie Waffen;\nKM2.a.Anmerkung.  KM 2.a. schliesst Injektoren, Messgeräte, Speichertanks und besonders konstruierte Bestandteile für den Einsatz von flüssigen Treibladungen für einen der von KM 2.a. erfassten Ausrüstungsgegenstände ein.\n','','',''),
(40390,'KM10.  Luftfahrzeuge, unbemannte Luftfahrzeuge, Triebwerke, Luftfahr­zeug-Ausrüstung, Zusatzausrüstung und Bestandteile, besonders konstruiert oder geändert für Kampf- oder Gefechts­zwecke, wie folgt:\nKM10.d.  unbemannte Luftfahrzeuge einschliesslich ferngelenkter Flugkörper (remotely piloted air vehicles – RPVs –) und autonome, programmierbare Fahrzeuge, besonders konstruiert oder besonders geändert für Kampf- oder Gefechtszwecke, sowie deren Startgeräte, unterstützende Bodengeräte und zugehörige Ausrüstung für die Steuerung.\n','','',''),
(40391,'KM1.  Hand- und Faustfeuerwaffen jeglichen Kalibers und Zubehör sowie besonders konstruierte Bestandteile hierfür, jedoch ohne:\nKM1.b.  Einzellader und Vorderlader;\nKM1.  KM1.a. bis KM 1.d. erfassen auch für Exerziermunition besonders konstruierte Waffen, die keine von Nummer KM 3 erfasste Munition verschiessen können.\n','','',''),
(40392,'KM8.  Militärische Explosivstoffe und Brennstoffe, einschliesslich Treibstoffe:\nKM8.a.  Explosivstoffe und Treibstoffe, welche die folgenden Leistungsparameter erfüllen:\nKM8.a.3.  Feststofftreibmittel der UN-Klasse 1.1 mit einem theoretisch erreichbaren spezifischen Impuls (bei Standard­bedingungen) von mehr als 250  s bei metallfreien oder mehr als 270 s bei aluminiumhaltigen Mischungen;\n','','',''),
(40393,'KM11.  Elektronische Ausrüstung, soweit nicht anderweitig von dieser Liste erfasst, besonders konstruiert für Kampf- und Gefechtszwecke, und besonders konstruierte Bestandteile hierfür\nKM11.Anmerkung.  KM 11 schliesst folgende Ausrüstung ein:\nKM11.Anmerkung.a.  Ausrüstung für elektronische Gegenmassnahmen (ECM) und elektronische Schutzmassnahmen (ECCM), einschliesslich elektronischer Ausrüstung zum Stören und Gegenstören, d.h. Geräte, konstruiert, um in Radar- oder Funkgeräten Störsignale oder verfälschende Signale zu erzeugen oder auf andere Weise den Empfang, den Betrieb oder die Wirksamkeit gegnerischer Empfänger einschliesslich der Geräte für Gegenmassnahmen zu stören;\nKM11.Anmerkung.b.  Ausrüstung für Unterwassergegenmassnahmen einschliesslich akustischer und magnetischer Störung und Täuschung, die in Sonarempfängern Störsi­gnale oder verfälschende Signale erzeugen.\n','','',''),
(40394,'KM12.  Waffensysteme mit hoher kinetischer Energie (high velocity kinetic energy weapon systems) wie folgt sowie besonders konstruierte Bestandteile hierfür:\nKM12.  Waffensysteme mit hoher kinetischer Energie (kinetic energy weapon systems), besonders konstruiert für die Vernichtung oder Abwehr (Unterbrechung des Einsatzes) eines gegnerischen Objekts.\nKM12.Anmerkungen.2.  KM 12 erfasst Systeme, die eine der folgenden Antriebsarten verwen­den:\nKM12.Anmerkungen.2.b.  elektrothermisch;\n','','',''),
(40395,'KM12.  Waffensysteme mit hoher kinetischer Energie (high velocity kinetic energy weapon systems) wie folgt sowie besonders konstruierte Bestandteile hierfür:\nKM12.  Waffensysteme mit hoher kinetischer Energie (kinetic energy weapon systems), besonders konstruiert für die Vernichtung oder Abwehr (Unterbrechung des Einsatzes) eines gegnerischen Objekts.\nKM12.Anmerkungen.3.  KM 12 erfasst nicht die Technologie für die magnetische Induktion zum Dauerantrieb ziviler Transporteinrichtungen.\n','','',''),
(40396,'KM6.  Panzer- und andere Landfahrzeuge und Bestandteile hierfür, besonders konstruiert oder geändert für Kampf- und Gefechtszwecke\nKM6.Anmerkungen.2.  Die Konzipierung oder Änderung eines der erwähnten Landfahrzeuge spe­zifisch für Kampf- und Gefechtszwecke kann eine bauliche, elektri­sche oder mechanische Änderung bedeuten, die ein oder mehrere ent­sprechend konstruierte Bestandteile betrifft. Solche Bestandteile schlie­ssen ein:\nKM6.Anmerkungen.2.a.  Luftreifendecken in beschussfester oder bei abgelassener Luft fahr­tauglicher Spezialbauart;\nKM6.Anmerkungen.2.b.  Reifendruck-Regelvorrichtungen, die aus dem Inneren des fahren­den Fahrzeugs bedient werden können;\nKM6.Anmerkungen.2.c.  Panzerschutz von wichtigen Teilen (z.B. Kraftstofftanks oder Fahr­zeugkabinen);\nKM6.Anmerkungen.2.d.  besondere Verstärkungen für die Aufnahme von Waffen.\n','','',''),
(40397,'KM12.  Waffensysteme mit hoher kinetischer Energie (high velocity kinetic energy weapon systems) wie folgt sowie besonders konstruierte Bestandteile hierfür:\nKM12.  Waffensysteme mit hoher kinetischer Energie (kinetic energy weapon systems), besonders konstruiert für die Vernichtung oder Abwehr (Unterbrechung des Einsatzes) eines gegnerischen Objekts.\nKM12.Anmerkungen.2.  KM 12 erfasst Systeme, die eine der folgenden Antriebsarten verwen­den:\nKM12.Anmerkungen.2.a.  elektromagnetisch;\nKM12.Anmerkungen.2.b.  elektrothermisch;\nKM12.Anmerkungen.2.c.  Plasmaantrieb;\nKM12.Anmerkungen.2.d.  Leichtgasantrieb; oder\nKM12.Anmerkungen.2.e.  chemisch (sofern in Kombination mit den zu a bis d aufgeführten An­triebsarten verwendet).\n','','',''),
(40398,'KM6.  Panzer- und andere Landfahrzeuge und Bestandteile hierfür, besonders konstruiert oder geändert für Kampf- und Gefechtszwecke\nKM6.Anmerkungen.1.  KM 6 schliesst ein:\nKM6.Anmerkungen.1.c.  Raupenfahrzeuge, die spezifisch für Kampf- und Gefechtszwecke kon­zipiert oder abgeändert sind.\n','','',''),
(40399,'KM20.  Kryogenische (Tieftemperatur-) und supraleitende Ausrüstung wie folgt sowie besonders konstruierte Bestandteile und besonders konstruiertes Zubehör hierfür:\nKM20.a.  Ausrüstung, besonders konstruiert oder ausgelegt für den Ein­bau in ein Land-, See-, Luft- oder Raumfahrzeug für Kampf- oder Gefechtszwecke nach dieser Liste, und fähig, während der Fahrt eine Temperatur kleiner als –170 °C (103 K) zu erzeugen oder aufrechtzuerhalten; \nKM20.a.Anmerkung.  KM 20.a. schliesst mobile Systeme ein, die Zubehör und Bestandteile enthalten oder verwenden, die aus nicht-metallischen oder nicht elektrisch leitenden Werkstoffen, z.B. aus Kunststoffen oder epoxidharzimprägnierten Werkstoffen, hergestellt sind. \nKM20.b.  supraleitende elektrische Ausrüstung (rotierende Maschinen und Transformatoren), besonders konstruiert oder besonders ausgelegt für den Einbau in ein Land-, See-, Luft- oder Raumfahrzeug für Kampf- oder Gefechtszwecke nach dieser Liste, und betriebsfähig während der Fahrt.\nKM20.b.Anmerkung.  KM 20.b. erfasst nicht hybride, homopolare Gleichstromgeneratoren mit einem einpoligen, normal ausgelegten Metallanker, der in einem Magnetfeld rotiert, das mit Hilfe supraleitender Wicklungen erzeugt wird, vorausgesetzt, dass diese Wicklungen die einzige supraleitende Baugruppe im Generator sind.\n','','',''),
(40400,'KM12.  Waffensysteme mit hoher kinetischer Energie (high velocity kinetic energy weapon systems) wie folgt sowie besonders konstruierte Bestandteile hierfür:\nKM12.  Waffensysteme mit hoher kinetischer Energie (kinetic energy weapon systems), besonders konstruiert für die Vernichtung oder Abwehr (Unterbrechung des Einsatzes) eines gegnerischen Objekts.\nKM12.Anmerkungen.4.  Waffen, die Unterkalibermunition verwenden oder allein mit chemischem Antrieb arbeiten, und Munition hierfür: siehe KM 1, KM 2, KM 3 und KM 4.\n','','',''),
(40401,'KM7.  Tränengase und andere Reizstoffe zur Bekämpfung von Unruhen:\nKM7.Anmerkungen.1.  Nicht erfasst sind:\nKM7.Anmerkungen.1.b.  Xylylbromide;\n','','',''),
(40402,'KM12.  Waffensysteme mit hoher kinetischer Energie (high velocity kinetic energy weapon systems) wie folgt sowie besonders konstruierte Bestandteile hierfür:\nKM12.  Waffensysteme mit hoher kinetischer Energie (kinetic energy weapon systems), besonders konstruiert für die Vernichtung oder Abwehr (Unterbrechung des Einsatzes) eines gegnerischen Objekts.\nKM12.Anmerkungen.1.  KM 12 schliesst folgende Ausrüstung ein, sofern sie besonders konstruiert ist für Waffensysteme mit hoher kinetischer Energie:\nKM12.Anmerkungen.1.c.  Zielerfassungs-, Zielverfolgungs-, Feuerleitsysteme und Systeme zur Wirkungsermittlung;\n','','',''),
(40403,'KM6.  Panzer- und andere Landfahrzeuge und Bestandteile hierfür, besonders konstruiert oder geändert für Kampf- und Gefechtszwecke\nKM6.Anmerkungen.2.  Die Konzipierung oder Änderung eines der erwähnten Landfahrzeuge spe­zifisch für Kampf- und Gefechtszwecke kann eine bauliche, elektri­sche oder mechanische Änderung bedeuten, die ein oder mehrere ent­sprechend konstruierte Bestandteile betrifft. Solche Bestandteile schlie­ssen ein:\nKM6.Anmerkungen.2.a.  Luftreifendecken in beschussfester oder bei abgelassener Luft fahr­tauglicher Spezialbauart;\n','','',''),
(40404,'KM7.  Tränengase und andere Reizstoffe zur Bekämpfung von Unruhen:\nKM7.Anmerkungen.1.  Nicht erfasst sind:\nKM7.Anmerkungen.1.h.  Chloraceton;\n','','',''),
(40405,'KM6.  Panzer- und andere Landfahrzeuge und Bestandteile hierfür, besonders konstruiert oder geändert für Kampf- und Gefechtszwecke\nKM6.Technische Anmerkung.  «Landfahrzeuge» im Sinne der KM 6 schliessen auch entsprechend ausgerüstete Anhänger ein.\nKM6.Anmerkungen.1.  KM 6 schliesst ein:\nKM6.Anmerkungen.1.a.  Panzerfahrzeuge mit oder ohne Bewaffnung, die spezifisch für Kampf- und Gefechtszwecke konzipiert oder abgeändert sind (umfasst auch Entpannungs- und Bergungspanzer)\nKM6.Anmerkungen.1.b.  andere Fahrzeuge aller Art, die spezifisch für den Einsatz von Waf­fen konzipiert oder abgeändert worden sind (wie z.B. Kampf- und Ge­fechtsfahrzeuge, bewaffnet oder unbewaffnet, ausgestattet mit Lafetten oder Ausrüstung zum Minenlegen oder zum Starten der von KM 4 er­fassten Waffen);\nKM6.Anmerkungen.1.c.  Raupenfahrzeuge, die spezifisch für Kampf- und Gefechtszwecke kon­zipiert oder abgeändert sind.\nKM6.Anmerkungen.2.  Die Konzipierung oder Änderung eines der erwähnten Landfahrzeuge spe­zifisch für Kampf- und Gefechtszwecke kann eine bauliche, elektri­sche oder mechanische Änderung bedeuten, die ein oder mehrere ent­sprechend konstruierte Bestandteile betrifft. Solche Bestandteile schlie­ssen ein:\nKM6.Anmerkungen.2.a.  Luftreifendecken in beschussfester oder bei abgelassener Luft fahr­tauglicher Spezialbauart;\nKM6.Anmerkungen.2.b.  Reifendruck-Regelvorrichtungen, die aus dem Inneren des fahren­den Fahrzeugs bedient werden können;\nKM6.Anmerkungen.2.c.  Panzerschutz von wichtigen Teilen (z.B. Kraftstofftanks oder Fahr­zeugkabinen);\nKM6.Anmerkungen.2.d.  besondere Verstärkungen für die Aufnahme von Waffen.\nKM6.Anmerkungen.3.  KM 6 erfasst keine zivilen Sonderschutzlimousinen und Werttransporter mit Schutzpanzerung.\n','','',''),
(40406,'KM19.  Strahlenwaffen-Systeme wie folgt und besonders konstruierte Bestandteile hierfür:\nKM19.Anmerkungen.2.  KM 19 schliesst folgende Ausrüstung ein, sofern sie besonders kon­struiert ist für Strahlenwaffensysteme:\nKM19.Anmerkungen.2.k.  weltraumgeeignete Folien zur Neutralisierung von negativen Wasserstoffisotopenstrahlen.\n','','',''),
(40407,'KM3.  Munition für die von den Positionen KM 1, KM 2 oder KM 12 er­fassten Waffen sowie besonders konstruierte Bestandteile hierfür\nKM3.Anmerkungen.2.  KM 3 erfasst nicht Munition ohne Geschoss (Manöver-, Signalmuni­tion) und Exerziermunition mit gelochter Pulverkammer.\n','','',''),
(40408,'KM4.  Bomben, Torpedos, Raketen, Flugkörper sowie zugehörige Aus­rüstung und Zubehör wie folgt, besonders konstruiert für Kampf- oder Gefechtszwecke, und besonders konstruierte Bestandteile hier­für: Bomben, Torpedos, Granaten, Rauch- und Nebelbüchsen, Raketen, Minen, Flugkörper, Wasserbomben, Sprengkörper-Ladungen, Vor­richtun­gen und Zubehör, militärische Pyrotechnika, Leuchtpatronen und Dar­stellungsmunition (d.h. Ausrüstung, welche die Eigenschaften einer der von KM 4 erfassten Waren simuliert).\nKM4.Anmerkung.  KM 4 schliesst ein:\nKM4.Anmerkung.2.  Antriebsdüsen für Flugkörper und Bugspitzen für Wiedereintrittskörper.\n','','',''),
