(40411,'KM13.  Spezialpanzer- oder Schutzausrüstung und Konstruktionen sowie Bestandteile wie folgt:\nKM13.a.  Panzerplatten wie folgt:\nKM13.a.1.  hergestellt, um einen militärischen Standard oder eine militä­rische Spezifikation zu erfüllen; oder\nKM13.a.2.  geeignet für Kampf- oder Gefechtszwecke;\n','','',''),
