(40416,'KM11.  Elektronische Ausrüstung, soweit nicht anderweitig von dieser Liste erfasst, besonders konstruiert für Kampf- und Gefechtszwecke, und besonders konstruierte Bestandteile hierfür\nKM11.Anmerkung.  KM 11 schliesst folgende Ausrüstung ein:\nKM11.Anmerkung.a.  Ausrüstung für elektronische Gegenmassnahmen (ECM) und elektronische Schutzmassnahmen (ECCM), einschliesslich elektronischer Ausrüstung zum Stören und Gegenstören, d.h. Geräte, konstruiert, um in Radar- oder Funkgeräten Störsignale oder verfälschende Signale zu erzeugen oder auf andere Weise den Empfang, den Betrieb oder die Wirksamkeit gegnerischer Empfänger einschliesslich der Geräte für Gegenmassnahmen zu stören;\n','','',''),
(40417,'KM5.  Feuerleiteinrichtungen, besonders konstruiert für Kampf- und Gefechtszwecke, wie folgt, sowie besonders konstruierte Bestandteile und besonders konstruiertes Zubehör hierfür\nKM5.b.  Zielerfassungs-, Zielzuordnungs-, Zielentfernungsmess- oder Zielverfol­gungs­systeme; Ortungs- oder Datenverknüpfungsvorrichtungen (data fusion) und Ausrüstung zur Sensorintegration (sensor integration equipment).\n','','',''),
