(40419,'KM4.  Bomben, Torpedos, Raketen, Flugkörper sowie zugehörige Aus­rüstung und Zubehör wie folgt, besonders konstruiert für Kampf- oder Gefechtszwecke, und besonders konstruierte Bestandteile hier­für: Bomben, Torpedos, Granaten, Rauch- und Nebelbüchsen, Raketen, Minen, Flugkörper, Wasserbomben, Sprengkörper-Ladungen, Vor­richtun­gen und Zubehör, militärische Pyrotechnika, Leuchtpatronen und Dar­stellungsmunition (d.h. Ausrüstung, welche die Eigenschaften einer der von KM 4 erfassten Waren simuliert).\nKM4.Anmerkung.  KM 4 schliesst ein:\nKM4.Anmerkung.1.  Rauch- und Nebelgranaten, Feuerbomben, Brandbomben und Spreng­körper;\n','','',''),
(40420,'KM19.  Strahlenwaffen-Systeme wie folgt und besonders konstruierte Bestandteile hierfür:\nKM19.Anmerkungen.1.  Von KM 19 erfasste Strahlenwaffen schliessen Systeme ein, deren Lei­s­tungsfähigkeit bestimmt wird durch den kontrollierten Einsatz von: \nKM19.Anmerkungen.1.a.  Lasern mit einer Dauerstrich- oder Impulsenergie, die eine mit herkömmlicher Munition vergleichbare Vernichtungswirkung errei­chen;\nKM19.Anmerkungen.1.b.  Teilchenbeschleunigern, die einen geladenen oder ungeladenen Strahl mit Vernichtungswirkung aussenden;\nKM19.Anmerkungen.1.c.  Hochfrequenzsendern mit hoher Impulsenergie oder hoher Durchschnittsenergie, die ein ausreichend starkes Feld erzeugen, um elektronische Schaltungen in einem entfernt liegenden Ziel ausser Betrieb zu setzen.\n','','',''),
(40421,'KM17.  Verschiedene Ausrüstungsgegenstände, Materialien und Bibliotheken wie folgt sowie besonders konstruierte Bestandteile hierfür:\nKM17.b.  Bibliotheken (parametrische technische Datenbanken), besonders entwickelt für Kampf- oder Gefechtszwecke in Verbindung mit Ausrüstung, die von dieser Liste erfasst wird;\n','','',''),
(40422,'KM9.  Kriegsschiffe und Zubehör wie folgt sowie Bestandteile hierfür, besonders konstruiert für Kampf- und Gefechtszwecke:\nKM9.b.  Motoren wie folgt:\nKM9.b.1.  Dieselmotoren, besonders konstruiert für U-Boote, mit allen folgenden Eigenschaften:\nKM9.b.1.a.  Leistung grösser/gleich 1,12 MW (1500 PS); und\n','','',''),
(40423,'KM12.  Waffensysteme mit hoher kinetischer Energie (high velocity kinetic energy weapon systems) wie folgt sowie besonders konstruierte Bestandteile hierfür:\nKM12.  Waffensysteme mit hoher kinetischer Energie (kinetic energy weapon systems), besonders konstruiert für die Vernichtung oder Abwehr (Unterbrechung des Einsatzes) eines gegnerischen Objekts.\nKM12.Anmerkungen.1.  KM 12 schliesst folgende Ausrüstung ein, sofern sie besonders konstruiert ist für Waffensysteme mit hoher kinetischer Energie:\nKM12.Anmerkungen.1.a.  Startantriebssysteme, die Massen grösser als 0,1 g auf Geschwin­dig­keiten über 1,6 km/s in den Betriebsarten Einzelfeuer oder Schnell­feuer beschleunigen können;\nKM12.Anmerkungen.1.b.  Ausrüstung für die Erzeugung von Primärenergie, Elektroschutz (electric armour), Energiespeicherung, Kontrolle des Wärmehaus­halts und Klimatisierung, Schaltvorrichtungen und Ausrüstung für die Handhabung von Treibstoffen, elektrische Schnittstellen zwi­schen Stromversorgung, Geschütz und anderen elektrischen Richt­funktionen des Turms;\nKM12.Anmerkungen.1.c.  Zielerfassungs-, Zielverfolgungs-, Feuerleitsysteme und Systeme zur Wirkungsermittlung;\nKM12.Anmerkungen.1.d.  Zielsuch-, Zielansteuerungssysteme und Systeme zur Umlenkung des Vortriebs (seitliche Beschleunigung) für Geschosse.\nKM12.Anmerkungen.2.  KM 12 erfasst Systeme, die eine der folgenden Antriebsarten verwen­den:\nKM12.Anmerkungen.2.a.  elektromagnetisch;\nKM12.Anmerkungen.2.b.  elektrothermisch;\nKM12.Anmerkungen.2.c.  Plasmaantrieb;\nKM12.Anmerkungen.2.d.  Leichtgasantrieb; oder\nKM12.Anmerkungen.2.e.  chemisch (sofern in Kombination mit den zu a bis d aufgeführten An­triebsarten verwendet).\nKM12.Anmerkungen.3.  KM 12 erfasst nicht die Technologie für die magnetische Induktion zum Dauerantrieb ziviler Transporteinrichtungen.\nKM12.Anmerkungen.4.  Waffen, die Unterkalibermunition verwenden oder allein mit chemischem Antrieb arbeiten, und Munition hierfür: siehe KM 1, KM 2, KM 3 und KM 4.\n','','',''),
(40424,'KM19.  Strahlenwaffen-Systeme wie folgt und besonders konstruierte Bestandteile hierfür:\nKM19.Anmerkungen.2.  KM 19 schliesst folgende Ausrüstung ein, sofern sie besonders kon­struiert ist für Strahlenwaffensysteme:\nKM19.Anmerkungen.2.g.  Strominjektoren für negative Wasserstoffionenstrahlen; \n','','',''),
