(40426,'KM4.  Bomben, Torpedos, Raketen, Flugkörper sowie zugehörige Aus­rüstung und Zubehör wie folgt, besonders konstruiert für Kampf- oder Gefechtszwecke, und besonders konstruierte Bestandteile hier­für: Bomben, Torpedos, Granaten, Rauch- und Nebelbüchsen, Raketen, Minen, Flugkörper, Wasserbomben, Sprengkörper-Ladungen, Vor­richtun­gen und Zubehör, militärische Pyrotechnika, Leuchtpatronen und Dar­stellungsmunition (d.h. Ausrüstung, welche die Eigenschaften einer der von KM 4 erfassten Waren simuliert).\nKM4.Anmerkung.  KM 4 schliesst ein:\nKM4.Anmerkung.1.  Rauch- und Nebelgranaten, Feuerbomben, Brandbomben und Spreng­körper;\nKM4.Anmerkung.2.  Antriebsdüsen für Flugkörper und Bugspitzen für Wiedereintrittskörper.\n','','',''),
(40427,'KM10.  Luftfahrzeuge, unbemannte Luftfahrzeuge, Triebwerke, Luftfahr­zeug-Ausrüstung, Zusatzausrüstung und Bestandteile, besonders konstruiert oder geändert für Kampf- oder Gefechts­zwecke, wie folgt:\nKM10.c.  Triebwerke für Luftfahrzeuge der Buchstaben a und b hievor und besonders konstruierte Bestandteile hierfür;\n','','',''),
(40428,'KM8.  Militärische Explosivstoffe und Brennstoffe, einschliesslich Treibstoffe:\nKM8.a.  Explosivstoffe und Treibstoffe, welche die folgenden Leistungsparameter erfüllen:\nKM8.a.1.  Explosivstoffe mit einer Detonationsgeschwindigkeit grösser als 8700 m/s oder einem Detonationsdruck grösser als 34 GPa (340 kbar);\nKM8.a.2.  organische Explosivstoffe, die einen Detonationsdruck grösser/gleich 25 GPa (250 kbar) ergeben und bei Tempe­raturen grösser/gleich 250°C (523 K) für die Dauer von 5 min oder länger stabil bleiben;\nKM8.a.3.  Feststofftreibmittel der UN-Klasse 1.1 mit einem theoretisch erreichbaren spezifischen Impuls (bei Standard­bedingungen) von mehr als 250  s bei metallfreien oder mehr als 270 s bei aluminiumhaltigen Mischungen;\nKM8.a.4.  Feststofftreibmittel der UN-Klasse 1.3 mit einem theoretisch erreichbaren spezifischen Impuls von mehr als 230 s bei halogenfreien, 250 s bei metallfreien und 266 s bei metallhaltigen Mischungen;\nKM8.a.5.  Schiesspulver mit einer Kraftkonstante grösser als 1200 kJ/kg;\nKM8.a.6.  Explosivstoffe, Treibstoffe oder pyrotechnische Stoffe, die eine stabile gleichförmige Abbrandgeschwindigkeit von mehr als 38 mm/s bei 6,89 MPa (68,9 bar) und 21°C (294 K) aufweisen; oder\nKM8.a.7.  elastomermodifizierte gegossene zweibasige Treibmittel (EMCDB), die bei -40 °C (233 K) eine Dehnungsfähigkeit von mehr als 5 % bei grösster Beanspruchung aufweisen;\nKM8.b.  militärische Pyrotechnika;\nKM8.c.  andere Stoffe wie folgt:\nKM8.c.1.  Luftfahrzeug-Treibstoffe, besonders konstruiert für militärische Zwecke;\nKM8.c.2.  militärische Materialien, die für die Verwendung in Flammenwerfern oder Brandbomben besonders entwickelte Verdicker für Kohlenwasserstoff-Brennstoffe enthalten, wie Metallstearate oder Palmitate (Oktal) (CAS-Nr. 637-12-7) und M1, M2, M3-Verdicker;\nKM8.c.3.  flüssige Oxidationsmittel, die aus inhibierter rauchender Salpetersäure (IRFNA) oder Sauerstoffdifluorid bestehen oder diese Stoffe enthalten.\nKM8.Anmerkung.  Luftfahrzeug-Treibstoffe, die von KM 8.c.1. erfasst werden, sind Fertigprodukte und nicht deren Einzelkomponenten\n','','',''),
(40429,'KM2.  Bewaffnung oder Waffen jeglichen Kalibers (jedoch ohne Hand und Faustfeuerwaffen der KM 1), Werfer und Zubehör wie folgt sowie besonders konstruierte Bestandteile hierfür:\nKM2.b.  militärische Nebel- und Gaswerfer, militärische pyrotechnische Werfer oder Generatoren.\nKM2.b.Anmerkung.  KM 2.b. erfasst nicht Signalpistolen.\n','','',''),
(40430,'KM6.  Panzer- und andere Landfahrzeuge und Bestandteile hierfür, besonders konstruiert oder geändert für Kampf- und Gefechtszwecke\nKM6.Anmerkungen.2.  Die Konzipierung oder Änderung eines der erwähnten Landfahrzeuge spe­zifisch für Kampf- und Gefechtszwecke kann eine bauliche, elektri­sche oder mechanische Änderung bedeuten, die ein oder mehrere ent­sprechend konstruierte Bestandteile betrifft. Solche Bestandteile schlie­ssen ein:\nKM6.Anmerkungen.2.d.  besondere Verstärkungen für die Aufnahme von Waffen.\n','','',''),
(40431,'KM9.  Kriegsschiffe und Zubehör wie folgt sowie Bestandteile hierfür, besonders konstruiert für Kampf- und Gefechtszwecke:\nKM9.b.  Motoren wie folgt:\nKM9.b.2  Elektromotoren, besonders konstruiert für U-Boote, mit allen folgenden Eigenschaften:\nKM9.b.2.a.  Leistung grösser als 0,75 MW (1000 PS);\nKM9.b.2.b.  schnell umsteuerbar;\nKM9.b.2.c.  flüssigkeitsgekühlt; und \nKM9.b.2.d.  vollständig gekapselt;\n','','',''),
(40432,'KM10.  Luftfahrzeuge, unbemannte Luftfahrzeuge, Triebwerke, Luftfahr­zeug-Ausrüstung, Zusatzausrüstung und Bestandteile, besonders konstruiert oder geändert für Kampf- oder Gefechts­zwecke, wie folgt:\nKM10.Anmerkungen.2.  KM 10.c. erfasst nicht:\nKM10.Anmerkungen.2.b.  Kolbentriebwerke oder deren besonders konstruierte Bestandteile.\n','','',''),
(40433,'KM3.  Munition für die von den Positionen KM 1, KM 2 oder KM 12 er­fassten Waffen sowie besonders konstruierte Bestandteile hierfür\nKM3.Anmerkungen.1.  Besonders konstruierte Bestandteile schliessen ein:\nKM3.Anmerkungen.1.a.  Metall- oder Kunststoffbestandteile, z.B. Ambosse in Zündhüt­chen, Geschossmäntel, Patronengurtglieder, Führungsringe und andere Mu­nitionsbestandteile aus Metall;\nKM3.Anmerkungen.1.b.  Sicherungseinrichtungen, Zünder, Sensoren und Anzündvorrich­tun­gen;\nKM3.Anmerkungen.1.c.  Stromquellen für die einmalige Abgabe einer hohen Leistung;\nKM3.Anmerkungen.1.d.  abbrennbare Hülsen für Treibladungen;\nKM3.Anmerkungen.1.e.  Submunition einschliesslich Bomblets, Minelets und endphasen­gelenkter Geschosse.\nKM3.Anmerkungen.2.  KM 3 erfasst nicht Munition ohne Geschoss (Manöver-, Signalmuni­tion) und Exerziermunition mit gelochter Pulverkammer.\n','','',''),
(40434,'KM13.  Spezialpanzer- oder Schutzausrüstung und Konstruktionen sowie Bestandteile wie folgt:\nKM13.Anmerkung.  KM 13.b. schliesst Werkstoffe ein, besonders konstruiert zur Bildung einer explosionsreaktiven Panzerung oder zum Bau militärischer Unterstände (shelters).\n','','',''),
(40435,'KM3.  Munition für die von den Positionen KM 1, KM 2 oder KM 12 er­fassten Waffen sowie besonders konstruierte Bestandteile hierfür\nKM3.Anmerkungen.1.  Besonders konstruierte Bestandteile schliessen ein:\nKM3.Anmerkungen.1.b.  Sicherungseinrichtungen, Zünder, Sensoren und Anzündvorrich­tun­gen;\n','','',''),
(40436,'KM3.  Munition für die von den Positionen KM 1, KM 2 oder KM 12 er­fassten Waffen sowie besonders konstruierte Bestandteile hierfür\nKM3.Anmerkungen.1.  Besonders konstruierte Bestandteile schliessen ein:\nKM3.Anmerkungen.1.e.  Submunition einschliesslich Bomblets, Minelets und endphasen­gelenkter Geschosse.\n','','',''),
(40437,'KM8.  Militärische Explosivstoffe und Brennstoffe, einschliesslich Treibstoffe:\nKM8.b.  militärische Pyrotechnika;\n','','',''),
(40438,'KM10.  Luftfahrzeuge, unbemannte Luftfahrzeuge, Triebwerke, Luftfahr­zeug-Ausrüstung, Zusatzausrüstung und Bestandteile, besonders konstruiert oder geändert für Kampf- oder Gefechts­zwecke, wie folgt:\nKM10.Anmerkungen.2.  KM 10.c. erfasst nicht:\nKM10.Anmerkungen.2.a.  Triebwerke, konstruiert oder geändert für Kampf- oder Gefechts­zwecke, die von einer Zivilluftfahrtbehörde eines Teilnehmerstaates für die Verwendung in zivilen Luftfahrzeugen zugelassen sind, sowie deren besonders konstruierte Bestandteile;\n','','',''),
(40439,'KM7.  Tränengase und andere Reizstoffe zur Bekämpfung von Unruhen:\nKM7.Anmerkungen.1.  Nicht erfasst sind:\nKM7.Anmerkungen.1.i.  Jodessigsäureethylester;\n','','',''),
(40440,'KM12.  Waffensysteme mit hoher kinetischer Energie (high velocity kinetic energy weapon systems) wie folgt sowie besonders konstruierte Bestandteile hierfür:\nKM12.  Waffensysteme mit hoher kinetischer Energie (kinetic energy weapon systems), besonders konstruiert für die Vernichtung oder Abwehr (Unterbrechung des Einsatzes) eines gegnerischen Objekts.\nKM12.Anmerkungen.1.  KM 12 schliesst folgende Ausrüstung ein, sofern sie besonders konstruiert ist für Waffensysteme mit hoher kinetischer Energie:\nKM12.Anmerkungen.1.a.  Startantriebssysteme, die Massen grösser als 0,1 g auf Geschwin­dig­keiten über 1,6 km/s in den Betriebsarten Einzelfeuer oder Schnell­feuer beschleunigen können;\nKM12.Anmerkungen.1.b.  Ausrüstung für die Erzeugung von Primärenergie, Elektroschutz (electric armour), Energiespeicherung, Kontrolle des Wärmehaus­halts und Klimatisierung, Schaltvorrichtungen und Ausrüstung für die Handhabung von Treibstoffen, elektrische Schnittstellen zwi­schen Stromversorgung, Geschütz und anderen elektrischen Richt­funktionen des Turms;\nKM12.Anmerkungen.1.c.  Zielerfassungs-, Zielverfolgungs-, Feuerleitsysteme und Systeme zur Wirkungsermittlung;\nKM12.Anmerkungen.1.d.  Zielsuch-, Zielansteuerungssysteme und Systeme zur Umlenkung des Vortriebs (seitliche Beschleunigung) für Geschosse.\n','','',''),
(40441,'KM19.  Strahlenwaffen-Systeme wie folgt und besonders konstruierte Bestandteile hierfür:\nKM19.b.  Teilchenstrahl-Systeme, geeignet für die Vernichtung oder Abwehr (Unterbrechung des Einsatzes) eines gegnerischen Objekts;\n','','',''),
(40442,'KM10.  Luftfahrzeuge, unbemannte Luftfahrzeuge, Triebwerke, Luftfahr­zeug-Ausrüstung, Zusatzausrüstung und Bestandteile, besonders konstruiert oder geändert für Kampf- oder Gefechts­zwecke, wie folgt:\nKM10.Anmerkungen.1.  KM 10.b. erfasst nicht Luftfahrzeuge oder Varianten dieser Luftfahr­zeuge, besonders konstruiert für militärische Zwecke, die:\nKM10.Anmerkungen.1.a.  nicht für eine militärische Verwendung konfiguriert sind und die nicht mit technischen Ausrüstungen oder Zusatzeinrichtungen ver­sehen sind, die für Kampf- oder Gefechtszwecke besonders kon­struiert oder geändert sind; und\nKM10.Anmerkungen.1.b.  von einer Zivilluftfahrtbehörde eines Teilnehmerstaates für die zivile Verwendung zugelassen sind.\n','','',''),
(40443,'KM19.  Strahlenwaffen-Systeme wie folgt und besonders konstruierte Bestandteile hierfür:\nKM19.Anmerkungen.1.  Von KM 19 erfasste Strahlenwaffen schliessen Systeme ein, deren Lei­s­tungsfähigkeit bestimmt wird durch den kontrollierten Einsatz von: \nKM19.Anmerkungen.1.a.  Lasern mit einer Dauerstrich- oder Impulsenergie, die eine mit herkömmlicher Munition vergleichbare Vernichtungswirkung errei­chen;\n','','',''),
(40444,'KM1.  Hand- und Faustfeuerwaffen jeglichen Kalibers und Zubehör sowie besonders konstruierte Bestandteile hierfür, jedoch ohne:\nKM1.a.  eindeutig erkennbare Jagd- und Sportwaffen (z. B. nach ISSF-Norm), die in derselben Ausführung nicht auch Kampfwaffen sind;\nKM1.  KM1.a. bis KM 1.d. erfassen auch für Exerziermunition besonders konstruierte Waffen, die keine von Nummer KM 3 erfasste Munition verschiessen können.\n','','',''),
(40445,'KM7.  Tränengase und andere Reizstoffe zur Bekämpfung von Unruhen:\nKM7.Anmerkungen.1.  Nicht erfasst sind:\nKM7.Anmerkungen.1.a.  Bromessigsäureethylester;\nKM7.Anmerkungen.1.b.  Xylylbromide;\nKM7.Anmerkungen.1.c.  Benzylbromid;\nKM7.Anmerkungen.1.d.  Benzyljodid;\nKM7.Anmerkungen.1.e.  Bromaceton;\nKM7.Anmerkungen.1.f.  Bromcyan;\nKM7.Anmerkungen.1.g.  Brommethylethylketon;\nKM7.Anmerkungen.1.h.  Chloraceton;\nKM7.Anmerkungen.1.i.  Jodessigsäureethylester;\nKM7.Anmerkungen.1.j.  Jodaceton.\n','','',''),
(40446,'KM8.  Militärische Explosivstoffe und Brennstoffe, einschliesslich Treibstoffe:\nKM8.c.  andere Stoffe wie folgt:\nKM8.c.1.  Luftfahrzeug-Treibstoffe, besonders konstruiert für militärische Zwecke;\n','','',''),
(40447,'KM10.  Luftfahrzeuge, unbemannte Luftfahrzeuge, Triebwerke, Luftfahr­zeug-Ausrüstung, Zusatzausrüstung und Bestandteile, besonders konstruiert oder geändert für Kampf- oder Gefechts­zwecke, wie folgt:\nKM10.Anmerkungen.3.  Die Erfassung in KM 10.b. und KM 10.c. von besonders konstruierten Bestandteilen und zugehöriger Ausrüstung für nicht-militärische Luftfahrzeuge oder Triebwerke, die für Kampf- und Gefechtszwecke geändert sind, erstreckt sich nur auf solche militärischen Bestandteile und zugehörige militärische Ausrüstung, die für die Änderung für Kampf- oder Gefechtszwecke nötig sind.\n','','',''),
(40448,'KM8.  Militärische Explosivstoffe und Brennstoffe, einschliesslich Treibstoffe:\nKM8.a.  Explosivstoffe und Treibstoffe, welche die folgenden Leistungsparameter erfüllen:\nKM8.a.1.  Explosivstoffe mit einer Detonationsgeschwindigkeit grösser als 8700 m/s oder einem Detonationsdruck grösser als 34 GPa (340 kbar);\nKM8.a.2.  organische Explosivstoffe, die einen Detonationsdruck grösser/gleich 25 GPa (250 kbar) ergeben und bei Tempe­raturen grösser/gleich 250°C (523 K) für die Dauer von 5 min oder länger stabil bleiben;\nKM8.a.3.  Feststofftreibmittel der UN-Klasse 1.1 mit einem theoretisch erreichbaren spezifischen Impuls (bei Standard­bedingungen) von mehr als 250  s bei metallfreien oder mehr als 270 s bei aluminiumhaltigen Mischungen;\nKM8.a.4.  Feststofftreibmittel der UN-Klasse 1.3 mit einem theoretisch erreichbaren spezifischen Impuls von mehr als 230 s bei halogenfreien, 250 s bei metallfreien und 266 s bei metallhaltigen Mischungen;\nKM8.a.5.  Schiesspulver mit einer Kraftkonstante grösser als 1200 kJ/kg;\nKM8.a.6.  Explosivstoffe, Treibstoffe oder pyrotechnische Stoffe, die eine stabile gleichförmige Abbrandgeschwindigkeit von mehr als 38 mm/s bei 6,89 MPa (68,9 bar) und 21°C (294 K) aufweisen; oder\nKM8.a.7.  elastomermodifizierte gegossene zweibasige Treibmittel (EMCDB), die bei -40 °C (233 K) eine Dehnungsfähigkeit von mehr als 5 % bei grösster Beanspruchung aufweisen;\n','','',''),
(40449,'KM6.  Panzer- und andere Landfahrzeuge und Bestandteile hierfür, besonders konstruiert oder geändert für Kampf- und Gefechtszwecke\nKM6.Anmerkungen.1.  KM 6 schliesst ein:\nKM6.Anmerkungen.1.b.  andere Fahrzeuge aller Art, die spezifisch für den Einsatz von Waf­fen konzipiert oder abgeändert worden sind (wie z.B. Kampf- und Ge­fechtsfahrzeuge, bewaffnet oder unbewaffnet, ausgestattet mit Lafetten oder Ausrüstung zum Minenlegen oder zum Starten der von KM 4 er­fassten Waffen);\n','','',''),
(40450,'KM7.  Tränengase und andere Reizstoffe zur Bekämpfung von Unruhen:\nKM7.Anmerkungen.1.  Nicht erfasst sind:\nKM7.Anmerkungen.1.j.  Jodaceton.\n','','',''),
(40451,'KM19.  Strahlenwaffen-Systeme wie folgt und besonders konstruierte Bestandteile hierfür:\nKM19.Anmerkungen.2.  KM 19 schliesst folgende Ausrüstung ein, sofern sie besonders kon­struiert ist für Strahlenwaffensysteme:\nKM19.Anmerkungen.2.a.  Geräte für die Erzeugung von Primärenergie, Energiespeicher, Schalt­vorrichtungen, Geräte für die Energiekonditionierung und Geräte für die Handhabung von Treibstoffen;\nKM19.Anmerkungen.2.b.  Zielerfassungs- und Zielverfolgungssysteme;\nKM19.Anmerkungen.2.c.  Systeme für die Auswertung der Schadenswirkung, Zerstörung oder Einsatzunterbrechung;\nKM19.Anmerkungen.2.d.  Geräte für die Strahllenkung, -ausbreitung und -ausrichtung;\nKM19.Anmerkungen.2.e.  Geräte für die rasche Strahlschwenkung zur schnellen Bekämpfung von Mehrfachzielen;\nKM19.Anmerkungen.2.f.  anpassungsfähige Optiken oder Phasenkonjugatoren (phase conjugators);\nKM19.Anmerkungen.2.g.  Strominjektoren für negative Wasserstoffionenstrahlen; \nKM19.Anmerkungen.2.h.  weltraumgeeignete Beschleuniger-Bestandteile (accelerator components);\nKM19.Anmerkungen.2.i.  negative Ionenstrahl-Ausweitungs-Ausrüstung (negative ion beam funnelling equipment);\nKM19.Anmerkungen.2.j.  Ausrüstung zur Steuerung und Schwenkung eines energiereichen Ionenstrahls;\nKM19.Anmerkungen.2.k.  weltraumgeeignete Folien zur Neutralisierung von negativen Wasserstoffisotopenstrahlen.\n','','',''),
(40452,'KM7.  Tränengase und andere Reizstoffe zur Bekämpfung von Unruhen:\nKM7.1.  CA: Brombenzylcyanid (CAS-Nr. 5798-79-8);\nKM7.2.  CS: o-Chlorbenzylidenmalodinitril (CAS-Nr. 2698-41-1);\nKM7.3.  CN: -Chloracetophenon (CAS-Nr. 532-27-4);\nKM7.4.  CR: Dibenz(b,f)-1,4-oxazepin (CAS-Nr. 257-07-8).\nKM7.Anmerkungen.1.  Nicht erfasst sind:\nKM7.Anmerkungen.1.a.  Bromessigsäureethylester;\nKM7.Anmerkungen.1.b.  Xylylbromide;\nKM7.Anmerkungen.1.c.  Benzylbromid;\nKM7.Anmerkungen.1.d.  Benzyljodid;\nKM7.Anmerkungen.1.e.  Bromaceton;\nKM7.Anmerkungen.1.f.  Bromcyan;\nKM7.Anmerkungen.1.g.  Brommethylethylketon;\nKM7.Anmerkungen.1.h.  Chloraceton;\nKM7.Anmerkungen.1.i.  Jodessigsäureethylester;\nKM7.Anmerkungen.1.j.  Jodaceton.\nKM7.Anmerkungen.2.  Nicht erfasst sind einzeln abgepackte Tränengase oder andere Reizstoffe für persönliche Selbstverteidigungszwecke.\n','','',''),
(40453,'KM1.  Hand- und Faustfeuerwaffen jeglichen Kalibers und Zubehör sowie besonders konstruierte Bestandteile hierfür, jedoch ohne:\nKM1.d.  alte Waffen, für die keine verwendbare Munition mehr herge­stellt wird oder im öffentlichen Handel erhältlich ist.\nKM1.d.Anmerkung.  KM 1.d. erfasst auch folgende Waffen:\nKM1.d.Anmerkung.2.  Revolver, Pistolen und Maschinenwaffen, die vor 1890 hergestellt wurden, und ihre Nachbildungen.\nKM1.  KM1.a. bis KM 1.d. erfassen auch für Exerziermunition besonders konstruierte Waffen, die keine von Nummer KM 3 erfasste Munition verschiessen können.\n','','',''),
(40454,'KM7.  Tränengase und andere Reizstoffe zur Bekämpfung von Unruhen:\nKM7.Anmerkungen.1.  Nicht erfasst sind:\nKM7.Anmerkungen.1.a.  Bromessigsäureethylester;\n','','','');
